B.FC=new A.bn("4\xaa Esta\xe7\xe3o - Jesus se encontra com sua M\xe3e dolorosa\n","V. N\xf3s vos adoramos, \xf3 Cristo, e vos bendizemos.\nR. Porque, por vossa santa Cruz, redimistes o mundo.\n\nContemplemos como deve ter sido o encontro, neste caminho, do Filho e da M\xe3e. Jesus e Maria se olharam entre si, e os olhares mudos que trocaram foram outras tantas setas a atravessar o cora\xe7\xe3o amante de ambos.\n\nOra\xe7\xe3o. \u2014 \xd3 amant\xedssimo Jesus, pela dor acerba que experimentastes neste encontro, tornai-me, eu vos pe\xe7o, verdadeiramente devoto de vossa M\xe3e sant\xedssima. E v\xf3s, \xf3 minha dolorosa Rainha, intercedei por mim e alcan\xe7ai-me uma tal mem\xf3ria dos supl\xedcios de vosso Filho, que minha mente esteja para sempre detida na piedosa contempla\xe7\xe3o deles. Amo-vos, \xf3 Jesus, meu Amor; arrependo-me de ter-vos ofendido. N\xe3o me permitais novamente pecar contra v\xf3s. Dai-me amor perp\xe9tuo a v\xf3s e fazei de mim o que quiserdes.\n\nPai-nosso, Ave-Maria, Gl\xf3ria.\n\nDe Maria lacrimosa,\nNo encontro lastimosa,\nV\xea a imensa compaix\xe3o.\nPela Virgem dolorosa,\nVossa M\xe3e t\xe3o piedosa,\nPerdoai-me, meu Jesus.",null)
B.FD=new A.bn("A visita de Nossa Senhora \xe0 sua prima Santa Isabel\n",u.l,null)
B.FE=new A.bn("12\xaa Esta\xe7\xe3o - Jesus morre na Cruz\n","V. N\xf3s vos adoramos, \xf3 Cristo, e vos bendizemos.\nR. Porque, por vossa santa Cruz, redimistes o mundo.\n\nContemplemos Jesus preso \xe0 nossa Cruz. Ap\xf3s tr\xeas horas de luta, consumido enfim pelas dores, Ele deu o corpo \xe0 morte e, de cabe\xe7a inclinada, entregou o esp\xedrito.\n\nOra\xe7\xe3o. \u2014 \xd3 Jesus morto, movido por \xedntimos afetos de piedade, beijo esta Cruz em que v\xf3s, por minha causa, cumpristes o curso de vossa vida. Pelos pecados cometidos, mereci uma morte infeliz; mas vossa morte \xe9 minha esperan\xe7a. Pelos m\xe9ritos de vossa morte, concedei-me, pe\xe7o-vos, que, abra\xe7ado aos vossos p\xe9s e abrasado de amor por v\xf3s, eu entregue um dia meu esp\xedrito. Amo-vos de todo o meu cora\xe7\xe3o; arrependo-me de ter-vos ofendido. N\xe3o permitais que eu novamente vos ofenda. Dai-me amor perp\xe9tuo a v\xf3s e fazei de mim o que quiserdes.\n\nPai-nosso, Ave-Maria, Gl\xf3ria.\n\nPor meus crimes padecestes,\nMeu Jesus, por mim morrestes,\nOh, qu\xe3o grande \xe9 minha dor!\nPela Virgem dolorosa,\nVossa M\xe3e t\xe3o piedosa,\nPerdoai-me, meu Jesus.",null)
B.FF=new A.bn("7\xaa Esta\xe7\xe3o - Jesus cai pela segunda vez\n","V. N\xf3s vos adoramos, \xf3 Cristo, e vos bendizemos.\nR. Porque, por vossa santa Cruz, redimistes o mundo.\n\nContemplemos a segunda queda de Jesus sob o peso da Cruz, na qual se lhe aprofundam todas as chagas da vener\xe1vel cabe\xe7a e de todo o corpo, e se renovam todas as ang\xfastias do doloroso Senhor.\n\nOra\xe7\xe3o. \u2014 \xd3 mans\xedssimo Jesus, quantas vezes me concedestes o perd\xe3o! Eu, por\xe9m, reca\xed nos mesmos pecados e renovei minhas ofensas contra v\xf3s. Pelo m\xe9rito desta vossa nova queda, ajudai-me a perseverar em vossa gra\xe7a at\xe9 a morte. Fazei, em todas as tenta\xe7\xf5es que avan\xe7ar\xe3o contra mim, que em v\xf3s sempre me refugie. Amo-vos de todo o meu cora\xe7\xe3o, \xf3 Jesus, meu Amor; arrependo-me de ter-vos ofendido. N\xe3o permitais que eu novamente vos ofenda. Dai-me amor perp\xe9tuo a v\xf3s e fazei de mim o que quiserdes.\n\nPai-nosso, Ave-Maria, Gl\xf3ria.\n\nOutra vez desfalecido,\nPelas dores abatido,\nCai por terra o Salvador.\nPela Virgem dolorosa,\nVossa M\xe3e t\xe3o piedosa,\nPerdoai-me, meu Jesus.",null)
B.FG=new A.bn("14\xaa Esta\xe7\xe3o - Jesus \xe9 sepultado\n","V. N\xf3s vos adoramos, \xf3 Cristo, e vos bendizemos.\nR. Porque, por vossa santa Cruz, redimistes o mundo.\n\nContemplemos como os disc\xedpulos levam Jesus ex\xe2nime ao lugar da sepultura. Triste, a M\xe3e os acompanha e com as pr\xf3prias m\xe3os acomoda o corpo do Filho \xe0 sepultura. Fecha-se este, enfim, e todos v\xe3o-se embora.\n\nOra\xe7\xe3o. \u2014 \xd3 Jesus sepultado, beijo esta pedra que vos acolheu; mas, ap\xf3s tr\xeas dias, haveis de ressurgir! Por vossa ressurrei\xe7\xe3o, fazei-me, eu vos pe\xe7o, ressurgir glorioso convosco no \xfaltimo dia e ir para o C\xe9u, onde, unido a v\xf3s para sempre, vos hei de louvar e amar por toda a eternidade. Amo-vos e arrependo-me de ter-vos ofendido. N\xe3o permitais que eu novamente vos ofenda. Dai-me amor perp\xe9tuo a v\xf3s e fazei de mim o que quiserdes.\n\nPai-nosso, Ave-Maria, Gl\xf3ria.\n\nNo sepulcro vos deixaram,\nSepultado, vos choraram,\nMagoado o cora\xe7\xe3o.\nMeu Jesus, por vossos passos,\nRecebei em vossos bra\xe7os\nA mim, pobre pecador.",null)
