B.FN=new A.bn("Transfigura\xe7\xe3o de Nosso Senhor Jesus Cristo\n",u.l,null)
B.FO=new A.bn("A Agonia de Jesus no Horto das Oliveiras\n",u.l,null)
B.FP=new A.bn("Batismo de Jesus Cristo no Rio Jord\xe3o\n",u.l,null)
B.FQ=new A.bn("A Pris\xe3o e Flagela\xe7\xe3o de Jesus\n",u.l,null)
B.FR=new A.bn("3\xaa Esta\xe7\xe3o - Jesus cai pela primeira vez\n","V. N\xf3s vos adoramos, \xf3 Cristo, e vos bendizemos.\nR. Porque, por vossa santa Cruz, redimistes o mundo.\n\nContemplemos a primeira queda de Jesus sob o peso da Cruz. Tinha Ele a carne, por causa da cruenta flagela\xe7\xe3o, ferida de muitos modos e a cabe\xe7a coroada de espinhos; derramara ainda tanto sangue, que mal podia mover os p\xe9s por falta de for\xe7as. E porque era oprimido pelo grave peso da Cruz e a\xe7ulado sem clem\xeancia pelos soldados, por isso aconteceu-lhe de cair muitas vezes por terra ao longo do caminho.\n\nOra\xe7\xe3o. \u2014 \xd3 meu Jesus, n\xe3o \xe9 o peso da Cruz, mas o dos meus pecados que de tantas dores vos cobre. Rogo-vos, por esta vossa primeira queda, que me protejais de toda queda em pecado. Amo-vos, \xf3 Jesus, de todo o meu cora\xe7\xe3o; arrependo-me de ter-vos ofendido. N\xe3o me permitais novamente cair em pecado. Dai-me amor perp\xe9tuo a v\xf3s e fazei de mim o que quiserdes.\n\nPai-nosso, Ave-Maria, Gl\xf3ria.\n\nPela Cruz t\xe3o oprimido,\nCai Jesus,\ndesfalecido,\nPela tua salva\xe7\xe3o.\nPela Virgem dolorosa,\nVossa M\xe3e t\xe3o piedosa,\nPerdoai-me, meu Jesus.",null)
B.FS=new A.bn("11\xaa Esta\xe7\xe3o - Jesus \xe9 pregado \xe0 Cruz\n","V. N\xf3s vos adoramos, \xf3 Cristo, e vos bendizemos.\nR. Porque, por vossa santa Cruz, redimistes o mundo.\n\nContemplemos como Jesus \xe9 arremessado sobre a Cruz e, de bra\xe7os estendidos, oferece sua vida ao Pai eterno em sacrif\xedcio pela nossa salva\xe7\xe3o. Os carn\xedfices o pregam \xe0 Cruz e, depois de erguerem esta, deixam-no levantado num infame pat\xedbulo, abandonado a uma morte cruel.\n\nOra\xe7\xe3o. \u2014 \xd3 Jesus t\xe3o desprezado, pregai meu cora\xe7\xe3o aos vossos p\xe9s, para que, com v\xednculo de amor, eu permane\xe7a sempre a v\xf3s ligado e jamais seja de v\xf3s separado. Amo-vos mais do que a mim mesmo, arrependo-me de ter-vos ofendido. N\xe3o permitais que eu novamente vos ofenda. Dai-me amor perp\xe9tuo a v\xf3s e fazei de mim o que quiserdes.\n\nPai-nosso, Ave-Maria, Gl\xf3ria.\n\nSois por mim na Cruz pregado,\nInsultado, blasfemado,\nCom cegueira e com furor.\nPela Virgem dolorosa,\nVossa M\xe3e t\xe3o piedosa,\nPerdoai-me, meu Jesus.",null)
B.FT=new A.bn("A Coroa\xe7\xe3o de Espinhos em Jesus\n",u.l,null)
B.FU=new A.bn("2\xaa Esta\xe7\xe3o - Jesus carrega a Cruz\n","V. N\xf3s vos adoramos, \xf3 Cristo, e vos bendizemos.\nR. Porque, por vossa santa Cruz, redimistes o mundo.\n\nContemplemos como Jesus Cristo, levando a Cruz aos ombros, lembrava-se no caminho de oferecer por n\xf3s ao Pai eterno a morte que havia de sofrer.\n\nOra\xe7\xe3o. \u2014 \xd3 amabil\xedssimo Jesus, abra\xe7o todas as adversidades que, por vossa vontade, hei de tolerar at\xe9 a morte e, pelo duro sofrimento que suportastes carregando a Cruz, pe\xe7o-vos que me deis for\xe7as para que tamb\xe9m eu possa carregar, com \xe2nimo forte e paciente, minha pr\xf3pria cruz. Amo-vos, \xf3 Jesus, meu Amor, e arrependo-me de ter-vos ofendido. N\xe3o permitais que novamente me separe de ti. Dai-me amor perp\xe9tuo a v\xf3s e fazei de mim o que quiserdes.\n\nPai-nosso, Ave-Maria, Gl\xf3ria.\n\nCom a Cruz \xe9 carregado,\nE do peso acabrunhado,\nVai morrer por teu amor.\nPela Virgem dolorosa,\nVossa M\xe3e t\xe3o piedosa,\nPerdoai-me, meu Jesus.",null)
B.FV=new A.bn("C\xd3DIGO PIX","Doe o valor que esteja em seu cora\xe7\xe3o.",null)
B.FW=new A.bn("5\xaa Esta\xe7\xe3o - O Cirineu ajuda Jesus a carregar a Cruz\n","V. N\xf3s vos adoramos, \xf3 Cristo, e vos bendizemos.\nR. Porque, por vossa santa Cruz, redimistes o mundo.\n\nContemplemos como os judeus obrigaram Sim\xe3o de Cirene a carregar a Cruz atr\xe1s do Senhor, vendo Jesus quase expirar a cada passo devido ao cansa\xe7o e temendo, por outra parte, que morresse no caminho aquele que queriam ver pregado \xe0 Cruz.\n\nOra\xe7\xe3o. \u2014 \xd3 dulc\xedssimo Jesus, n\xe3o quero, como o Cirineu, repudiar a Cruz. De bom grado a abra\xe7o e tomo sobre mim; abra\xe7o especialmente a morte que para mim estabelecestes, com todas as dores que ela trar\xe1 consigo. Uno minha morte \xe0 vossa e, assim unida, ofere\xe7o-a a v\xf3s em sacrif\xedcio. V\xf3s morrestes por amor a mim; quero tamb\xe9m eu morrer por amor a v\xf3s, com a inten\xe7\xe3o de vos agradar. V\xf3s, por\xe9m, ajudai-me com a vossa gra\xe7a. Amo-vos, \xf3 Jesus, meu Amor, e arrependo-me de ter-vos ofendido. N\xe3o permitais que eu novamente vos ofenda. Dai-me amor perp\xe9tuo a v\xf3s e fazei de mim o que quiserdes.\n\nPai-nosso, Ave-Maria, Gl\xf3ria.\n\nEm extremo desmaiado,\nTeve aux\xedlio, t\xe3o cansado,\nRecebendo o Cireneu.\nPela Virgem dolorosa,\nVossa M\xe3e t\xe3o piedosa,\nPerdoai-me, meu Jesus.",null)
B.FX=new A.bn("A Ascens\xe3o Gloriosa de Jesus Cristo aos C\xe9us\n",u.l,null)
B.FY=new A.bn("9\xaa Esta\xe7\xe3o - Jesus cai pela terceira vez\n","V. N\xf3s vos adoramos, \xf3 Cristo, e vos bendizemos.\nR. Porque, por vossa santa Cruz, redimistes o mundo.\n\nContemplemos a terceira queda de Cristo sob o peso da Cruz. Caiu porque era demasiada a sua fraqueza e excessiva a crueldade dos algozes, que lhe queriam acelerar a marcha, embora Ele mal pudesse dar um passo.\n\nOra\xe7\xe3o. \u2014 \xd3 Jesus t\xe3o maltratado, pelo m\xe9rito desta falta de for\xe7as que quisestes padecer no caminho do Calv\xe1rio, confortai-me, eu vos pe\xe7o, com tanto vigor, que j\xe1 n\xe3o tenha respeito algum \xe0s opini\xf5es dos homens e domine minha natureza viciosa: porque ambas as coisas foram a causa por que desprezei outrora a vossa amizade. Amo-vos, \xf3 Jesus, meu Amor, de todo o meu cora\xe7\xe3o; arrependo-me de ter-vos ofendido. N\xe3o permitais que eu novamente vos ofenda. Dai-me amor perp\xe9tuo a v\xf3s e fazei de mim o que quiserdes.\n\nPai-nosso, Ave-Maria, Gl\xf3ria.\n\nCai, terceira vez, prostrado,\nPelo peso redobrado\nDos pecados e da Cruz.\nPela Virgem dolorosa,\nVossa M\xe3e t\xe3o piedosa,\nPerdoai-me, meu Jesus.",null)
B.FZ=new A.bn("A Ressurrei\xe7\xe3o de Nosso Senhor Jesus Cristo\n",u.l,null)
B.G_=new A.bn("S\xc3O FRANCISCO DE ASSIS\n(MACUMB\xc9)","\nR. do Cubat\xe3o, 1058 - Cubat\xe3o, Itapira - SP, 13972-330",null)
B.G1=new A.bn("A Crucifix\xe3o e a Morte de Jesus Cristo na Cruz\n",u.M,null)
B.G2=new A.bn("10\xaa Esta\xe7\xe3o - Jesus \xe9 espoliado de suas vestes\n","V. N\xf3s vos adoramos, \xf3 Cristo, e vos bendizemos.\nR. Porque, por vossa santa Cruz, redimistes o mundo.\n\nContemplemos com que viol\xeancia arrancaram as vestes a Cristo. Como o traje interior estivesse muito pegado \xe0 carne, aberta pelos flagelos, os carn\xedfices, ao puxarem-lha, rasgaram-lhe tamb\xe9m a pele. Tenhamos compaix\xe3o de Nosso Senhor e lhe falemos assim:\n\nOra\xe7\xe3o. \u2014 \xd3 inocent\xedssimo Jesus, pelo m\xe9rito da dor que padecestes nesta espolia\xe7\xe3o, ajudai-me, eu vos pe\xe7o, a despir-me de todo afeto \xe0s coisas criadas e, com toda a inclina\xe7\xe3o de minha vontade, converter-me somente a v\xf3s, que sois t\xe3o digno do meu amor. Amo-vos de todo o meu cora\xe7\xe3o; arrependo-me de ter-vos ofendido. N\xe3o permitais que eu novamente vos ofenda. Dai-me amor perp\xe9tuo a v\xf3s e fazei de mim o que quiserdes.\n\nPai-nosso, Ave-Maria, Gl\xf3ria.\n\nDos vestidos despojado,\nPor algozes maltratado,\nEu vos vejo, meu Jesus.\nPela Virgem dolorosa,\nVossa M\xe3e t\xe3o piedosa,\nPerdoai-me, meu Jesus.",null)
B.G3=new A.bn("1\xaa Esta\xe7\xe3o - Jesus \xe9 condenado \xe0 morte\n","V. N\xf3s vos adoramos, \xf3 Cristo, e vos bendizemos.\nR. Porque, por vossa santa Cruz, redimistes o mundo.\n\nContemplemos como Jesus Cristo, j\xe1 flagelado e coroado de espinhos, foi por fim injustamente condenado \xe0 morte por Pilatos.\n\nOra\xe7\xe3o. \u2014 \xd3 Jesus ador\xe1vel, n\xe3o foi Pilatos, mas minha vida in\xedqua que vos condenou \xe0 morte. Pelo m\xe9rito deste t\xe3o penoso itiner\xe1rio, no qual entrais rumo ao monte Calv\xe1rio, pe\xe7o-vos que benignamente me acompanheis no caminho pelo qual minha alma se dirige \xe0 eternidade. Amo-vos, \xf3 Jesus, meu Amor, mais do que a mim mesmo, e do fundo do cora\xe7\xe3o me arrependo de ter-vos ofendido. N\xe3o permitais que eu novamente me separe de v\xf3s. Dai-me amor perp\xe9tuo a v\xf3s e fazei de mim o que quiserdes. O que vos for agrad\xe1vel tamb\xe9m o ser\xe1 para mim.\n\nPai-nosso, Ave-Maria, Gl\xf3ria.\n\nA morrer crucificado,\nTeu Jesus \xe9 condenado\nPor teus crimes, pecador.\nPela Virgem dolorosa,\nVossa M\xe3e t\xe3o piedosa,\nPerdoai-me, meu Jesus.",null)
