B.G9=new A.bn("8\xaa Esta\xe7\xe3o - Jesus fala \xe0s mulheres de Jerusal\xe9m\n","V. N\xf3s vos adoramos, \xf3 Cristo, e vos bendizemos.\nR. Porque, por vossa santa Cruz, redimistes o mundo.\n\nContemplemos como estas mulheres, vendo Jesus morto de cansa\xe7o e coberto de sangue, s\xe3o tocadas de comisera\xe7\xe3o e choram copiosamente. Mas, voltando-se a elas, Ele diz: \u201cN\xe3o choreis por mim; antes, chorai por v\xf3s mesmas e por vossos filhos\u201d.\n\nOra\xe7\xe3o. \u2014 \xd3 doloroso Jesus, choro os pecados que cometi contra v\xf3s, n\xe3o s\xf3 pelas penas de que me fizeram digno, mas sobretudo pela tristeza que vos causaram a v\xf3s, que tanto me amastes. Ao choro me move menos o inferno que o amor a v\xf3s. \xd3 meu Jesus, amo-vos mais do que a mim mesmo; arrependo-me de ter-vos ofendido. N\xe3o permitais que eu novamente vos ofenda. Dai-me amor perp\xe9tuo a v\xf3s e fazei de mim o que quiserdes.\n\nPai-nosso, Ave-Maria, Gl\xf3ria.\n\nDas mulheres piedosas,\nDe Si\xe3o filhas chorosas,\n\xc9 Jesus consolador.\nPela Virgem dolorosa,\nVossa M\xe3e t\xe3o piedosa,\nPerdoai-me, meu Jesus.",null)
