B.Gd=new A.bn("13\xaa Esta\xe7\xe3o - Jesus \xe9 descido da Cruz\n","V. N\xf3s vos adoramos, \xf3 Cristo, e vos bendizemos.\nR. Porque, por vossa santa Cruz, redimistes o mundo.\n\nContemplemos como dois dos disc\xedpulos de Jesus, Jos\xe9 e Nicodemos, o tiram ex\xe2nime da Cruz e o colocam nos bra\xe7os de sua M\xe3e dolorosa, que recebe o Filho morto com grande amor e o abra\xe7a ternamente.\n\nOra\xe7\xe3o. \u2014 \xd3 M\xe3e das Dores, pelo amor com que amais o vosso Filho, recebei-me como servo vosso e rogai a Ele por mim. E v\xf3s, \xf3 meu Redentor, porque por mim morrestes, fazei, benignamente, com que eu vos ame; a v\xf3s somente desejo nem quero nada fora de v\xf3s. Amo-vos, \xf3 Jesus, meu Amor, e arrependo-me de ter-vos ofendido. N\xe3o permitais que eu novamente vos ofenda. Dai-me amor perp\xe9tuo a v\xf3s e fazei de mim o que quiserdes.\n\nPai-nosso, Ave-Maria, Gl\xf3ria.\n\nDo madeiro vos tiraram\nE \xe0 M\xe3e vos entregaram\nCom que dor e compaix\xe3o!\nPela Virgem dolorosa,\nVossa M\xe3e t\xe3o piedosa,\nPerdoai-me, meu Jesus.",null)
B.Ge=new A.bn("COMUNIDADE S\xc3O LUIZ GONZAGA\nMACHADINHO (RURAL)","\nCRT 221D, 21 Chacara Formigari \u2013 Bairro Machadinho",null)
