B.Gg=new A.bn("6\xaa Esta\xe7\xe3o - Ver\xf4nica limpa com um sud\xe1rio o rosto de Jesus\n","V. N\xf3s vos adoramos, \xf3 Cristo, e vos bendizemos.\nR. Porque, por vossa santa Cruz, redimistes o mundo.\n\nContemplemos como aquela santa mulher Ver\xf4nica, vendo Jesus abatido pelas dores, com o rosto banhado em suor e sangue, estendeu-lhe um pano em que, purificada a face, Ele deixou impressa sua imagem.\n\nOra\xe7\xe3o. \u2014 \xd3 meu Jesus, formosa era antes a vossa face; mas agora n\xe3o aparece assim, t\xe3o deformada est\xe1 por feridas e sangue! Ai de mim, como era formosa tamb\xe9m minha alma, quando recebi a vossa gra\xe7a pelo Batismo: mas, pecando, tornei-a disforme. V\xf3s somente, meu Redentor, lhe podeis restituir a antiga beleza. Para que o fa\xe7ais, rogo-vos pelo m\xe9rito de vossa Paix\xe3o. Amo-vos, \xf3 Jesus, meu Amor; arrependo-me de ter-vos ofendido. N\xe3o permitais que eu novamente vos ofenda. Dai-me amor perp\xe9tuo a v\xf3s e fazei de mim o que quiserdes.\n\nPai-nosso, Ave-Maria, Gl\xf3ria.\n\nO seu rosto ensanguentado,\nPor Ver\xf4nica enxugado,\nEis, no pano, apareceu.\nPela Virgem dolorosa,\nVossa M\xe3e t\xe3o piedosa,\nPerdoai-me, meu Jesus.",null)
