B.FJ=new A.bn("Rezando a Via Sacra.\n","A Via Sacra \xe9 uma das mais antigas formas de se meditar a Paix\xe3o de Cristo. A express\xe3o vem do latim e significa \u201ccaminho sagrado\u201d: literalmente falando, nada mais \xe9 que o trajeto percorrido por Nosso Senhor com a Cruz \xe0s costas, desde o pret\xf3rio de Pilatos, onde foi condenado \xe0 morte, at\xe9 o Calv\xe1rio, onde foi crucificado.\n\nSegundo uma piedosa tradi\xe7\xe3o, ningu\xe9m menos que a Virgem Maria teria dado in\xedcio a este santo exerc\xedcio: ap\xf3s a morte de seu divino Filho, seja sozinha, seja em companhia das santas mulheres, ela teria refeito constantemente a via crucis, isto \xe9, o \u201ccaminho da Cruz\u201d.\n\nSeguindo o exemplo de Nossa Senhora, os fi\xe9is da Palestina \u2014 e, no correr dos anos, numerosos peregrinos de todos os lugares do mundo \u2014 procuraram visitar aqueles santos lugares, cobertos pelo suor e pelo sangue de Jesus Cristo; e a Igreja, a fim de encorajar-lhes a piedade, abriu a esses peregrinos seus tesouros de b\xean\xe7\xe3os espirituais.\n\nComo, por\xe9m, nem todos podem ir \xe0 Terra Santa, a Santa S\xe9 autorizou que fossem erigidas, nas igrejas e nas capelas de todo o mundo, cruzes, pinturas ou baixos-relevos representando as tocantes cenas que se passaram na estrada verdadeira ao Calv\xe1rio, em Jerusal\xe9m.\n\nAo permitir a constru\xe7\xe3o dessas \u201cesta\xe7\xf5es\u201d, como s\xe3o chamadas \u2014 e que tradicionalmente s\xe3o em n\xfamero de 14 \u2014, os Pont\xedfices Romanos, que compreendiam toda a excel\xeancia e efic\xe1cia desta devo\xe7\xe3o, se dignaram tamb\xe9m enriquec\xea-las de todas as indulg\xeancias que advinham de uma visita de verdade \xe0 Terra Santa.",null)
B.Gc=new A.bn("Ora\xe7\xe3o Inicial.\n","Senhor Jesus Cristo, v\xf3s com tanto amor entrastes nesta via para morrerdes por mim; eu por\xe9m tantas vezes vos desprezei! Agora, de toda a minha alma vos amo e, porque vos amo, arrependo-me do fundo do cora\xe7\xe3o de ter-vos ofendido. Perdoai-me e permiti que vos acompanhe nesta via. V\xf3s, por amor a mim, caminhais para o lugar em que por mim haveis de morrer, e eu tamb\xe9m, por amor a v\xf3s, desejo acompanhar-vos para convosco morrer, amant\xedssimo Redentor. \xd3 meu Jesus, desejo convosco viver e morrer!",null)
