B.FK=new A.bn("Ora\xe7\xe3o final a Jesus crucificado.\n","Eis-me aqui, \xf3 meu bom e dulc\xedssimo Jesus! Humildemente prostrado de joelhos em vossa presen\xe7a, pe\xe7o e suplico-vos, com todo o fervor de minha alma, que vos digneis gravar em meu cora\xe7\xe3o os mais vivos sentimentos de f\xe9, esperan\xe7a e caridade, de verdadeiro arrependimento de meus pecados, e um firme prop\xf3sito de emendar-me, enquanto vou considerando, com vivo afeto e dor, as vossas cinco chagas, tendo presentes as palavras que j\xe1 o profeta Davi punha em vossa boca, \xf3 bom Jesus: \u201cTranspassaram minhas m\xe3os e os meus p\xe9s e contaram todos os meus ossos\u201d (Sl 21, 17).",null)
B.G0=new A.bn("A Nossa Senhora das Dores.\n","\xd3 M\xe3e das Dores, Rainha dos m\xe1rtires, que tanto chorastes vosso Filho, morto para me salvar, alcan\xe7ai-me uma verdadeira contri\xe7\xe3o dos meus pecados e uma sincera mudan\xe7a de vida. M\xe3e, pela dor que experimentastes quando vosso divino Filho, no meio de tantos tormentos, inclinando a cabe\xe7a expirou \xe0 vossa vista sobre a cruz, eu vos suplico que me alcanceis uma boa morte. Por piedade, \xf3 advogada dos pecadores, n\xe3o deixeis de amparar a minha alma na afli\xe7\xe3o e no combate da terr\xedvel passagem desta vida \xe0 eternidade. E, como \xe9 poss\xedvel que, neste momento, a palavra e a voz me faltem para pronunciar o vosso nome e o de Jesus, rogo-vos, desde j\xe1, a v\xf3s e a vosso divino Filho, que me socorrais nessa hora extrema, e assim direi: Jesus e Maria, entrego-vos a minha alma. Am\xe9m.",null)
