B.PD=new A.kx("\xd3 Jesus no seu Sagrado Cora\xe7\xe3o eu confio as minhas inten\xe7\xf5es nesta novena:\n\n(Coloque a sua inten\xe7\xe3o agora)\n\nSagrado Cora\xe7\xe3o de Jesus, fonte de todas as gra\xe7as de merecimentos,\nOnde procurarei a n\xe3o ser no tesouro que cont\xe9m todas as riquezas de Vossa clem\xeancia e bondade?\nOnde baterei, a n\xe3o ser \xe0 porta do vosso Cora\xe7\xe3o, pelo qual o pr\xf3prio Pai vem a n\xf3s, e n\xf3s vamos a Ele?\nA v\xf3s pois, Sagrado Cora\xe7\xe3o de Jesus, recorremos.\nEm v\xf3s, Sagrado Cora\xe7\xe3o de Jesus, encontro consola\xe7\xe3o quando aflito, prote\xe7\xe3o quando perseguido, for\xe7a quando oprimido de tristeza.\nNo Teu Cora\xe7\xe3o Jesus, encontro luz, quando envolto nas trevas da d\xfavida.\n\nSagrado Cora\xe7\xe3o de Jesus eu tenho confian\xe7a em v\xf3s.\nDoce Cora\xe7\xe3o de Jesus sede o meu amor.\nDoce Cora\xe7\xe3o de Maria sede a minha salva\xe7\xe3o.\nAmado seja por toda a parte o Sagrado Cora\xe7\xe3o de Jesus.\nSagrado Cora\xe7\xe3o de Jesus venha a n\xf3s o Vosso reino.\nSagrado Cora\xe7\xe3o de Jesus eu tenho confian\xe7a em V\xf3s e por isso nesta novena e neste momento repito o meu pedido:\n\n(diga novamente sua inten\xe7\xe3o)\n\nSagrado Cora\xe7\xe3o de Jesus eu tenho confian\xe7a em V\xf3s.\nSagrado Cora\xe7\xe3o de Jesus creio em Vosso amor para comigo.\nSagrado Cora\xe7\xe3o de Jesus coloque em nosso cora\xe7\xe3o os sentimentos que tiveste: amor, paz, perd\xe3o e obedi\xeancia ao Pai Eterno.\nJesus, manso e humilde de cora\xe7\xe3o, fazei o meu cora\xe7\xe3o semelhante ao Vosso.\n\nAm\xe9m.",null)
B.PE=new A.kx('Sant\xedssima Trindade, Pai, Filho e Esp\xedrito Santo, eu vos agrade\xe7o todos os favores, todas as gra\xe7as com que enriquecestes a alma de vossa serva Santa Terezinha do Menino Jesus, durante os 24 anos que passou na Terra. Pelos m\xe9ritos de t\xe3o querida santinha, concedei-me a gra\xe7a que vos pe\xe7o (fa\xe7a o seu pedido), se for conforme a vossa sant\xedssima vontade e para a salva\xe7\xe3o de minha alma. Aumentai minha f\xe9 e minha esperan\xe7a, \xf3 Santa Terezinha, cumprindo mais uma vez a vossa promessa de que ningu\xe9m vos invocaria em v\xe3o, fazendo-me ganhar uma rosa, sinal de que alcan\xe7arei a gra\xe7a pedida.\n\nDepois de terminar a ora\xe7\xe3o, rezar, em seguida, 24 vezes a ora\xe7\xe3o Gl\xf3ria ao Pai:\n\n"Gl\xf3ria ao Pai, ao Filho e ao Esp\xedrito Santo, como era no princ\xedpio, agora e sempre, am\xe9m!"\n\nSanta Teresinha do Menino Jesus, rogai por n\xf3s!\nAve Maria e um Pai nosso.',null)
B.PF=new A.kx("Dai-lhes Senhor o descanso eterno. E que a luz perp\xe9tua os ilumine. Descansem em paz. Am\xe9m. (3x)\n\nPai Misericordioso eu vos ofere\xe7o o sangue precioso de Nosso Senhor Jesus Cristo para al\xedvio das almas sofredoras que ainda padecem no purgat\xf3rio.\n\nSuplico a V\xf3s meu Jesus Cristo, Salvador do mundo, que lhes devolvais a luz perdida.\nPe\xe7o que todos os m\xe9ritos da Paix\xe3o e Morte de Jesus e que as l\xe1grimas e as dores de sua M\xe3e Sant\xedssima, deem al\xedvio \xe0s almas do purgat\xf3rio. Incluo meus entes queridos nessa novena.\n\n(Diga o nome dos seus falecidos)\n\nNossa Senhora da Boa Morte, protetora e intercessora das almas, rogai por elas.\nE v\xf3s almas santas e benditas, idem perante Deus apresentar essas s\xfaplicas que fa\xe7o hoje, nesse dia da novena.\n\n(Diga a sua inten\xe7\xe3o nessa novena)\n\nRogo-vos, benditas almas, que leveis at\xe9 Deus a minha prece.\n\nDai-lhes Senhor o descanso eterno. E a luz perp\xe9tua os ilumine. Descansem em paz. Am\xe9m.",null)
B.PG=new A.kx("Oh! Virgem Maria, aben\xe7oada sois v\xf3s pelo Senhor Deus Alt\xedssimo entre todas as mulheres da terra. V\xf3s sois a gl\xf3ria de Jerusal\xe9m, v\xf3s a alegria de Israel, v\xf3s a honra do nosso povo.\nSalve oh! Virgem, honra de nossa terra, a quem rendemos um culto de piedade e venera\xe7\xe3o, a quem chamamos com o belo nome de Aparecida.\nQuem poder\xe1 contar, oh! doce M\xe3e quantas gra\xe7as durante tantos anos v\xf3s dispensastes ao povo brasileiro, compadecida de nossos males?\nQuisemos cingir vossa cabe\xe7a sagrada com uma coroa de ouro, que vos \xe9 devida por tantos t\xedtulos; continuai a dobrar-vos benignamente as nossas preces.\nQuando erguemos ao c\xe9u nossas m\xe3os suplicantes, ouvi clemente os nossos rogos, oh! Virgem; conservai nossas almas afastadas da culpa e, por fim conduzi-nos ao c\xe9u.\nSalva\xe7\xe3o, honra e poder Aquele que, uno e trino, nos fulgores de seu trono celeste, governa e rege todo o universo. Am\xe9m.\n\nV. A Vossa Imaculada Concei\xe7\xe3o, Oh! Virgem M\xe3e de Deus.\nR. Anunciou a alegria ao mundo todo.\n\nOremos:\n\nDeus que, por interm\xe9dio da M\xe3e Imaculada de vosso Filho, multiplicastes os dons de vossa gra\xe7a em favor nosso, vossos servos. Concedei-nos prop\xedcio que celebrando na terra os louvores da mesma Virgem, pelas suas maternas preces mere\xe7amos alcan\xe7ar o pr\xeamio eterno no c\xe9u.Pelo mesmo Nosso Senhor Jesus Cristo. Am\xe9m.",null)
B.PH=new A.kx("\xd3 Senhora do Perp\xe9tuo Socorro, mostrai-nos que sois verdadeiramente nossa m\xe3e, obtendo-me o seguinte benef\xedcio:\n\n(Fa\xe7a o seu pedido)\n\nE a gra\xe7a de usar dele para a gl\xf3ria de Deus e a salva\xe7\xe3o de minha alma. \xd3 glorioso Santo Afonso, que por Vossa confian\xe7a na bem-aventurada Virgem conseguistes tantos favores e t\xe3o perfeitamente provastes em Vossos admir\xe1veis escritos que todas as gra\xe7as nos v\xeam de Deus pela intercess\xe3o de Maria. Alcan\xe7ai-me a mais tenra confian\xe7a para com nossa m\xe3e do Perp\xe9tuo Socorro e rogai-lhe, com inst\xe2ncia, me conceder o favor que reclamo de seu poder e bondade maternal.\n\nEterno Pai, em nome de Jesus e pela intercess\xe3o de nossa M\xe3e do Perp\xe9tuo Socorro e de Santo Afonso, pe\xe7o-Vos que me atendais para Vossa gl\xf3ria e bem de minha alma.\n\nConsagra\xe7\xe3o \xe0 Nossa Senhora\n\n\xd3 Santa M\xe3e Dolorosa de Deus, \xf3 Virgem Dulc\xedssima, eu vos ofere\xe7o meu cora\xe7\xe3o para que o conserveis intacto como Vosso Cora\xe7\xe3o Imaculado.\nEu vos ofere\xe7o a minha intelig\xeancia, para que ela conceba apenas pensamentos de paz e bondade, de pureza e verdade.\nEu vos ofere\xe7o minha vontade para que ela se mantenha viva e generosa a servi\xe7o de Deus.\nEu vos ofere\xe7o meu trabalho, minhas dores, meus sofrimentos, minhas ang\xfastias, minhas tribula\xe7\xf5es e minhas l\xe1grimas, no meu presente e no meu futuro para serem apresentadas por V\xf3s a Vosso Divino Filho, para purifica\xe7\xe3o de minha vida.\nM\xe3e compassiva, eu me refugio em Vosso Cora\xe7\xe3o Imaculado, para acalmar as dolorosas palpita\xe7\xf5es de minhas tenta\xe7\xf5es, de minha aridez, de minha indiferen\xe7a e das minhas neglig\xeancias.\nEscutai-me \xf3 M\xe3e, guiai-me, sustentai-me e defendei-me contra todos os perigos da alma e do corpo, agora e para toda a eternidade. Assim seja.",null)
B.PI=new A.kx("S\xe3o Benedito, filho de escravos, que encontrastes a verdadeira liberdade servindo a Deus e aos irm\xe3os, independente de ra\xe7a e de cor, livrai-me de toda a escravid\xe3o, venha ela dos homens ou dos v\xedcios, e judai-me a desalojar de meu cora\xe7\xe3o toda a segrega\xe7\xe3o racial e reconhecer todos os homens por meus irm\xe3os.\n\nS\xe3o Benedito, amigo de Deus e dos homens, concedei-me a gra\xe7a que vos pe\xe7o de cora\xe7\xe3o (fazer o pedido).\n\nS\xe3o Benedito, rogai por n\xf3s. Am\xe9m.",null)
B.PJ=new A.kx("Jesus Ressuscitado rolai as pedras do meu caminho!\n\n\xd3 Deus de grande miseric\xf3rdia e bondade infinita. Eis que hoje venho suplicar pela Vossa miseric\xf3rdia as gra\xe7as necess\xe1rias para mim e meus familiares:\n\n(Fa\xe7a agora seu pedido a Jesus Ressuscitado, a Jesus Misericordioso!)\n\n\xd3 Senhor aumentai em n\xf3s, sem cessar, a Vossa miseric\xf3rdia, a fim de que possamos cumprir fielmente a Vossa santa vontade durante toda nossa vida e na hora da morte. Que o poder da Vossa miseric\xf3rdia nos defenda dos ataques dos inimigos. Jesus \xe9 a nossa confian\xe7a. Pelo seu cora\xe7\xe3o misericordioso, como por uma porta aberta, esperamos entrar no C\xe9u.\n\nJesus Misericordioso, Jesus Ressuscitado eu clamo a Vossa miseric\xf3rdia e a for\xe7a da ressurrei\xe7\xe3o. Rolai essas pedras do meu caminho.\n\nJesus eu confio em V\xf3s...\n\nSenhor Jesus Cristo que tendo ressuscitado dos mortos nos abriu as portas da eternidade, afugentai as trevas, a disc\xf3rdia, a desaven\xe7a e rolai as pedras do meu caminho, da minha fam\xedlia e do meu ambiente de trabalho.\n\nJesus Misericordioso eu clamo a Vossa miseric\xf3rdia sobre esta causa:\n\n(Fa\xe7a novamente o seu pedido)\n\nJesus Ressuscitado, Jesus Misericordioso eu clamo o Vosso poder. Am\xe9m.",null)
B.PK=new A.f2("Flor do Carmelo, vinha florida, esplendor do c\xe9u. Oh! M\xe3e, Virgem singular, Doce M\xe3e sempre Virgem, aos Carmelitas dai privil\xe9gio, Estrela do Mar","Oh! Maria, Virgem M\xe3e Imaculada, Rainha do Carmelo, que fostes contemplada pelo profeta Elias na nuvenzinha que subia do mar; depois, transformada em chuva copiosa, derramai sobre toda a humanidade as gra\xe7as de vosso Cora\xe7\xe3o Imaculado e convertei aos pobres pecadores.\n\nAve-Maria...\n\nNossa Senhora do Carmo, rogai por n\xf3s!","Rainha e M\xe3e do Carmelo, Virgem M\xe3e Imaculada, que durante s\xe9culos fostes honrada em vossa maternidade divina no Monte Carmelo pelo profeta Elias e seus sucessores \u2013 os Filhos dos profetas \u2013, fazei reinar em nossas fam\xedlias essa mesma entranhada devo\xe7\xe3o, que torne cada vez mais presente em nossos lares o vosso Divino Filho Jesus, que nos guarde para a vida eterna.\n\nAve-Maria...\n\nNossa Senhora do Carmo, rogai por n\xf3s!","Oh, Maria Imaculada, Virgem Sant\xedssima do Carmo, que visitastes vossos filhos Carmelitas no Monte Carmelo, consolando-os, dando-lhes gra\xe7as abundantes, visitai tamb\xe9m as nossas almas, ajudando-nos a fugir do pecado e a praticar com amor as obras de miseric\xf3rdia.\n\nAve-Maria...\n\nNossa Senhora do Carmo, rogai por n\xf3s!","Maria, Virgem imaculada, Rainha do Carmelo, lembrai-vos que vossos filhos carmelitas do Monte Carmelo ap\xf3s o Pentecostes abra\xe7aram o Evangelho e o anunciaram por toda parte, ensinando tamb\xe9m todos a vos conhecerem e amarem; e no Monte Carmelo, consagraram o primeiro templo do mundo em vossa honra. Dai-nos muitos mission\xe1rios, que por toda  parte vos fa\xe7am conhecer para a dilata\xe7\xe3o do Reino de Jesus.\n\nAve-Maria...\n\nNossa Senhora do Carmo, rogai por n\xf3s!","Maria, Rainha e M\xe3e dos Carmelitas, que lhes destes como penhor da salva\xe7\xe3o o Santo Escapul\xe1rio, n\xf3s vos agradecemos e vos suplicamos a gra\xe7a de viver na fidelidade \xe0 Lei de Deus, para que, em nossa morte, possamos contar com a vossa presen\xe7a e ir ao c\xe9u contemplar-vos eternamente.\n\nAve-Maria...\n\nNossa Senhora do Carmo, rogai por n\xf3s!","Maria, Virgem M\xe3e Imaculada, Rainha do Carmelo, que tendes concedido as mais extraordin\xe1rias gra\xe7as por meio de vosso Santo Escapul\xe1rio, ajudai-me a traz\xea-lo dignamente, conservando a pureza de cora\xe7\xe3o e de costumes, repelindo tudo o que possa magoar o vosso olhar pur\xedssimo.\n\nAve-Maria...\n\nNossa Senhora do Carmo, rogai por n\xf3s!","Rainha e M\xe3e do Carmelo, que fizestes grandes milagres por meio do Santo Escapul\xe1rio, cobri o mundo com o esplendor de Vosso Imaculado Cora\xe7\xe3o, para que seja enfraquecido o reino do mal e do pecado, e todos os povos se aproximem de V\xf3s para imitar vossa pureza e caridade.\n\nAve-Maria...\n\nNossa Senhora do Carmo, rogai por n\xf3s!","Maria, Virgem M\xe3e Imaculada, Rainha do Carmelo, que sempre concedestes as maiores gra\xe7as aos Carmelitas, enviai-nos muitas voca\xe7\xf5es sacerdotais, religiosas e para o Carmelo Secular, para que o vosso nome seja sempre mais glorificado, para a gl\xf3ria de vosso Filho Jesus Cristo.\n\nAve-Maria...\n\nNossa Senhora do Carmo, rogai por n\xf3s!","Maria, Rainha e M\xe3e do Carmelo, que velais pela Santa Igreja com maternal amor, aben\xe7oai o Santo Padre, o nosso bispo, os sacerdotes, os religiosos e todo o povo crist\xe3o. Aben\xe7oai a cada um de n\xf3s que desejamos vossa prote\xe7\xe3o agora e na hora de nossa morte.\n\nAve-Maria...\n\nNossa Senhora do Carmo, rogai por n\xf3s!","Bendita e Imaculada Virgem Maria, beleza e gl\xf3ria do Carmelo, v\xf3s que tratais com bondade inteiramente especial aqueles que se vestem do vosso amad\xedssimo h\xe1bito, volvei sobre mim tamb\xe9m um olhar prop\xedcio e cobri-me com o manto da vossa maternal prote\xe7\xe3o.\n\nPelo vosso poder, fortificai a minha fraqueza; pela vossa sabedoria, esclarecei as trevas do meu esp\xedrito, aumentai em mim a f\xe9, a esperan\xe7a e a caridade.\n\nOrnai a minha alma com as virtudes que me fa\xe7a agrad\xe1vel ao vosso Divino Filho e a v\xf3s.\n\nAssisti-me, durante a vida, consolai-me na morte pela vossa am\xe1vel presen\xe7a \xe0 Sant\xedssima Trindade, como vosso Filho dedicado para vos louvar e bendizer eternamente no para\xedso. Am\xe9m.",null)
B.PL=new A.f2("\xd3 meu Deus! Eu creio, adoro, espero e vos amo. Pe\xe7o-vos perd\xe3o para os que n\xe3o creem, n\xe3o adoram, n\xe3o esperam e n\xe3o vos amam. \xd3 Sant\xedssima Trindade, Pai, Filho e Esp\xedrito Santo! Eu vos adoro profundamente e vos ofere\xe7o o precios\xedssimo corpo, sangue, alma e divindade de Nosso Senhor Jesus Cristo, presente em todos os sacr\xe1rios da terra, em repara\xe7\xe3o dos ultrajes, sacril\xe9gios e indiferen\xe7as com que Ele mesmo \xe9 ofendido, e pelos m\xe9ritos infinitos do seu Sacrat\xedssimo Cora\xe7\xe3o e do Imaculado Cora\xe7\xe3o de Maria, pe\xe7o-vos a convers\xe3o dos pobres pecadores.\n\n\xd3 meu Jesus, perdoai-nos, livrai-nos do fogo do inferno, levai as almas todas para o c\xe9u e socorrei principalmente as que mais precisarem.\n\n\xd3 Sant\xedssima Virgem Maria, Rainha do Ros\xe1rio e M\xe3e de Miseric\xf3rdia, que vos dignastes manifestar em F\xe1tima a ternura do vosso Imaculado Cora\xe7\xe3o, trazendo-nos mensagens de salva\xe7\xe3o e paz, confiados em vossa miseric\xf3rdia maternal e agradecidos das bondades de vosso amant\xedssimo Cora\xe7\xe3o, viemos a vossos p\xe9s para render-vos o tributo de nossa venera\xe7\xe3o e amor. Concedei-nos as gra\xe7as de que necessitamos para cumprir fielmente vossa mensagem de amor e as que vos pedimos nesta novena (pedir as gra\xe7as), se forem elas para maior gl\xf3ria de Deus, honra vossa e proveito de nossas almas. Assim seja.","\xd3 Sant\xedssima Virgem Maria, M\xe3e dos pobres pecadores, que, aparecendo em F\xe1tima, deixastes transparecer em vosso rosto celestial uma leve sombra de tristeza, para indicar a dor que causam os pecados dos homens, a quem, com maternal compaix\xe3o, exortastes a n\xe3o afligir mais a vosso Filho com a culpa e a reparar os pecados com a mortifica\xe7\xe3o e a penit\xeancia: dai-nos a gra\xe7a de uma sincera dor dos pecados cometidos e a resolu\xe7\xe3o generosa de reparar com obras de penit\xeancia e mortifica\xe7\xe3o todas as ofensas contra o vosso divino Filho e o vosso Cora\xe7\xe3o Imaculado.\n\nReza-se uma dezena de Ave-Marias em sauda\xe7\xe3o a Nossa Senhora de F\xe1tima e a ora\xe7\xe3o final.","\xd3 Sant\xedssima Virgem Maria, M\xe3e da divina gra\xe7a, que, vestida de n\xedvea brancura, aparecestes aos pastorinhos singelos e inocentes, ensinando-lhes assim o quanto devemos amar e procurar a inoc\xeancia da alma, e que pedistes, por meio deles, a emenda dos costumes e a santidade de uma vida crist\xe3 perfeita: concedei-nos misericordiosamente a gra\xe7a de saber apreciar a dignidade de nossa condi\xe7\xe3o de crist\xe3os e levar uma vida conforme as promessas batismais.\n\nReza-se uma dezena de Ave-Marias em sauda\xe7\xe3o a Nossa Senhora de F\xe1tima e a ora\xe7\xe3o final.","\xd3 Sant\xedssima Virgem Maria, Vaso insigne de devo\xe7\xe3o, que aparecestes em F\xe1tima tendo pendente de vossas m\xe3os o santo Ros\xe1rio e que insistentemente repetias: \u201cOrai, orai muito\u201d para conseguir findar, por meio da ora\xe7\xe3o, os males que nos amea\xe7am: concedei-nos o dom e o esp\xedrito de ora\xe7\xe3o, a gra\xe7a de sermos fi\xe9is no cumprimento do grande preceito de orar, fazendo-o todos os dias, para assim observar bem os santos Mandamentos, vencer as tenta\xe7\xf5es e chegar ao conhecimento e ao amor de Jesus Cristo nesta vida e \xe0 uni\xe3o feliz com Ele na outra.\n\nReza-se uma dezena de Ave-Marias em sauda\xe7\xe3o a Nossa Senhora de F\xe1tima e a ora\xe7\xe3o final.","\xd3 Sant\xedssima Virgem Maria, Rainha da Igreja, que exortastes os pastorinhos de F\xe1tima a rogar pelo Papa e infundistes em suas almas sinceras uma grande venera\xe7\xe3o e amor por ele, como Vig\xe1rio de vosso Filho e seu representante na Terra, infundi tamb\xe9m em n\xf3s o esp\xedrito de venera\xe7\xe3o e docilidade \xe0 autoridade do Romano Pont\xedfice, de ades\xe3o inquebrant\xe1vel aos seus ensinamentos e, nele e com ele, um grande amor e respeito a todos os ministros da Santa Igreja, por meio dos quais participamos da vida da gra\xe7a nos sacramentos.\n\nReza-se uma dezena de Ave-Marias em sauda\xe7\xe3o a Nossa Senhora de F\xe1tima e a ora\xe7\xe3o final.","\xd3 Sant\xedssima Virgem Maria, Sa\xfade dos enfermos e Amparo dos aflitos, que, movida pelo rogo dos pastorinhos, fizestes j\xe1 curas em vossas apari\xe7\xf5es em F\xe1tima e haveis convertido este lugar, santificado por vossa presen\xe7a, em oficina de vossas miseric\xf3rdias maternais em favor de todos os aflitos, ao vosso Cora\xe7\xe3o maternal acudimos cheios de filial confian\xe7a, mostrando as enfermidades de nossas almas e as afli\xe7\xf5es e doen\xe7as todas de nossa vida: lan\xe7ai sobre elas um olhar de compaix\xe3o e remediai-as com a ternura de vossas m\xe3os, para que assim vos possamos servir e amar com todo o nosso cora\xe7\xe3o e com todo o nosso ser.\n\nReza-se uma dezena de Ave-Marias em sauda\xe7\xe3o a Nossa Senhora de F\xe1tima e a ora\xe7\xe3o final.","\xd3 Sant\xedssima Virgem Maria, Ref\xfagio dos pecadores, que ensinastes aos pastorinhos de F\xe1tima a rogar incessantemente ao Senhor, para que os desgra\xe7ados n\xe3o caiam nas penas eternas do inferno, e que manifestastes a um dos tr\xeas que os pecados da carne s\xe3o os que mais almas arrastam \xe0quelas terr\xedveis chamas: colocai em nossas almas um grande horror ao pecado e o temor santo da justi\xe7a divina; ao mesmo tempo, despertai em n\xf3s compaix\xe3o pelos pobres pecadores e um santo zelo para trabalhar, com nossas ora\xe7\xf5es, exemplos e palavras, por sua convers\xe3o.\n\nReza-se uma dezena de Ave-Marias em sauda\xe7\xe3o a Nossa Senhora de F\xe1tima e a ora\xe7\xe3o final.","\xd3 Sant\xedssima Virgem Maria, Rainha do purgat\xf3rio, que ensinastes aos pastorinhos de F\xe1tima a rogar a Deus pelas almas do purgat\xf3rio, especialmente pelas mais abandonadas, encomendamos \xe0 inesgot\xe1vel ternura de vosso maternal Cora\xe7\xe3o todas as almas que padecem naquele lugar de purifica\xe7\xe3o, em particular as de todos os nossos conhecidos e familiares e as mais abandonadas e necessitadas. Aliviai suas penas e levai-as prontas \xe0 regi\xe3o da luz e da paz, para ali cantarem perpetuamente vossas miseric\xf3rdias.\n\nReza-se uma dezena de Ave-Marias em sauda\xe7\xe3o a Nossa Senhora de F\xe1tima e a ora\xe7\xe3o final.","\xd3 Sant\xedssima Virgem Maria, que em vossa \xfaltima apari\xe7\xe3o vos destes a conhecer como Rainha do sant\xedssimo Ros\xe1rio e em todas as apari\xe7\xf5es recomendastes a r\xe9cita dessa devo\xe7\xe3o como rem\xe9dio mais seguro e eficaz para todos os males e calamidades que nos afligem, tanto de alma quanto de corpo, tanto p\xfablicas quanto privadas: colocai em nossas almas uma profunda estima pelos mist\xe9rios de nossa Reden\xe7\xe3o, que se comemoram na r\xe9cita do Ros\xe1rio, para assim vivermos sempre de seus frutos. Concedei-nos a gra\xe7a de sermos sempre fi\xe9is \xe0 pr\xe1tica de rez\xe1-lo diariamente, para vos honrarmos a v\xf3s, acompanhando vossas alegrias, dores e gl\xf3rias, e assim merecermos vossa maternal prote\xe7\xe3o e assist\xeancia em todos os momentos da vida, mais especialmente na hora da morte.\n\nReza-se uma dezena de Ave-Marias em sauda\xe7\xe3o a Nossa Senhora de F\xe1tima e a ora\xe7\xe3o final.","\xd3 Sant\xedssima Virgem Maria, nossa M\xe3e dulc\xedssima, que escolhestes os pastorinhos de F\xe1tima para mostrar ao mundo as ternuras de vosso Cora\xe7\xe3o misericordioso e lhes propusestes a devo\xe7\xe3o a ele como o meio pelo qual Deus quer dar a paz ao mundo, como o caminho para levar as almas a Ele e como penhor supremo de salva\xe7\xe3o: fazei, \xf3 Cora\xe7\xe3o da mais terna das m\xe3es, que possamos compreender vossa mensagem de amor e miseric\xf3rdia, que a abracemos com filial ades\xe3o e que a pratiquemos sempre com fervor. Assim seja vosso Cora\xe7\xe3o nosso ref\xfagio, nossa esperan\xe7a e o caminho que nos conduz ao amor e \xe0 uni\xe3o com vosso filho Jesus.\n\nReza-se uma dezena de Ave-Marias em sauda\xe7\xe3o a Nossa Senhora de F\xe1tima e a ora\xe7\xe3o final.","\xd3 Deus, cujo Filho unig\xeanito, por sua vida, morte e ressurrei\xe7\xe3o, nos mereceu as recompensas da salva\xe7\xe3o eterna: concedei-nos, n\xf3s vos pedimos, que, recordando pelo sant\xedssimo Ros\xe1rio estes mist\xe9rios da bem-aventurada Virgem Maria, imitemos o que encerram e obtenhamos o que prometem. Pelo mesmo Jesus Cristo, Senhor nosso. Am\xe9m.",null)
B.PM=new A.f2("Senhor meu Jesus Cristo, Deus e Homem verdadeiro, Criador e Redentor meu, por ser V\xf3s quem sois, e porque Vos amo sobre todas as coisas, a mim me pesa, de todo cora\xe7\xe3o, ter-Vos ofendido, e proponho firmemente nunca mais pecar, confessar-me, cumprir a penit\xeancia que me for imposta e apartar-me de todas as ocasi\xf5es de ofender-Vos.\n\nOfere\xe7o-Vos minha vida, minhas obras e meu trabalhos em satisfa\xe7\xe3o de todos meus pecados; e confio em Vossa bondade e miseric\xf3rdia infinita para que me perdoeis pelos m\xe9ritos de Vosso precios\xedssimo Sangue, Paix\xe3o e Morte, e me dareis gra\xe7a para emendar-me e para perseverar em Vosso santo servi\xe7o at\xe9 o fim de minha vida. Am\xe9m.","Rainha Imaculada que, aparecendo pessoalmente tal qual nascestes, a Senhora, na gruta de Lourdes, honrastes com vosso benigno olhar e com a comunica\xe7\xe3o de vossos segredos a pobre e enferma Bernadete, tanto menos estimada dos homens pela falta de toda cultura, quanto mais aceita por V\xf3s pela pureza de sua inoc\xeancia e o fervor de sua devo\xe7\xe3o;\n\nObtende para n\xf3s a gra\xe7a de que, pondo sempre nossa gl\xf3ria em fazer-nos gratos ao Senhor com uma vida inteiramente conforme a nossos deveres, n\xf3s sejamos, ao mesmo tempo, merecedores sempre de vossas especiais b\xean\xe7\xe3os. Am\xe9m.\n\nTr\xeas Ave-Marias e um Gl\xf3ria.\n\nPedir a gra\xe7a que se deseja obter com esta novena.","Oh, Virgem de Lourdes! Escolhida por Deus para ser M\xe3e de Jesus, tesoureira das divinas gra\xe7as, ref\xfagio e advogada dos pecadores! Prostrado humildemente a vossos p\xe9s, suplico-vos que sejais minha guia e sa\xfade neste vale de l\xe1grimas, porque nada posso nem devo fazer sem v\xf3s. Alcan\xe7ai-me de vosso divino Filho o perd\xe3o de meus pecados, a perseveran\xe7a no bem e a salva\xe7\xe3o de minha alma, para ser eternamente feliz e com sorte em vossa doce companhia nas mans\xf5es da gl\xf3ria. Am\xe9m.\n\nTr\xeas Ave-Marias e um Gl\xf3ria.\n\nPedir a gra\xe7a que se deseja obter com esta novena.","Oh, Virgem de Lourdes e M\xe3e minha, vida e esperan\xe7a dos pobres, ancora dos n\xe1ufragos, sa\xfade dos enfermos e esperan\xe7a dos que agonizam e morrem! Oh, M\xe3e minha! Depois de Deus, v\xf3s sois e ser\xe1s minha \xfanica esperan\xe7a nas tenta\xe7\xf5es e perigos, na vida e na hora de minha morte.\n\nN\xe3o me deixes, oh, Maria! Am\xe9m.\n\nTr\xeas Ave-Marias e um Gl\xf3ria.\n\nPedir a gra\xe7a que se deseja obter com esta novena.","Oh, Virgem pur\xedssima de Lourdes! Vida de minha alma, al\xedvio de minhas penas, suavidade e do\xe7ura de minhas afli\xe7\xf5es! As portas de vosso cora\xe7\xe3o, oh, M\xe3e minha, chama este pecador enfermo, cuja dor, neste momento, \xe9 t\xe3o grande como seus pecados.\n\nCompadecei-Vos de mim, n\xe3o me deixes, olhai com olhos de compaix\xe3o. Sanai-me, como Jesus aos leprosos, curai-me para que adore a Deus eternamente. Am\xe9m.\n\nTr\xeas Ave-Marias e um Gl\xf3ria.\n\nPedir a gra\xe7a que se deseja obter com esta novena.","Oh, Virgem de Lourdes e rainha dos anjos, em cujos olhos brilha a f\xe9 que abrasa vosso Esp\xedrito! Ensinai-me a crer, mas a crer trabalhando, porque a f\xe9 sem obras \xe9 morta; porque os que est\xe3o cheios de pecados, que n\xe3o fazem conforme a cren\xe7a cat\xf3lica, est\xe3o nos calabou\xe7os do inferno.\n\nAjudai-me a crer na palavra divina e a trabalhar como Deus e a Igreja me mandam crer e trabalhar, pois a f\xe9 \xe9 luz e tem que iluminar minha alma e a conduzir pela senda da eterna bem-aventuran\xe7a. Am\xe9m.\n\nTr\xeas Ave-Marias e um Gl\xf3ria.\n\nPedir a gra\xe7a que se deseja obter com esta novena.","Oh, Virgem de Lourdes e Virgem das virgens, a\xe7ucena cand\xedssima, Virgem Imaculada, pomba sem mancha! V\xf3s, que fostes concebida sem pecado, que tanto amais a castidade e tanto quereis a vossos filhos, tende compaix\xe3o de mim e livrai-me desta penosa concupisc\xeancia que me afunda em um mar de pecados.\n\nAlcan\xe7ai-me de vosso Filho a gra\xe7a da castidade, para viver na terra como os anjos do C\xe9u. Am\xe9m.\n\nTr\xeas Ave-Marias e um Gl\xf3ria.\n\nPedir a gra\xe7a que se deseja obter com esta novena.\n\nOra\xe7\xe3o final para todos os dias.","Oh, Virgem de Lourdes e soberana imperatriz dos c\xe9us, que, por amor a pobreza, vos sujeitastes a todas as priva\xe7\xf5es e escassez dos pobres, ensinai-me a depreciar os luxos e presentes, e inspirai-me amor e compaix\xe3o aos pobres para conseguir com a isso o reino dos c\xe9us. Am\xe9m.\n\nTr\xeas Ave-Marias e um Gl\xf3ria.\n\nPedir a gra\xe7a que se deseja obter com esta novena.","Oh, Virgem de Lourdes, exemplar sublime de obedi\xeancia, que se fazendo escrava do Senhor e humilhando-vos at\xe9 viver sem pr\xf3pria vontade, merecestes que vos chamassem de bendita todas as gera\xe7\xf5es! Ensinai-me e ajudai-me, como a menina Bernadete, a ser obediente at\xe9 a morte, porque a obedi\xeancia \xe9 melhor que os sacrif\xedcios, e quem segue obedecendo a Deus conseguir\xe1 chegar at\xe9 o c\xe9u. Am\xe9m.\n\nTr\xeas Ave-Marias e um Gl\xf3ria.\n\nPedir a gra\xe7a que se deseja obter com esta novena.","Oh, Virgem de Lourdes, rainha dos m\xe1rtires e esperan\xe7a dos aflitos! Pela heroica paci\xeancia que resplandeceu em todos os atos de vossa vida mortal, desde Bel\xe9m ao Calv\xe1rio, desde a profecia de Sim\xe3o at\xe9 que Vos arrancaram dos bra\xe7os o cad\xe1ver ensanguentado de vosso divino Filho, tende miseric\xf3rdia de mim e ajudai-me a levar com crist\xe3 resigna\xe7\xe3o o peso das cruzes que o Senhor tenha a enviar-me, para ganhar minha eterna felicidade na gl\xf3ria e viver em vossa doce companhia por todos os s\xe9culos. Am\xe9m.\n\nTr\xeas Ave-Marias e um Gl\xf3ria.\n\nPedir a gra\xe7a que se deseja obter com esta novena.","Debaixo de vosso amparo, acolhemo-nos, Santa M\xe3e de Deus. N\xe3o desprezeis nossas s\xfaplicas nas necessidades, mas sim livrai-nos de todos os perigos.\n\nOh, sempre Virgem gloriosa e bendita!\n\nV. Rogai por n\xf3s, Oh, Virgem de Lourdes!\n\nR. Para que sejamos dignos das promessas de Jesus Cristo.",null)
B.PN=new A.f2("Pai Nosso, Ave Maria e um Gl\xf3ria ao Pai.","Amabil\xedssimo S\xe3o Jos\xe9, que tivestes a honra de alimentar, educar e abra\xe7ar o Messias, a quem tantos profetas e reis desejaram ver e n\xe3o viram, obtende-me, com o perd\xe3o das minhas culpas, a gra\xe7a da ora\xe7\xe3o humilde e confiante que tudo alcan\xe7a de Deus. Acolhei com bondade paternal os pedidos que vos fa\xe7o nesta novena e apresentai-os a Jesus, que se dignou obedecer-vos na terra. Am\xe9m.\n\nV/. Rogai por n\xf3s, S\xe3o Jos\xe9, pai nutr\xedcio de Jesus.\nR/. Para que sejamos dignos das promessas de Cristo.\n\nOremos. \xd3 Deus, que por uma inef\xe1vel Provid\xeancia Vos dignastes escolher o bem-aventurado S\xe3o Jos\xe9 para Esposo de vossa M\xe3e Sant\xedssima, concedei-nos que aquele mesmo que na terra veneramos como protetor, mere\xe7amos t\xea-lo no c\xe9u por nosso intercessor. V\xf3s que viveis e reinais por todos os s\xe9culos dos s\xe9culos. Am\xe9m.","\xe3o Jos\xe9, cast\xedssimo Esposo da M\xe3e de Deus e guarda fiel da sua virgindade, obtende-me, por Maria, a pureza do corpo e da alma e a vit\xf3ria em todas as tenta\xe7\xf5es e dificuldades. Recomendo-vos tamb\xe9m os esposos crist\xe3os, para que, unidos com sincero amor e fortalecidos pela gra\xe7a, amparem-se mutuamente nos sofrimentos e tribula\xe7\xf5es da vida. Am\xe9m.\n\nV/. Rogai por n\xf3s, S\xe3o Jos\xe9, esposo da M\xe3e de Deus.\nR/. Para que sejamos dignos das promessas de Cristo.\n\nOremos. \xd3 Deus, que por uma inef\xe1vel Provid\xeancia Vos dignastes escolher o bem-aventurado S\xe3o Jos\xe9 para Esposo de vossa M\xe3e Sant\xedssima, concedei-nos que aquele mesmo que na terra veneramos como protetor, mere\xe7amos t\xea-lo no c\xe9u por nosso intercessor. V\xf3s que viveis e reinais por todos os s\xe9culos dos s\xe9culos. Am\xe9m.","Glorioso S\xe3o Jos\xe9, que gozastes durante tantos anos da presen\xe7a e filial afei\xe7\xe3o de Jesus, a quem tivestes a dita de alimentar e vestir, juntamente com vossa Sant\xedssima Esposa, eu vos suplico me alcanceis o dom inef\xe1vel de sempre viver em uni\xe3o com Deus pela gra\xe7a santificante. Obtende tamb\xe9m para os pais crist\xe3os a gra\xe7a do fiel cumprimento de seus graves deveres de educadores e, aos filhos, o respeito e a obedi\xeancia, segundo o exemplo do Menino Jesus. Am\xe9m.\n\nV/. Rogai por n\xf3s, S\xe3o Jos\xe9, chefe da Sagrada Fam\xedlia.\nR/. Para que sejamos dignos das promessas de Cristo.\n\nOremos. \xd3 Deus, que por uma inef\xe1vel Provid\xeancia Vos dignastes escolher o bem-aventurado S\xe3o Jos\xe9 para Esposo de vossa M\xe3e Sant\xedssima, concedei-nos que aquele mesmo que na terra veneramos como protetor, mere\xe7amos t\xea-lo no c\xe9u por nosso intercessor. V\xf3s que viveis e reinais por todos os s\xe9culos dos s\xe9culos. Am\xe9m.","Fidel\xedssimo S\xe3o Jos\xe9, que nos destes t\xe3o belo exemplo no fiel cumprimento de vossos deveres de protetor da Sant\xedssima Virgem e de pai nutr\xedcio do Redentor, rogo-vos me obtenhais a gra\xe7a de imitar o vosso exemplo na fidelidade a todos os deveres do meu estado de vida. Ajudai-me a ser fiel nas coisas pequenas, para o ser tamb\xe9m nas grandes. Alcan\xe7ai essa mesma gra\xe7a para todos os que me s\xe3o caros nesta vida, a fim de chegarmos a gozar no c\xe9u o pr\xeamio prometido aos que forem fi\xe9is at\xe9 a morte. Am\xe9m.\n\nV/. Rogai por n\xf3s, S\xe3o Jos\xe9, exemplo de fidelidade.\nR/. Para que sejamos dignos das promessas de Cristo.\n\nOremos. \xd3 Deus, que por uma inef\xe1vel Provid\xeancia Vos dignastes escolher o bem-aventurado S\xe3o Jos\xe9 para Esposo de vossa M\xe3e Sant\xedssima, concedei-nos que aquele mesmo que na terra veneramos como protetor, mere\xe7amos t\xea-lo no c\xe9u por nosso intercessor. V\xf3s que viveis e reinais por todos os s\xe9culos dos s\xe9culos. Am\xe9m.","Bondoso S\xe3o Jos\xe9, que suportastes com her\xf3ica paci\xeancia as prova\xe7\xf5es e adversidades na viagem a Bel\xe9m, na fuga para o Egito durante a vida oculta em Nazar\xe9 e me destes o exemplo de admir\xe1vel conformidade com a vontade de Deus, obtende-me a virtude da paci\xeancia nas dificuldades de cada dia. Alcan\xe7ai tamb\xe9m invenc\xedvel paci\xeancia a todos os que suportam pesadas cruzes, a fim de que se unam sempre mais a Jesus, divino modelo de mansid\xe3o e paci\xeancia. Am\xe9m.\n\nV/. Rogai por n\xf3s, S\xe3o Jos\xe9, espelho de paci\xeancia.\nR/. Para que sejamos dignos das promessas de Cristo.\n\nOremos. \xd3 Deus, que por uma inef\xe1vel Provid\xeancia Vos dignastes escolher o bem-aventurado S\xe3o Jos\xe9 para Esposo de vossa M\xe3e Sant\xedssima, concedei-nos que aquele mesmo que na terra veneramos como protetor, mere\xe7amos t\xea-lo no c\xe9u por nosso intercessor. V\xf3s que viveis e reinais por todos os s\xe9culos dos s\xe9culos. Am\xe9m.","Humilde S\xe3o Jos\xe9, que vivendo em pobreza dignificastes a vossa profiss\xe3o pelo trabalho constante e vos sentistes feliz em servir a Jesus e a Maria com o fruto de vossos suores, alcan\xe7ai-me amor ao trabalho, que me foi imposto como dever de estado, procurando cumprir nisto sempre a vontade de Deus. Protegei os lares dos trabalhadores do Brasil contra as influ\xeancias nefastas dos inimigos de Cristo e da Santa Igreja. Obtende-lhes a gra\xe7a de santificarem o seu trabalho, pela reta inten\xe7\xe3o, em tudo conformados com os des\xedgnios da Divina Provid\xeancia. Am\xe9m.\n\nV/. Rogai por n\xf3s, S\xe3o Jos\xe9, modelo dos oper\xe1rios.\nR/. Para que sejamos dignos das promessas de Cristo.\n\nOremos. \xd3 Deus, que por uma inef\xe1vel Provid\xeancia Vos dignastes escolher o bem-aventurado S\xe3o Jos\xe9 para Esposo de vossa M\xe3e Sant\xedssima, concedei-nos que aquele mesmo que na terra veneramos como protetor, mere\xe7amos t\xea-lo no c\xe9u por nosso intercessor. V\xf3s que viveis e reinais por todos os s\xe9culos dos s\xe9culos. Am\xe9m.",u.W,u.W,"Ditoso S\xe3o Jos\xe9, que morrendo nos bra\xe7os de Jesus e Maria, partistes deste mundo ornado de virtudes e enriquecido de m\xe9ritos, assisti-me na hora suprema e decisiva da minha vida contra os ataques do poder infernal. Obtende-me a gra\xe7a de morrer confortado com os santos Sacramentos, necess\xe1rios para a minha salva\xe7\xe3o. Tende compaix\xe3o de todos os agonizantes, alcan\xe7ando-lhes a gra\xe7a da salva\xe7\xe3o por interm\xe9dio de Maria, vossa Sant\xedssima Esposa. Am\xe9m.\n\nV/. Rogai por n\xf3s, S\xe3o Jos\xe9, padroeiro dos moribundos.\nR/. Para que sejamos dignos das promessas de Cristo.\n\nOremos. \xd3 Deus, que por uma inef\xe1vel Provid\xeancia Vos dignastes escolher o bem-aventurado S\xe3o Jos\xe9 para Esposo de vossa M\xe3e Sant\xedssima, concedei-nos que aquele mesmo que na terra veneramos como protetor, mere\xe7amos t\xea-lo no c\xe9u por nosso intercessor. V\xf3s que viveis e reinais por todos os s\xe9culos dos s\xe9culos. Am\xe9m.","Glorioso S\xe3o Jos\xe9, que fostes exaltado pelo Eterno Pai, obedecido pelo Verbo Encarnado, favorecido pelo Esp\xedrito Santo e amado pela Virgem Maria; louvo e bendigo a Sant\xedssima Trindade pelos privil\xe9gios e m\xe9ritos com que vos enriqueceu. Sois poderos\xedssimo e jamais se ouviu dizer que algu\xe9m tenha recorrido a v\xf3s e fosse por v\xf3s desamparado. Sois o consolador dos aflitos, o amparo dos m\xedseros e o advogado dos pecadores. Acolhei, pois, com bondade paternal a quem vos invoca com filial confian\xe7a e alcan\xe7ai-me as gra\xe7as que vos pe\xe7o nesta novena. Eu vos escolho por meu especial protetor. Sede, depois de Jesus e Maria, minha consola\xe7\xe3o nesta terra, meu ref\xfagio nas desgra\xe7as, meu guia nas incertezas, meu conforto nas tribula\xe7\xf5es, meu pai sol\xedcito em todas as necessidades. Obtende-me, finalmente, como coroa dos vossos favores, uma boa e santa morte na gra\xe7a de Nosso Senhor. Am\xe9m.",null)
B.PO=new A.f2("Caro ap\xf3stolo e m\xe1rtir de Cristo, que nos deixou uma ep\xedstola do novo testamento. Com boa raz\xe3o, muitos invocam a v\xf3s quando doentes em fase desesperada e necessitam de um aux\xedlio urgente. N\xf3s j\xe1 recomendamos \xe0 sua bondade (diga nome de quem necessita do aux\xedlio), que est\xe1 em uma condi\xe7\xe3o cr\xedtica. A cura do doente pode aumentar a f\xe9 e o amor deste que sofre para com o senhor da vida, para a gl\xf3ria de nosso Deus misericordioso. Am\xe9m.","S\xe3o Judas Tadeu, escolhido por Cristo, o amor profundo a Jesus fez que soub\xe9sseis escolher o caminho de Deus, na prega\xe7\xe3o do Evangelho. \xc9 necess\xe1rio que aprendamos vossas virtudes, sigamos vosso exemplo como melhor meio de tornarmo-nos disc\xedpulos de Cristo.\n\nQue n\xf3s sigamos o vosso exemplo tanto na alegria e na vit\xf3ria, na luta e no sofrimento. Que compreendamos que todas as realidades, agrad\xe1veis ou dif\xedceis, dever\xe3o ser assumidas como oportunidades benfazejas, que nos levar\xe3o ao crescimento na f\xe9 e \xe0 capacidade de servir no amor de Cristo.\n\nS\xe3o Judas Tadeu, alcan\xe7ai-me a gra\xe7a que vos pe\xe7o (fa\xe7a seu pedido com f\xe9). Eu vos prometo, \xf3 bendito S\xe3o Judas Tadeu, lembrar-me sempre desta gra\xe7a e nunca deixar de vos louvar e honrar. Farei tudo para espalhar atrav\xe9s de minha vida e meu testemunho o amor ensinado por Jesus e vivido por v\xf3s.\n\nS\xe3o Judas Tadeu, rogai por n\xf3s!\n\nPai Nosso, \u2026\nAve Maria \u2026\nGl\xf3ria ao Pai, ao Filho e ao Esp\xedrito Santo, como era no princ\xedpio, agora e sempre. Am\xe9m.","S\xe3o Judas Tadeu, Ap\xf3stolo e construtor do Reino de Deus, que espalhastes a Boa Nova da Salva\xe7\xe3o em Cristo, desejamos que venha o quanto antes o Reino de Deus a todos os homens, sedentos de Deus e da sua verdade. \xc9 preciso que muitos sejam como v\xf3s fostes: construtores do Reino de Deus.\n\nDesejamos ser ap\xf3stolos e propagadores da mensagem, da verdade e do amor que Cristo ensinou e dar testemunho crist\xe3o nos ambientes em que vivemos sem vacilar na f\xe9 e na esperan\xe7a. Queremos dar testemunho, vivendo o Evangelho, mediante o amor que nos compromete com Cristo.\n\nS\xe3o Judas Tadeu, alcan\xe7ai-me a gra\xe7a que vos pe\xe7o (fa\xe7a seu pedido com f\xe9). Eu vos prometo, \xf3 bendito S\xe3o Judas Tadeu, lembrar-me sempre desta gra\xe7a e nunca deixar de vos louvar e honrar. Farei tudo para espalhar atrav\xe9s de minha vida e meu testemunho o amor ensinado por Jesus e vivido por v\xf3s.\n\nS\xe3o Judas Tadeu, rogai por n\xf3s!\n\nPai Nosso, \u2026\nAve Maria \u2026\nGl\xf3ria ao Pai, ao Filho e ao Esp\xedrito Santo, como era no princ\xedpio, agora e sempre. Am\xe9m.","S\xe3o Judas Tadeu, Ap\xf3stolo de Jesus Cristo e servidor dos homens, v\xf3s que vistes o exemplo de Cristo, que veio para servir e n\xe3o para ser servido, rogai por n\xf3s para que compreendamos o valor do servi\xe7o desinteressado e gratuito.\n\nAuxiliai-nos a adquirir o sentido da doa\xe7\xe3o ao pr\xf3ximo, na fam\xedlia, no trabalho e na comunidade. V\xf3s que fizestes de vossa vida uma doa\xe7\xe3o total, pelo an\xfancio do Evangelho e pelo testemunho de Cristo at\xe9 o mart\xedrio, inspirai-nos coragem e sabedoria, para colocarmos nossas energias e talentos a servi\xe7o do irm\xe3o.\n\nS\xe3o Judas Tadeu, alcan\xe7ai-me a gra\xe7a que vos pe\xe7o (fa\xe7a seu pedido com f\xe9). Eu vos prometo, \xf3 bendito S\xe3o Judas Tadeu, lembrar-me sempre desta gra\xe7a e nunca deixar de vos louvar e honrar. Farei tudo para espalhar atrav\xe9s de minha vida e meu testemunho o amor ensinado por Jesus e vivido por v\xf3s.\n\nS\xe3o Judas Tadeu, rogai por n\xf3s!\n\nPai Nosso, \u2026\nAve Maria \u2026\nGl\xf3ria ao Pai, ao Filho e ao Esp\xedrito Santo, como era no princ\xedpio, agora e sempre. Am\xe9m.","S\xe3o Judas Tadeu, Ap\xf3stolo sempre fiel ao chamado do Mestre e obediente \xe0 voz do Pai, nada vos afastou de seu plano de amor. De v\xf3s queremos aprender a renunciar a qualquer plano ego\xedsta para aceitar em tudo a vontade do Pai.\n\nAjudai-nos, S\xe3o Judas, a sermos generosos no seguimento de Cristo, e humildes na ren\xfancia a tudo o que nos afasta de seu caminho. Fazei que procuremos, em primeiro lugar, o que nos torna instrumentos de paz e sinais de Cristo para nossos irm\xe3os.\n\nS\xe3o Judas Tadeu, alcan\xe7ai-me a gra\xe7a que vos pe\xe7o (fa\xe7a seu pedido com f\xe9). Eu vos prometo, \xf3 bendito S\xe3o Judas Tadeu, lembrar-me sempre desta gra\xe7a e nunca deixar de vos louvar e honrar. Farei tudo para espalhar atrav\xe9s de minha vida e meu testemunho o amor ensinado por Jesus e vivido por v\xf3s.\n\nS\xe3o Judas Tadeu, rogai por n\xf3s!\n\nPai Nosso, \u2026\nAve Maria \u2026\nGl\xf3ria ao Pai, ao Filho e ao Esp\xedrito Santo, como era no princ\xedpio, agora e sempre. Am\xe9m.","S\xe3o Judas Tadeu, Ap\xf3stolo de Jesus Cristo e sinal de santidade de Deus, ajudai-nos a alcan\xe7ar a gra\xe7a da pureza de inten\xe7\xf5es para que nosso interior seja fonte de paz e bondade, jorrando a vida de Deus para nossos irm\xe3os.\n\nQue saibamos ser donos de n\xf3s mesmos e de nossos sentidos, e possamos estar entre aqueles que s\xe3o chamados bem-aventurados porque s\xe3o puros de cora\xe7\xe3o. Conquistai-nos um cora\xe7\xe3o puro, para que atrav\xe9s dele possamos enxergar o Cristo em nosso caminho e indic\xe1-lo aos irm\xe3os.\n\nS\xe3o Judas Tadeu, alcan\xe7ai-me a gra\xe7a que vos pe\xe7o (fa\xe7a seu pedido com f\xe9). Eu vos prometo, \xf3 bendito S\xe3o Judas Tadeu, lembrar-me sempre desta gra\xe7a e nunca deixar de vos louvar e honrar. Farei tudo para espalhar atrav\xe9s de minha vida e meu testemunho o amor ensinado por Jesus e vivido por v\xf3s.\n\nS\xe3o Judas Tadeu, rogai por n\xf3s!\n\nPai Nosso, \u2026\nAve Maria \u2026\n\nGl\xf3ria ao Pai, ao Filho e ao Esp\xedrito Santo, como era no princ\xedpio, agora e sempre. Am\xe9m.","S\xe3o Judas Tadeu, Ap\xf3stolo e instrumento de reconcilia\xe7\xe3o, alcan\xe7ai-nos do Pai o dom da firmeza diante do mal, do ego\xedsmo e da injusti\xe7a. Fazei-nos sempre atentos \xe0 advert\xeancia de Cristo: \u2018Vigiai e orai, para n\xe3o cairdes em tenta\xe7\xe3o\u2019.\n\nV\xf3s que lutastes para vencer o pecado, dai-nos um esp\xedrito resoluto e a gra\xe7a de n\xe3o cairmos em tenta\xe7\xe3o. E se isto acontecer, rogai por n\xf3s, para termos \xe2nimo de nos reerguermos e voltarmos \xe0 uni\xe3o com Cristo, vosso e nosso Mestre.\n\nS\xe3o Judas Tadeu, alcan\xe7ai-me a gra\xe7a que vos pe\xe7o (fa\xe7a seu pedido com f\xe9). Eu vos prometo, \xf3 bendito S\xe3o Judas Tadeu, lembrar-me sempre desta gra\xe7a e nunca deixar de vos louvar e honrar. Farei tudo para espalhar atrav\xe9s de minha vida e meu testemunho o amor ensinado por Jesus e vivido por v\xf3s.\n\nS\xe3o Judas Tadeu, rogai por n\xf3s!\n\nPai Nosso, \u2026\nAve Maria \u2026\nGl\xf3ria ao Pai, ao Filho e ao Esp\xedrito Santo, como era no princ\xedpio, agora e sempre. Am\xe9m.","S\xe3o Judas Tadeu, Ap\xf3stolo e homem de f\xe9 inabal\xe1vel, a ponto de fazerdes de Cristo vossa \xfanica e absoluta certeza, rogai por n\xf3s, para que cres\xe7a nossa f\xe9 e se torne luz para os irm\xe3os. Reconhecemos, diante de Deus, que freq\xfcentemente nossa f\xe9 \xe9 vacilante e fr\xe1gil. Sabemos que \xe9 um precioso dom de Deus, que \xe9 preciso acolher com simplicidade, cultivar pela ora\xe7\xe3o e pelo reconhecimento do evangelho.\n\nAjudai-nos a pedir humildemente, como v\xf3s pedistes com os ap\xf3stolos: Senhor, aumentai a nossa f\xe9!\n\nS\xe3o Judas Tadeu, alcan\xe7ai-me a gra\xe7a que vos pe\xe7o (fa\xe7a seu pedido com f\xe9). Eu vos prometo, \xf3 bendito S\xe3o Judas Tadeu, lembrar-me sempre desta gra\xe7a e nunca deixar de vos louvar e honrar. Farei tudo para espalhar atrav\xe9s de minha vida e meu testemunho o amor ensinado por Jesus e vivido por v\xf3s.\n\nS\xe3o Judas Tadeu, rogai por n\xf3s!\n\nPai Nosso, \u2026\nAve Maria \u2026\nGl\xf3ria ao Pai, ao Filho e ao Esp\xedrito Santo, como era no princ\xedpio, agora e sempre. Am\xe9m.","S\xe3o Judas Tadeu, Ap\xf3stolo e irm\xe3o dos pobres, hoje vos pedimos que nos alcanceis o esp\xedrito de pobreza. Com Cristo anunciastes a boa nova aos pobres e dele ouvistes a solene proclama\xe7\xe3o: \u2018Bem-aventurados os que t\xeam esp\xedrito de pobre porque deles \xe9 o reino do c\xe9u\u2019.\n\nRogai por n\xf3s, para que o desejo de lucro n\xe3o nos domine e a gan\xe2ncia de ter mais n\xe3o tire a capacidade de doar-nos aos mais necessitados e de sermos solid\xe1rios com os pobres, os doentes, os oprimidos e marginalizados. Encorajados pelo testemunho dos ap\xf3stolos, n\xe3o nos falte o senso de fraternidade, para trabalharmos com todas a for\xe7as pela defesa e promo\xe7\xe3o dos mais desamparados. E que aprendamos a reconhecer em cada um deles o pr\xf3prio Cristo, nosso irm\xe3o e Senhor!\n\nS\xe3o Judas Tadeu, alcan\xe7ai-me a gra\xe7a que vos pe\xe7o (fa\xe7a seu pedido com f\xe9). Eu vos prometo, \xf3 bendito S\xe3o Judas Tadeu, lembrar-me sempre desta gra\xe7a e nunca deixar de vos louvar e honrar. Farei tudo para espalhar atrav\xe9s de minha vida e meu testemunho o amor ensinado por Jesus e vivido por v\xf3s.\n\nS\xe3o Judas Tadeu, rogai por n\xf3s!\n\nPai Nosso, \u2026\nAve Maria \u2026\nGl\xf3ria ao Pai, ao Filho e ao Esp\xedrito Santo, como era no princ\xedpio, agora e sempre. Am\xe9m.","S\xe3o Judas Tadeu, Ap\xf3stolo e M\xe1rtir, que experimentastes no conv\xedvio com Cristo o infinito amor do seu Cora\xe7\xe3o, alcan\xe7ai-nos a gra\xe7a da convers\xe3o, para que nossos cora\xe7\xf5es se tornem semelhantes ao Dele.\n\nReconhecemos em Jesus o homem que mais amou, e modelo para todos os homens de bom cora\xe7\xe3o. Por vossa intercess\xe3o, sejamos renovados interiormente, segundo a promessa de Deus, de derramar sobre n\xf3s uma \xe1gua pura e dar-nos um cora\xe7\xe3o novo.\n\nS\xe3o Judas Tadeu, alcan\xe7ai-me a gra\xe7a que vos pe\xe7o (fa\xe7a seu pedido com f\xe9). Eu vos prometo, \xf3 bendito S\xe3o Judas Tadeu, lembrar-me sempre desta gra\xe7a e nunca deixar de vos louvar e honrar. Farei tudo para espalhar atrav\xe9s de minha vida e meu testemunho o amor ensinado por Jesus e vivido por v\xf3s.\n\nS\xe3o Judas Tadeu, rogai por n\xf3s!\n\nPai Nosso, \u2026\nAve Maria \u2026\nGl\xf3ria ao Pai, ao Filho e ao Esp\xedrito Santo, como era no princ\xedpio, agora e sempre. Am\xe9m.","\xd3, glorioso ap\xf3stolo S\xe3o Judas, verdadeiro parente de Jesus e Maria, eu vos sa\xfado atrav\xe9s do sagrado cora\xe7\xe3o de Jesus. Atrav\xe9s deste cora\xe7\xe3o, eu louvo e agrade\xe7o a Deus por todas as gra\xe7as que ele tem para convosco. Humildemente prostrados diante de v\xf3s, eu vos imploro, atrav\xe9s desta ora\xe7\xe3o, n\xe3o menospreze minha compaix\xe3o. N\xe3o despreze o meu pobre cora\xe7\xe3o e n\xe3o deixe que minha confian\xe7a seja em v\xe3o. A vos, a quem foi atribu\xeddo o privil\xe9gio de ajudar a humanidade na maioria dos casos desesperados. \xd3 vem para a minha ajuda, que eu possa louvar as miseric\xf3rdias de Deus. Toda a minha vida eu serei grato a v\xf3s e serei o seu fiel cliente at\xe9 poder agradecer a v\xf3s no c\xe9u. Am\xe9m.",null)
B.PP=new A.f2("Deus vos salve, Maria, cheia de gra\xe7a e bendita mais que todas as mulheres, Virgem singular, Virgem soberana e perfeita, eleita por M\xe3e de Deus e preservada por Ele de toda culpa desde o primeiro instante de sua Concep\xe7\xe3o:\n\nAssim como por Eva nos veio a morte, assim nos vem a vida por ti, que pela gra\xe7a de Deus tens sido eleita para ser M\xe3e do novo povo que Jesus Cristo tem formado com seu Sangue.\n\nA ti, pur\xedssima M\xe3e, restauradora da ca\xedda linhagem de Ad\xe3o e Eva, viemos confiantes e suplicantes nesta novena, para rogar que nos concedas a gra\xe7a de sermos verdadeiros filhos teus e de teu Filho Jesus Cristo, livres de toda mancha de pecado.\n\nConfiantes, Virgem Sant\xedssima, que haveis sido feita M\xe3e de Deus, n\xe3o somente para vossa dignidade e gl\xf3ria, sen\xe3o tamb\xe9m para salva\xe7\xe3o nossa e proveito de todo o g\xeanero humano.\n\nConfiantes que jamais se tem ouvido dizer que um somente de quantos tem acudido a vossa prote\xe7\xe3o e implorado vosso socorro, tem j\xe1 sido desamparado.\n\nN\xe3o me deixeis, pois, a mim tampouco, porque se me deixais me perderei;\n\nQue eu tampouco quero deixar a vos, antes bem, cada dia quero crescer mais em vossa verdadeira devo\xe7\xe3o.\n\nAlcan\xe7ai-me principalmente estas tr\xeas gra\xe7as:\nA primeira, n\xe3o cometer jamais pecado mortal,\nA segunda, um grande apre\xe7o da virtude crist\xe3,\nA terceira, uma boa morte.\n\nAl\xe9m disso, dai-me a gra\xe7a particular que vos pe\xe7o nesta novena (pedir).\n\nOh! Deus meu, que pela Imaculada Concep\xe7\xe3o da Virgem, preparaste digna habita\xe7\xe3o a teu Filho: Vos rogamos que, assim como pela previs\xe3o da morte de teu Filho livrai-vos a ela de toda mancha, assim a n\xf3s nos concedas por sua intercess\xe3o chegar a V\xf3s limpos de pecado. Pelo mesmo Senhor nosso Jesus Cristo. Am\xe9m.","Oh! Sant\xedssimo Filho de Maria Imaculada e benign\xedssimo Redentor nosso: Assim como preservaste a Maria do pecado original em sua Imaculada Concep\xe7\xe3o, e a n\xf3s nos fizeste o grande beneficio de livramos dele por meio de teu Santo batismo, assim vos rogamos humildemente nos concedas a gra\xe7a de nos portarmos sempre como bons crist\xe3os, regenerados em ti, Nosso Pai Alt\xedssimo.","Oh! Sant\xedssimo Filho de Maria Imaculada e benign\xedssimo Redentor nosso: Assim como preservaste a Maria de todo pecado mortal em toda sua vida e a n\xf3s nos dais gra\xe7a para evita-lo e o Sacramento da confiss\xe3o para remedia-lo, assim vos rogamos humildemente, por intercess\xe3o de tua M\xe3e Imaculada, nos concedas a gra\xe7a de n\xe3o cometer nunca pecado mortal, e se acontecer t\xe3o terr\xedvel desgra\xe7a, a de sair dele quanto antes por meio de uma boa confiss\xe3o.","Oh! Sant\xedssimo Filho de Maria Imaculada e benign\xedssimo Redentor nosso: Assim como preservaste a Maria de todo pecado venial em toda sua vida, e a n\xf3s nos pedes que purifiquemos mais e mais nossas almas para sermos dignos de ti, assim vos rogamos humildemente, por intercess\xe3o de tua M\xe3e Imaculada, nos concedas a gra\xe7a de evitar os pecados veniais e a de procurar e obter cada dia mais pureza e delicadeza de consci\xeancia.","Oh! Sant\xedssimo Filho de Maria Imaculada e benign\xedssimo Redentor nosso: Assim como livrais a Maria da inclina\xe7\xe3o ao pecado e lhe destes dom\xednio perfeito sobre todas suas paix\xf5es, assim vos rogamos humildemente, por intercess\xe3o de Maria Imaculada, nos concedas a gra\xe7a de ir domando nossas paix\xf5es e destruindo nossas m\xe1s inclina\xe7\xf5es, para que vos possamos servir, com verdadeira liberdade de esp\xedrito, sem imperfei\xe7\xe3o nenhuma.","Oh! Sant\xedssimo Filho de Maria Imaculada e benign\xedssimo Redentor nosso: Assim como, desde o primeiro instante de sua Concep\xe7\xe3o, destes a Maria mais gra\xe7a que a todos os Santos e anjos do c\xe9u, assim vos rogamos humildemente, por intercess\xe3o de tua M\xe3e Imaculada, nos inspires um apre\xe7o singular da divina gra\xe7a que V\xf3s nos adquiriste com teu sangue, e nos concedas o aumentar mais e mais com nossas boas obras e com a recep\xe7\xe3o de teus Santos Sacramentos, especialmente o da Comunh\xe3o.","Oh! Sant\xedssimo Filho de Maria Imaculada e benign\xedssimo Redentor nosso: Assim como, desde o primeiro momento, destes a Maria, com toda plenitude, as virtudes sobrenaturais e os dons do Esp\xedrito Santo, assim vos suplicamos humildemente, por intercess\xe3o de tua M\xe3e Imaculada, nos concedas a n\xf3s a abundancia destes mesmos dons e virtudes, para que possamos vencer todas as tenta\xe7\xf5es e tenhamos muitos atos de virtude dignos de nossa profiss\xe3o de crist\xe3os.","Oh! Sant\xedssimo Filho de Maria Imaculada e benign\xedssimo Redentor nosso: Assim como destes a Maria, entre as demais virtudes, uma pureza e castidade eximia, pela qual \xe9 chamada Virgem das virgens, assim vos suplicamos, por intercess\xe3o de tua M\xe3e Imaculada, nos concedas a dificil\xedssima virtude da castidade, que tantos tem conservado mediante a devo\xe7\xe3o da Virgem e tua prote\xe7\xe3o.","Oh! Sant\xedssimo Filho de Maria Imaculada e benign\xedssimo Redentor nosso: Assim como destes a Maria a gra\xe7a de uma ardent\xedssima caridade e amor de Deus sobre todas as coisas, assim vos rogamos humildemente, por intercess\xe3o de tua M\xe3e Imaculada, nos concedas um amor sincero de ti, Oh! Deus Senhor nosso! Nosso verdadeiro bem, nosso bem feitor, nosso Pai, e que antes queiramos perder todas as coisas que ofender-Vos com um somente pecado.","Oh! Sant\xedssimo Filho de Maria Imaculada e benign\xedssimo Redentor nosso: Assim como tens concedido a Maria a gra\xe7a de ir ao c\xe9u e de ser nele colocada no primeiro lugar depois de V\xf3s, vos suplicamos humildemente, por intercess\xe3o de Maria Imaculada, nos concedas uma boa morte, que recebamos bem os \xfaltimos sacramentos, que expiremos sem mancha nenhuma de pecado na consci\xeancia e vamos ao c\xe9u, para sempre aproveitar, em tua companhia e a de nossa M\xe3e, com todos os que se tem salvado por ela.","Bendita seja tua pureza e eternamente o seja, pois todo um Deus se recreia em t\xe3o graciosa beleza. A ti, celestial Princesa, Virgem Sagrada Maria, vos ofere\xe7o neste dia alma, vida e cora\xe7\xe3o. Olhai-me com compaix\xe3o, n\xe3o me deixes, M\xe3e minha. (Ave Maria... 3x).\n\nTua Imaculada Concep\xe7\xe3o, Oh! Virgem M\xe3e de Deus, anunciou alegria ao uninerso inteiro.",null)
B.PQ=new A.f2(u.n,"Oh, Esp\xedrito Santo, Fonte Viva de divinas \xe1guas, que, na cria\xe7\xe3o do mundo, santificastes as imensas \xe1guas que rodeavam o mundo e as \xe1guas do Jord\xe3o! No batismo de Jesus Cristo, Senhor nosso, eu Vos suplico que sejais, em meu Esp\xedrito, t\xe3o \xe1rido e seco, a Sagrada Fonte de \xe1gua viva, que jamais se esgota e brota at\xe9 a vida eterna.\n\nA gra\xe7a que Vos pe\xe7o, nesta novena, \xe9 para maior gl\xf3ria Vossa e bem de minha alma. Am\xe9m!\n\nRezar 1 Pai-Nosso e 1 Ave-Maria em honra \xe0 Sant\xedssima Trindade.\n\n(Rezar Ora\xe7\xe3o Final)","Oh, Esp\xedrito Santo, fazendo sombra, com Vossa virtude alt\xedssima, \xe0 pur\xedssima Virgem Maria e, ao mesmo tempo, a transbordando de gra\xe7a, fizeste, de um modo inef\xe1vel e Onipotente, a obra infinita da Encarna\xe7\xe3o do Verbo Eterno no seio virginal de Vossa celestial Esposa.\n\nPe\xe7o-Vos, nesta novena, fazei sombra \xe0 minha alma e concedei-me a gra\xe7a necess\xe1ria para que eu seja digno de receber o mesmo Verbo Divino feito Homem. Am\xe9m.\n\nE a gra\xe7a que Vos pe\xe7o, nesta novena, \xe9 para maior gl\xf3ria Vossa e bem de minha alma. Am\xe9m!\n\nRezar 1 Pai-Nosso e 1 Ave-Maria em honra \xe0 Sant\xedssima Trindade.\n\n(Rezar Ora\xe7\xe3o Final)","Oh, Esp\xedrito Santo, Celestial Pomba que, abrindo de par em par os c\xe9us, descestes sobre Jesus j\xe1 batizado, no Jord\xe3o, simbolizando que, desde esse momento em que tomou a natureza humana, habitava n\u2019Ele a plenitude da divindade.\n\nVinde sobre a mim, Esp\xedrito de Deus, que sou pobre e miser\xe1vel, e enchei-me do dom de sabedoria, de conselho, entendimento e fortaleza, do dom de ci\xeancia, piedade e de temor a Deus. E que a gra\xe7a que Vos pe\xe7o, nesta novena, seja para maior gl\xf3ria Vossa e bem de minha alma. Am\xe9m.\n\nRezar 1 Pai-Nosso e 1 Ave-Maria em honra \xe0 Sant\xedssima Trindade.\n\n(Rezar Ora\xe7\xe3o Final)","Oh, Esp\xedrito Santo, que fazendo, no Tabor, sombra a Jesus transfigurado e glorioso, ilustrastes aquele santo monte e amparastes, em Seu excessivo temor aos ap\xf3stolos, comunicando-lhes, depois da Ascens\xe3o de Seu Divino Mestre, muita luz, fervor e gra\xe7a; ilustrai, protegei e fecundai minha alma para que eu seja um disc\xedpulo digno de Jesus.\n\nE a gra\xe7a que Vos pe\xe7o, nesta novena, seja para maior gl\xf3ria Vossa e bem de minha alma. Am\xe9m.\n\nRezar 1 Pai-Nosso e 1 Ave-Maria em honra \xe0 Sant\xedssima Trindade.\n\n(Rezar Ora\xe7\xe3o Final)","Oh, Esp\xedrito Santo, Suave Vento que teve o Cen\xe1culo e deu for\xe7a e valor aos cora\xe7\xf5es de quantos Vos esperavam, orando fervorosamente unidos com alma e cora\xe7\xe3o! Oh, Esp\xedrito de vida e amor, enchei de gra\xe7a toda a casa de meu pequeno esp\xedrito, minha mem\xf3ria, entendimento e vontade.\n\nE a gra\xe7a que Vos pe\xe7o, nesta novena, seja para maior gl\xf3ria Vossa e bem de minha alma. Am\xe9m.\n\nRezar 1 Pai-Nosso e 1 Ave-Maria em honra \xe0 Sant\xedssima Trindade.\n\n(Rezar Ora\xe7\xe3o Final)","Oh, Esp\xedrito Santo, Luz clar\xedssima que ilustrou o entendimento dos santos ap\xf3stolos, comunicando-lhes, como Sol divino, toda a luz que necessitavam para sua perfei\xe7\xe3o e para a convers\xe3o do mundo! Oh, Luz beat\xedssima, iluminai todos os lugares tenebrosos de meu interior para que Vos conhe\xe7a e d\xea a conhecer a todo o mundo.\n\nE a gra\xe7a que Vos pe\xe7o, nesta novena, seja para maior gl\xf3ria Vossa e bem de minha alma. Am\xe9m.\n\nRezar 1 Pai-Nosso e 1 Ave-Maria em honra \xe0 Sant\xedssima Trindade.\n\n(Rezar Ora\xe7\xe3o Final)","Oh, Esp\xedrito Santo, Sagrado Fogo, que aparecendo vis\xedvel aos ap\xf3stolos, no dia de Pentecostes, inflamastes divinamente o cora\xe7\xe3o deles para que, abrasados em Vosso amor, incendiassem todo o mundo nas mesmas sagradas chamas. Acendei, em Vosso Sant\xedssimo ardor, meu cora\xe7\xe3o gelado, para que, abrasado meu esp\xedrito neles, acenda em Vosso divino amor a quantos pessoas eu conhe\xe7a.\n\nE a gra\xe7a que Vos pe\xe7o, nesta novena, seja para maior gl\xf3ria Vossa e bem de minha alma. Am\xe9m.\n\nRezar 1 Pai-Nosso e 1 Ave-Maria em honra \xe0 Sant\xedssima Trindade.\n\n(Rezar Ora\xe7\xe3o Final)","Oh, Esp\xedrito Santo, caridade essencial, que difundiu Vossos divinos dons nos cora\xe7\xf5es humanos, comunicando-lhes todas as divinas gra\xe7as, que se incluem em nossos sete dons, e compreendem tudo o quanto necessita a vida espiritual, pr\xf3pria de cada um, e a qual desejais que se comunique a todos os homens:\n\nOh, Caridade Sant\xedssima, infundi em meu cora\xe7\xe3o t\xe3o pobre de Vossos sete dons e com eles publique Vossas grandezas.\n\nOh, Deus misericordioso, V\xf3s que, antigamente, enchestes, neste dia, os peitos apost\xf3licos de vossa gra\xe7a, dai-nos Vossos divinos carismas, concedei-nos tempos tranquilos, confirmai as gra\xe7as que Vos temos pedido nesta novena.\n\nE a gra\xe7a que Vos pe\xe7o, nesta novena, seja para maior gl\xf3ria vossa e bem de minha alma. Am\xe9m.\n\nRezar 1 Pai-Nosso e 1 Ave-Maria em honra \xe0 Sant\xedssima Trindade.\n\n(Rezar Ora\xe7\xe3o Final)","Hoje, completaram-se os dias de Pentecostes. Aleluia! Hoje, reproduzem-se as felizes alegrias quando o Esp\xedrito Consolador baixou sobre Seus ap\xf3stolos. Aleluia!\n\nRaiou, hoje, o resplendor do divino fogo, repousou o Esp\xedrito Santo em forma de l\xednguas sobre eles. Aleluia! Hoje, concedeu-lhes palavras edificadoras, inflamou-os com Seu amor e os encheu de Seus inumer\xe1veis carismas. Aleluia! Aleluia! Foram todos cheios do Esp\xedrito Santo e come\xe7aram a falar em v\xe1rias l\xednguas. Aleluia!\n\nOh, Deus, que haveis instru\xeddo, neste dia, o cora\xe7\xe3o dos fi\xe9is com a ilustra\xe7\xe3o do Esp\xedrito Santo, dai-me a gra\xe7a de sentir retamente, com este mesmo Esp\xedrito, e aproveitar sempre de Sua consola\xe7\xe3o.\n\nPor Jesus Cristo Senhor Nosso, Seu Filho, que vive contigo e reina na unidade do mesmo Esp\xedrito Santo, Am\xe9m.\n\nRezar 1 Pai-Nosso e 1 Ave-Maria em honra \xe0 Sant\xedssima Trindade.\n\n(Rezar Ora\xe7\xe3o Final)","Vem, oh, Criador Esp\xedrito!\n\nNossas almas visitai, nosso peito, que V\xf3s criastes, enchei de gra\xe7a celestial, pois sois Par\xe1clito Esp\xedrito, dom do Pai celestial, fonte viva, sacrofogo, un\xe7\xe3o santa.\n\nEm Seus dons setiformes, tal promessa paternal, dedo eterno de Deus Pai, nossas l\xednguas inflamai. Ilustrai nossos sentidos, o cora\xe7\xe3o inflamai, nossos corpos, que s\xe3o fracos, com vossa virtude armai.\n\nApartai os inimigos, dai-nos a divina paz e sendo Vos nosso guia livrai-nos de toda maldade.\n\nPor Vos ao Pai e ao Filho, nesta vida mortal convocamos, e cremos sempre em tua Divindade.\n\nA Deus Pai seja gl\xf3ria, ao filho gl\xf3ria imortal e ao Esp\xedrito Par\xe1clito por toda a eternidade. Am\xe9m.",null)
B.PR=new A.f2("Grande Confessor e Doutor da Igreja, Santo Ant\xf4nio: confiando na vossa incompar\xe1vel bondade, e no grande poder de intercess\xe3o que tendes junto de Deus, a v\xf3s me dirijo nesta novena, que vos ofere\xe7o. V\xf3s que sempre tivestes compaix\xe3o dos necessitados e dos que sofrem, voltai para mim o vosso olhar de bondade, e alcan\xe7ai-me a gra\xe7a que vos pe\xe7o. (Diz-se a gra\xe7a que se pede na novena). Fazei que durante estes dias, que vos consagro, eu aprenda de v\xf3s a amar melhor a Deus e ao pr\xf3ximo. Por Jesus Cristo Nosso Senhor. Am\xe9m.","A vida do Santo Taumaturgo \xe9 uma cont\xednua prega\xe7\xe3o da f\xe9 crist\xe3. Por ela, muito jovem, ansiava derramar seu sangue a vista dos m\xe1rtires franciscanos de Marrocos. Por ela se entrega completamente a Deus em vida santa e perfeit\xedssima de evangeliza\xe7\xe3o, que foi pasma do mundo, rica em talentos e maravilhas. Que vida de f\xe9 \xe9 a minha?\n\n3 Gl\xf3rias \xe0 Sant\xedssima Trindade; recitar o respons\xf3rio e a ora\xe7\xe3o final","Amou vivamente o Santo essa virtude. Uma vida de sacrif\xedcios, em luta constante contra o inferno, o mundo e as paix\xf5es, seria imposs\xedvel sem uma grande esperan\xe7a; tinha uma grande confian\xe7a na bondade divina, na paternal Provid\xeancia de Deus e na ajuda constante de sua gra\xe7a\u2026 Por isso o santo jamais desvaneceu em sua vida de incessante e penoso esfor\xe7o. Contava com Deus! Humilhemo-nos e contemos n\xe3o com nossas for\xe7as, mas sim com as for\xe7as divinas, esperando em Deus.\n\n3 Gl\xf3rias \xe0 Sant\xedssima Trindade; recitar o respons\xf3rio e a ora\xe7\xe3o final","Dedicou Santo Ant\xf4nio ao Serafim de Assis, S\xe3o Francisco, um particular amor. N\xe3o ignorava, sem d\xfavida, que, como bom filho seu era outro Serafim de caridade. Quem poder\xe1 adivinhar a ternura de seu amor a Jesus? Aquela cena em que o Menino Deus se recreava nos bra\xe7os do Santo pode servir para nos fazer adivinhar seus \xeaxtases, suas ternuras ser\xe1ficas\u2026 Que exemplo para mim, fio miser\xe1vel e pobre pecador.\n\n3 Gl\xf3rias \xe0 Sant\xedssima Trindade; recitar o respons\xf3rio e a ora\xe7\xe3o final","Eis me aqui, um Santo, cuja vida foi um holocausto de amor aos homens. Pode-se dizer que toda ela n\xe3o foi sen\xe3o uma car\xedcia aos pobres pecadores, aos tristes enfermos, aos atormentados pelas negruras da mis\xe9ria\u2026 e tanto prazer deveria encontrar o Santo neste amor fraterno a seus semelhantes, que nem a morte o interrompeu! Hoje, como em vida, segue prodigiando-nos com as mesmas car\xedcias\u2026 Que seu exemplo me mova \xe0 compaix\xe3o dos desgra\xe7ados!\n\n3 Gl\xf3rias \xe0 Sant\xedssima Trindade; recitar o respons\xf3rio e a ora\xe7\xe3o final","N\xe3o \xe9 em v\xe3o que leva o Santo em suas m\xe3os um l\xedrio\u2026 Foi ele uma a\xe7ucena da Igreja. O dem\xf4nio quis manchar seu corpo e sua alma com sua baba imunda, mas o Santo guardou sua pureza como um tesouro; a defendeu com um cinto austero e impenetr\xe1vel de sil\xedcios, vig\xedlias, disciplinas, ora\xe7\xf5es, trabalhos\u2026 Que fazemos n\xf3s para guardar a pureza de nosso corpo e da alma?\n\n3 Gl\xf3rias \xe0 Sant\xedssima Trindade; recitar o respons\xf3rio e a ora\xe7\xe3o final","Tamb\xe9m neste Santo, e por maneira singular e maravilhosa, se cumpriu o dito de jesus Cristo: \u201cO que se humilha ser\xe1 exaltado.\u201d Ocultou-se como uma violeta; buscou o retiro, o sil\xeancio e, dotado de alt\xedssima sabedoria, a teve oculta e somente a obedi\xeancia pode abrir com sua chave de outro aqueles talentos poderosos que fizeram de Santo Ant\xf4nio a Arca do Testamento\u2026 De quantos bens nos priva nossa soberba!\n\n3 Gl\xf3rias \xe0 Sant\xedssima Trindade; recitar o respons\xf3rio e a ora\xe7\xe3o final","Nascido em dourada cama, ante os sorrisos e riquezas do mundo, Santo Ant\xf4nio abra\xe7a a pobre Ordem Franciscana\u2026 Se torna filho daquele desposado com a dama Pobreza, S\xe3o francisco, e, como ele, a segue por abrolhos e espinhos, priva\xe7\xf5es e sofrimentos, contente com suas dolorosas e doces car\xedcias\u2026 Seu desapego do mundo o fez rico em bens celestiais. Trocou o ouro da terra pelo ouro inestim\xe1vel do amor divino. Desapeguemo-nos dos bens terrenos, se verdadeiramente queremos nos salvar!\n\n3 Gl\xf3rias \xe0 Sant\xedssima Trindade; recitar o respons\xf3rio e a ora\xe7\xe3o final","A obedi\xeancia \xe9 a morte da pr\xf3pria vontade, e quando o homem mat\xe1-la, tem matado o seu maior inimigo. A vontade divina, manifestada pelos leg\xedtimos Superiores, faz ent\xe3o maravilhas nas almas. Santo Ant\xf4nio foi obedient\xedssimo. Foi tanto obediente que a um ato seu de obedi\xeancia passava por um ignorante, mas devemos saber que era este um novo Doutor das gentes\u2026 Obedece, humilha vosso amor-pr\xf3prio e Deus te exaltar\xe1!\n\n3 Gl\xf3rias \xe0 Sant\xedssima Trindade; recitar o respons\xf3rio e a ora\xe7\xe3o final","Todo sofrimento, em qualquer de suas manifesta\xe7\xf5es, a dor do pecado, a perda da sa\xfade e a escassez de recursos, as injustas persegui\xe7\xf5es, a aus\xeancia de paz, as grandes preocupa\xe7\xf5es, as grandes tristezas\u2026 quanto podem atormentar a alma! Tudo foi motivo de compaix\xe3o para o santo, foi mat\xe9ria de milagres seus, foi motivo de sua miseric\xf3rdia\u2026 O que se ocultou ou oculta do seu cora\xe7\xe3o compassivo?  Acudamos, pois, a ele com viv\xedssima confian\xe7a.\n\n3 Gl\xf3rias \xe0 Sant\xedssima Trindade; recitar o respons\xf3rio e a ora\xe7\xe3o final","RESPONS\xd3RIO:\n\nSe milagres desejais, recorrei a Santo Ant\xf4nio, vereis fugir o dem\xf4nio e as tenta\xe7\xf5es infernais.\n\nRecupera-se o perdido, rompe-se a dura pris\xe3o e no auge do furac\xe3o cede o mar embravecido.\n\nTodos os males humanos se moderam, se retiram, digam-no aqueles que o viram, e digam-no os paduanos.\n\nRecupera-se o perdido\u2026 pela sua intercess\xe3o foge a peste, o erro, a morte, o fraco torna-se forte e torna-se o enfermo s\xe3o.\n\nGl\xf3ria ao Pai, e ao Filho e ao Esp\xedrito Santo\u2026\n\nV. Rogai por n\xf3s, bem-aventurado Ant\xf4nio,\nR. Para que sejamos dignos das promessas de Cristo.\n\nOremos:\n\n\xd3 Deus, n\xf3s vos suplicamos, que alegre \xe0 vossa Igreja a solenidade votiva do bem-aventurado Ant\xf4nio, vosso Confessor e Doutor, para que, fortalecida sempre com os espirituais aux\xedlios, mere\xe7a gozar os prazeres eternos. Por Jesus Cristo, Nosso Senhor. Am\xe9m.\n\nORA\xc7\xc3O FINAL DA NOVENA:\n\nAlegre, Senhor, a vossa Igreja devota a humilde ora\xe7\xe3o do glorioso Santo Ant\xf4nio, vosso servo, para que sejamos sempre socorridos nesta vida com os aux\xedlios da gra\xe7a e mere\xe7amos conseguir depois as alegrias eternas da gl\xf3ria. Por Nosso Senhor Jesus Cristo, que convosco e o Esp\xedrito Santo, vive e reina por todos os s\xe9culos dos s\xe9culos. Am\xe9m.",null)
B.PS=new A.f2("Meu Deus, eu me arrependo, de todo cora\xe7\xe3o de todos meus pecados e os detesto, porque pecando n\xe3o s\xf3 mereci as penas que justamente estabelecestes, mas principalmente porque Vos ofendi a V\xf3s, sumo bem e digno de ser amado sobre todas as coisas. Por isso, proponho firmemente, com a ajuda da vossa gra\xe7a, n\xe3o mais pecar e fugir das ocasi\xf5es pr\xf3ximas de pecar. Am\xe9m.","Viemos chamar de novo a aten\xe7\xe3o para o exemplo de Jesus que, durante trinta anos, permaneceu em Nazar\xe9 trabalhando, desempenhando um of\xedcio. Nas m\xe3os de Jesus, o trabalho, e um trabalho profissional semelhante \xe0quele que desenvolvem milh\xf5es de homens no mundo, converte-se em tarefa divina, em trabalho redentor, em caminho de salva\xe7\xe3o (Quest\xf5es atuais do Cristianismo, n. 55).\n\nA\xed ande est\xe3o os nossos irm\xe3os, os homens, a\xed onde est\xe3o as nossas aspira\xe7\xf5es, o nosso trabalho, os nossos amores, a\xed est\xe1 o lugar do nosso encontro cotidiano com Cristo. Deus nos espera cada dia: no laborat\xf3rio, na sala de opera\xe7\xf5es de um hospital, no quartel, na c\xe1tedra universit\xe1ria, na f\xe1brica, na oficina, no campo, no seio do lar e em todo o imenso panorama do trabalho (Homilia: Amar o mundo apaixonadamente).\n\nA \u2013 para encontrar trabalho.\nB \u2013 para fazer um bom trabalho.\n\nA \u2013 Para que Deus Nosso Senhor me oriente no esfor\xe7o de procurar trabalho, e me aben\xe7oe fazendo-me conseguir um emprego honesto, digno e est\xe1vel; e que me ajude, depois, a olhar para a minha tarefa profissional como um caminho de santifica\xe7\xe3o e de servi\xe7o aos outros, onde o meu Pai Deus me espera a toda a hora e me pede que imite Jesus quando trabalhava como carpinteiro em Nazar\xe9.\n\nB \u2013 Para que Deus Nosso Senhor me ajude a olhar para a minha tarefa profissional como um caminho de santifica\xe7\xe3o e de servi\xe7o aos outros, onde Ele me espera a toda a hora e me pede, em todas as circunst\xe2ncias, que imite Jesus quando trabalhava como carpinteiro em Nazar\xe9.\n\nOra\xe7\xe3o Final.","A dignidade do trabalho se baseia no Amor. O grande privil\xe9gio do homem \xe9 poder amar, transcendendo assim o ef\xeamero e transit\xf3rio (\xc9 Cristo que passa, n. 48).\n\nFazei tudo por Amor. \u2013 Assim n\xe3o h\xe1 coisas pequenas: tudo \xe9 grande. \u2013 A perseveran\xe7a nas pequenas coisas, por Amor, \xe9 hero\xedsmo (Caminho, n. 813).\n\n Na simplicidade do teu trabalho habitual, nos detalhes mon\xf3tonos de cada dia, tens que descobrir o segredo \u2013 para tantos escondido \u2013 da grandeza e da novidade: o Amor (Sulco, n. 489).\n\nA \u2013 para encontrar trabalho.\nB \u2013 para fazer um bom trabalho.\n\nA \u2013 Para que Deus me conceda a gra\xe7a de conseguir logo um trabalho, que proporcione seguran\xe7a \xe0 minha fam\xedlia. E para que, ao mesmo tempo, Ele me ajude a compreender que o que d\xe1 valor a qualquer trabalho honesto \xe9 o amor com que o fazemos: em primeiro lugar, amor a Deus, a quem oferecemos o trabalho; e amor ao pr\xf3ximo, a quem queremos servir e ser \xfateis.\n\nB \u2013 Para que Deus me ajude a compreender que o que d\xe1 valor a qualquer trabalho honesto \xe9 o amor com que o fazemos: em primeiro lugar, amor a Deus, a quem oferecemos o trabalho; e amor ao pr\xf3ximo, a quem queremos servir e ser \xfateis.\n\nOra\xe7\xe3o Final.","Como \xe9 breve a dura\xe7\xe3o da nossa passagem pela terra! ... Verdadeiramente \xe9 curto o nosso tempo para amar, para dar, para desagravar. N\xe3o \xe9 justo, portanto, que o malbaratemos... N\xe3o podemos desperdi\xe7ar esta etapa do mundo que Deus confia a cada um de n\xf3s (Amigos de Deus, n. 39).\n\nQuando tiveres ordem, multiplicar-se-\xe1 o teu tempo e, portanto, poder\xe1s dar mais gl\xf3ria a Deus, trabalhando mais a seu servi\xe7o (Caminho, n. 80).\n\nA \u2013 para encontrar trabalho.\nB \u2013 para fazer um bom trabalho.\n\nA \u2013 Para que com o aux\xedlio de Maria Sant\xedssima, consiga um trabalho est\xe1vel e apropriado. E que quando \u2013 por bondade de Deus \u2013 j\xe1 estiver trabalhando, saiba aproveitar o tempo como um tesouro que \xe9; e me esmere em aprimorar a virtude da ordem, de modo que consiga fazer tudo com pontualidade, intensidade e const\xe2ncia, sem confus\xf5es nem atrasos, seguindo um plano bem estruturado, que me permita dedicar de modo equilibrado, os hor\xe1rios convenientes a cada um dos meus deveres: vida espiritual, fam\xedlia, profiss\xe3o e rela\xe7\xf5es sociais.\n\n B \u2013 Para que com o aux\xedlio de Maria Sant\xedssima, saiba aproveitar o tempo como um tesouro que \xe9; e que me esmere em aprimorar a virtude da ordem de modo que consiga fazer tudo com pontualidade intensidade e const\xe2ncia, sem confus\xf5es nem atrasos, seguindo um plano bem estruturado, que me permita dedicar, de modo equilibrado, os hor\xe1rios convenientes a cada um dos meus deveres: vida espiritual, fam\xedlia, profiss\xe3o e rela\xe7\xf5es sociais.\n\nOra\xe7\xe3o Final.","N\xe3o podemos oferecer ao Senhor uma coisa que, dentro das pobres limita\xe7\xf5es humanas, n\xe3o seja perfeita, sem mancha, realizada com aten\xe7\xe3o at\xe9 nos m\xednimos detalhes: Deus n\xe3o aceita trabalhos \u201cmarretados\u201d. Por isso o trabalho de cada qual \u2013 essa atividade que ocupa as nossas jornadas e energias \u2013 h\xe1 de ser uma oferenda digna aos olhos do Criador; numa palavra, uma tarefa acabada, impec\xe1vel (Amigos de Deus, n. 55).\n\nAntes de mais, devemos amar a Santa Missa, que tem que ser o centro do nosso dia. Se a vivermos bem, como n\xe3o havemos de continuar depois com o pensamento no Senhor, para trabalhar como Ele trabalhava e amar como Ele amava? (\xc9 Cristo que passa, n. 154).\n\nA \u2013 para encontrar trabalho.\nB \u2013 para fazer um bom trabalho.\n\nA \u2013 Para que, com o aux\xedlio de Nossa Senhora, n\xe3o demore a resolver-se o problema do meu desemprego. E para que, ao iniciar o novo trabalho, Deus me ajude a colocar todo o empenho em realiz\xe1-lo com categoria, com a maior perfei\xe7\xe3o poss\xedvel, sem fazer as tarefas de qualquer maneira \u2013 convencido de que um trabalho mal feito n\xe3o pode ser santificado, porque lhe falta amor, que \xe9 a condi\xe7\xe3o imprescind\xedvel para que qualquer atividade humana possa ser agrad\xe1vel a Deus.\n\n B \u2013 Para que Deus me ajude a colocar todo o empenho em realizar o meu trabalho com categoria, com a maior perfei\xe7\xe3o poss\xedvel, sem fazer as tarefas de qualquer maneira \u2013 convencido de que um trabalho mal feito n\xe3o pode ser santificado, porque lhe falta amor, que \xe9 a condi\xe7\xe3o imprescind\xedvel para que qualquer atividade humana possa ser agrad\xe1vel a Deus.\n\nOra\xe7\xe3o Final.","\xc9 hora de que todos n\xf3s, crist\xe3os, anunciemos bem alto que o trabalho \xe9 um dom de Deus, e que n\xe3o faz nenhum sentido dividir os homens em diferentes categorias, conforme os tipos de trabalho, considerando umas ocupa\xe7\xf5es mais nobres do que as outras. O trabalho, todo trabalho, \xe9 testemunho da dignidade do homem (\xc9 Cristo que passa, n. 47).\n\n Diante de Deus, nenhuma ocupa\xe7\xe3o \xe9 em si grande ou pequena. Tudo adquire o valor do Amor com que se realiza (Sulco, n. 487).\n\nA \u2013 para encontrar trabalho.\nB \u2013 para fazer um bom trabalho.\n\nA \u2013 Para que Deus me conceda a alegria de conseguir trabalho, uma tarefa em que eu possa ser \xfatil e desenvolver as minhas capacidades. E que se, no momento, esse trabalho estiver por baixo do meu preparo e das minhas leg\xedtimas aspira\xe7\xf5es, eu n\xe3o o despreze, mas \u2013 enquanto n\xe3o achar um trabalho mais apropriado \u2013 o realize com toda a responsabilidade, fazendo com que tenha a categoria do trabalho que Jesus realizou na oficina de Nazar\xe9.\n\nB \u2013 Para que se, atualmente, o meu trabalho est\xe1 por baixo do meu preparo e das minhas leg\xedtimas aspira\xe7\xf5es, Deus me ajude a n\xe3o desprez\xe1-lo, mas \u2013 enquanto n\xe3o achar um trabalho mais apropriado \u2013 a realiz\xe1-lo com toda a responsabilidade, fazendo com que tenha a categoria do trabalho que Jesus realizou na oficina de Nazar\xe9.\n\nOra\xe7\xe3o Final.","Deves manter \u2013 ao longo do dia \u2013 uma constante conversa com o Senhor, que se alimente tamb\xe9m das pr\xf3prias incid\xeancias da tua tarefa profissional (Forja, n. 745).\n\nComo crist\xe3o, deverias trazer sempre contigo o teu Crucifixo, E coloc\xe1-lo sobre a tua mesa de trabalho. E beij\xe1-lo antes de te entregares ao descanso e ao acordar (Caminho, n. 302).\n\nColoca na tua mesa de trabalho, no teu quarto, na tua carteira..., uma imagem de Nossa Senhora, e dirige-lhe o olhar ao come\xe7ares a tua tarefa, enquanto a realizas e ao termin\xe1-la. Ela te alcan\xe7ar\xe1 \u2013 garanto! \u2013 a for\xe7a necess\xe1ria para fazeres, da tua ocupa\xe7\xe3o, um di\xe1logo amoroso com Deus (Sulco, n. 531).\n\nA \u2013 para encontrar trabalho.\nB \u2013 para fazer um bom trabalho.\n\nA \u2013 Para que Deus me conceda um emprego honesto e digno, e me abra os olhos da alma para compreender que Ele est\xe1 sempre ao meu lado. Que, para n\xe3o perder de vista esta maravilhosa realidade, eu me esforce em ter presen\xe7a de Deus durante o trabalho, servindo-me discretamente \u2013 como de um \u201clembrete\u201d \u2013 de um pequeno crucifixo, de uma estampa de Nossa Senhora, da ef\xedgie de outro santo da minha devo\xe7\xe3o...; \u201clembretes\u201d colocadas onde eu os possa ver com frequ\xeancia, sem exibicionismo nem alarde.\n\nB \u2013 Para que Deus me fa\xe7a compreender que Ele est\xe1 sempre ao meu lado, enquanto estou trabalhando. E que, para n\xe3o perder de vista esta maravilhosa realidade, eu me esforce em ter presen\xe7a de Deus durante o trabalho, servindo-me discretamente \u2013 como de um \u201clembrete\u201d \u2013 de um pequeno crucifixo, de uma estampa de Nossa Senhora, da ef\xedgie de outro santo da minha devo\xe7\xe3o...; \u201clembretes\u201d colocados onde eu os possa ver com frequ\xeancia, sem exibicionismo nem alarde.\n\nOra\xe7\xe3o Final.","Tudo aquilo em que intervimos os pobrezinhos dos homens \u2013 mesmo a santidade \u2013 \xe9 um tecido de pequenas insignific\xe2ncias que, conforme a inten\xe7\xe3o com que se fazem, podem formar uma tape\xe7aria espl\xeandida de hero\xedsmo ou de baixeza, de virtudes ou de pecados (Caminho, n. 826).\n\n\xc9 toda uma trama de virtudes que se p\xf5e em jogo quando exercemos o nosso of\xedcio com o prop\xf3sito de santific\xe1-lo: a fortaleza, para perseverarmos no trabalho, apesar das naturais dificuldades; a temperan\xe7a, para superarmos o comodismo e o ego\xedsmo; a justi\xe7a, para cumprirmos os nossos deveres para com Deus, para com a sociedade, para com a fam\xedlia, para com os colegas; a prud\xeancia, para sabermos em cada caso o que conv\xe9m fazer e nos lan\xe7armos \xe0 obra sem dila\xe7\xf5es... E tudo por Amor... (Amigos de Deus, n. 72).\n\nA \u2013 para encontrar trabalho.\nB \u2013 para fazer um bom trabalho.\n\nA \u2013 Para que, com a ajuda de Nossa Senhora, ache o trabalho que venho procurando. E que, ao meter-me em cheio nesse novo trabalho, Deus me ajude a desenvolver por meio dele as virtudes crist\xe3s e a amadurecer espiritualmente. Que eu procure ser paciente e compreensivo, tanto com os chefes como com os colegas e subordinados, que seja simples e humilde, fugindo da vaidade e do exibicionismo, que fa\xe7a tudo, em suma, com pureza de cora\xe7\xe3o.\n\nB \u2013 Para que Deus me ajude a desenvolver por meio do trabalho as virtudes crist\xe3s e a amadurecer espiritualmente. Que eu procure ser paciente e compreensivo, tanto com os chefes como com os colegas e subordinados, que seja simples e humilde, fugindo da vaidade e do exibicionismo, que fa\xe7a tudo, em suma, com pureza de cora\xe7\xe3o.\n\nOra\xe7\xe3o Final.","Pensai que atrav\xe9s dos vossos afazeres profissionais, realizados com esponsabilidade, al\xe9m de vos sustentardes economicamente, prestais um servi\xe7o diret\xedssimo ao desenvolvimento da sociedade, aliviais tamb\xe9m as cargas dos outros e mantendes muitas obras assistenciais \u2013 em n\xedvel local e universal \u2013 em prol dos indiv\xedduos e dos povos menos favorecidos (Amigos de Deus, n. 120).\n\nQuando tiveres terminado o teu trabalho, faz o do teu irm\xe3o, ajudando-o, por Cristo, com tal delicadeza e naturalidade, que nem mesmo o favorecido repare que est\xe1s fazendo mais do que em justi\xe7a deves. \u2013 Isto, sim, \xe9 fina virtude de filho de Deus! (Caminho, n. 440).\n\nA \u2013 para encontrar trabalho.\nB \u2013 para fazer um bom trabalho.\n\nA \u2013 Para que Deus Nosso Senhor me conceda o trabalho que lhe pe\xe7o com tanta f\xe9. E para que infunda na minha alma o desejo de fazer do meu trabalho, n\xe3o uma atividade ego\xedsta, fechada nos meus interesses, mas um servi\xe7o aberto ao bem e \xe0 utilidade de muitos, realizado com a certeza de que esse ideal de servi\xe7o aos outros dar\xe1 um novo sentido, mais elevado e alegre, \xe0 minha vida.\n\nB \u2013 Para que Deus infunda na minha alma o desejo de fazer do meu trabalho, n\xe3o uma atividade ego\xedsta, fechada nos meus interesses, mas um servi\xe7o aberto ao bem e \xe0 utilidade de muitos, realizado com a certeza de que esse ideal de servi\xe7o aos outros dar\xe1 um novo sentido, mais elevado e alegre, \xe0 minha vida.\n\nOra\xe7\xe3o Final.","O trabalho profissional \xe9 tamb\xe9m apostolado, ocasi\xe3o de entrega aos outros homens; o momento de Lhes revelar Cristo e lev\xe1-los a Deus Pai (\xc9 Cristo que passa, n. 49).\n\nFaze a tua vida normal; trabalha onde est\xe1s, procurando cumprir os deveres do teu estado, acabar bem as tarefas da tua profiss\xe3o ou do teu oficio, superando-te, melhorando dia a dia. S\xea leal, compreensivo com os outros e exigente contigo mesmo. S\xea mortificado e alegre. Esse ser\xe1 o teu apostolado. E, sem saberes por qu\xea, dada a tua pobre mis\xe9ria, os que te rodeiam vir\xe3o ter contigo e, numa conversa natural, simples \u2013 \xe0 sa\xedda do trabalho, numa reuni\xe3o familiar, no \xf4nibus, ao dar um passeio em qualquer parte \u2013, falareis de inquieta\xe7\xf5es que existem na alma de todos, embora \xe0s vezes alguns n\xe3o as queiram reconhecer: ir\xe3o entendendo-as melhor quando come\xe7arem a procurar Deus a s\xe9rio (Amigos de Deus, n. 273).\n\nA \u2013 para encontrar trabalho.\nB \u2013 para fazer um bom trabalho.\n\nA \u2013 Para que Deus, por media\xe7\xe3o de Nossa Senhora, me fa\xe7a encontrar um bom trabalho, no qual possa crescer profissionalmente e dar o melhor de mim mesmo. E que me ajude a ver, no meu ambiente profissional, um campo aberto para a realiza\xe7\xe3o da miss\xe3o apost\xf3lica que Deus confia a todos os batizados, aproveitando as oportunidades que Ele me d\xe1 para ajudar colegas, amigos, colaboradores, clientes..., a descobrirem as maravilhas da f\xe9 crist\xe3. B \u2013 Para que Deus me ajude a ver, no meu ambiente de trabalho, um campo aberto para a realiza\xe7\xe3o da miss\xe3o apost\xf3lica que Deus confia a todos os batizados, aproveitando as oportunidades que Ele me d\xe1 para ajudar colegas, amigos, colaboradores, clientes..., a descobrirem as maravilhas da f\xe9 crist\xe3.\n\nOra\xe7\xe3o Final.","Ora\xe7\xe3o a S\xe3o Josemaria Escriv\xe1:\n\n\xd3 Deus, que por media\xe7\xe3o da Sant\xedssima Virgem Maria, concedestes inumer\xe1veis gra\xe7as a S\xe3o Josemaria, sacerdote, escolhendo-o como instrumento fidel\xedssimo para fundar o Opus Dei, caminho de santifica\xe7\xe3o no trabalho profissional e no cumprimento dos deveres cotidianos do crist\xe3o, fazei que eu saiba tamb\xe9m converter todos os momentos e circunst\xe2ncias da minha vida em ocasi\xe3o de Vos amar, e de servir com alegria e com simplicidade a Igreja, o Romano Pont\xedfice e as almas, iluminando os caminhos da terra com o resplendor da f\xe9 e do amor. Concedei-me por intercess\xe3o de S\xe3o Josemaria o favor que vos pe\xe7o... (pe\xe7a-se) Am\xe9m.\n\nPai-nosso, Ave-Maria, Gl\xf3ria.",null)
B.PT=new A.f2("Rezar 1 Pai-Nosso, 10 Ave-Marias e 1 Gl\xf3ria ao Pai","\xd3 admir\xe1vel Santa Rita de C\xe1ssia, tu que nasceste quando teus pais j\xe1 estavam avan\xe7ados em idade, nutriste por eles um carinho todo especial. Ensina-nos sempre mais amar a todos os idosos que vivem em nossos lares e em nossas comunidades. Que tenhamos paci\xeancia para com eles e as condi\xe7\xf5es para am\xe1-los como imagem de Jesus a quem tanto amaste.","\xd3 admir\xe1vel Santa Rita de C\xe1ssia, nutriste, desde cedo, um profundo amor \xe0 ora\xe7\xe3o e \xe0 solid\xe3o com Deus, ajuda-nos a descobrir nossa voca\xe7\xe3o de orantes em um mundo que esquece de orar. Que possamos rezar pelos que n\xe3o sabem rezar, pelos que n\xe3o podem rezar e pelos que n\xe3o querem rezar.","\xd3 admir\xe1vel Santa Rita de C\xe1ssia, mesmo em meio aos mais duros sofrimentos que passaste em teu matrim\xf4nio, n\xe3o desanimaste e oraste incessantemente pela convers\xe3o do teu esposo. Ensina aos casais de hoje teu jeito singelo de ser fiel na alegria ou na tristeza, na sa\xfade ou na doen\xe7a, no amor, no respeito e na fidelidade.","\xd3 admir\xe1vel Santa Rita de C\xe1ssia, foste paciente e carinhosa para com teus dois filhos, que queriam vingar a morte do pai. Ensina aos pais de hoje a ter um cora\xe7\xe3o sempre aberto, preocupado e carinhoso para com seus filhos, a exemplo do pai do filho pr\xf3digo, a quem imitaste em tua vida.","\xd3 admir\xe1vel Santa Rita de C\xe1ssia, nutriste como ningu\xe9m um amor total \xe0 vida consagrada e religiosa. Mostra a muitos jovens de hoje o caminho para descobrir o verdadeiro amor desinteressado e total a Deus e aos irm\xe3os. Intercede para que surjam muitas e santas voca\xe7\xf5es sacerdotais e religiosas.","\xd3 admir\xe1vel Santa Rita de C\xe1ssia, descobriste, na f\xe9 e na penit\xeancia, uma forma misteriosa de amar secretamente a Deus, a quem escolheste seguir. Ajuda-nos tamb\xe9m a descobrir a penit\xeancia como um valor evang\xe9lico de convers\xe3o pessoal e desprendimento de todas as formas de ego\xedsmo.","\xd3 admir\xe1vel Santa Rita de C\xe1ssia, como ningu\xe9m obedeceste aos teus superiores religiosos por ver nessa obedi\xeancia um valor evang\xe9lico, um amor de quem tudo entrega por um amor sempre maior. Ensina aos crist\xe3os de nossos dias a verdadeira caridade m\xfatua, que faz com que toda forma de obedi\xeancia n\xe3o seja mais que um modo de servir aos irm\xe3os.","\xd3 admir\xe1vel Santa Rita de C\xe1ssia, descobriste no amor de Jesus crucificado um caminho para amar tamb\xe9m o sofrimento. Ensina-nos a carregar nossas cruzes quando elas surgirem, sem desanimar nem desesperar. Mostra-nos tamb\xe9m o calor redentor de todo sofrimento aceito por amor a Jesus, que, nada mais tendo a oferecer, deu-nos Sua pr\xf3pria vida.","\xd3 admir\xe1vel Santa Rita de C\xe1ssia, em virtude dos prod\xedgios que conseguiste de Deus, foste escolhida como padroeira de todas as causas imposs\xedveis. Ajuda-nos a sempre mais confiar no milagre maravilhoso do amor que faz o maior de todos os prod\xedgios sobre a terra: a convers\xe3o de todos os cora\xe7\xf5es para Deus.","Deus Pai de bondade, V\xf3s nos dais o exemplo dos santos para que, imitando-os na terra, possamos chegar, um dia, \xe0s alegrias do c\xe9u. Dai-me, pe\xe7o-Vos, por intercess\xe3o de Santa Rita de C\xe1ssia, padroeira dos casos desesperados e imposs\xedveis, que tanto Vos amou nesta vida, as gra\xe7as que t\xe3o ardentemente Vos suplico.",null)
B.PU=new A.f2("\xd3, Jesus, meu Senhor! Qu\xe3o grande foi a minha cegueira, porque depois de me revelar a exist\xeancia de um inferno eterno eu n\xe3o tive medo da Tua Justi\xe7a. Abomin\xe1vel foi a minha loucura, porque ciente dos males do Pecado, tive coragem de comet\xea-lo, vivendo sem dar aten\xe7\xe3o ao Seu Amor infinito. Ainda que eu mere\xe7a o Seu julgamento, Senhor, a Sua Miseric\xf3rdia \xe9 maior do que a minha mal\xedcia; Sua bondade venceu a minha iniquidade, e eu me entrego ao Seu Amor, que me resgatou quando eu fugi de V\xf3s. Agora, arrependido(a), eu me lan\xe7o aos Teus p\xe9s, \xf3 Doce Jesus!Com todo o meu cora\xe7\xe3o eu odeio, detesto, abomino o Pecado! Por amor a Ti, meu Salvador, a quem agrade\xe7o e pe\xe7o para que me acompanhe por toda a Eternidade. Am\xe9m.\n\nNossa Senhora de Guadalupe,\nM\xe3e de Deus e Imperatriz da Am\xe9rica,\naos Seus p\xe9s e diante de Seu infinito Amor,\nacolhidos em Seu Santu\xe1rio,\nrogamos pela Sua interse\xe7\xe3o\ne presen\xe7a em nossa vida.\n\nEstende Seu Manto Sagrado sobre n\xf3s,\nguiando nossas condutas e decis\xf5es\npara que jamais sejamos afetados\npelos males do Pecado;\n\nConduz os fi\xe9is na dire\xe7\xe3o do Amor, da Fraternidade e do Respeito;\nGuia a Igreja e todos os Seus filhos que suplicam pela Paz e a Unidade\nao caminho da Miseric\xf3rdia e da Luz que n\xe3o se apaga.\nTudo isso vos pedimos, M\xe3e Sant\xedssima de Guadalupe,\ncom esperan\xe7a e confian\xe7a no Seu aux\xedlio.\n\nRogai por n\xf3s, doce Virgem Imaculada, para que sejamos dignos das promessas de Cristo","\xd3 Deus, Pai Misericordioso que Reina no C\xe9u e na Terra, quando eu olho para o Trono da Tua Grandeza, posso V\xea-lo coroar Nossa Senhora, a Maior de todas as criaturas depois de Ti. M\xe3e de Deus e tamb\xe9m minha M\xe3e.\n\nMostraste a partir do Monte Tepeyac o qu\xe3o amorosa \xe9 a M\xe3e que temos, ensinando-nos a am\xe1-la, rogando pela Sua prote\xe7\xe3o.\nMais que isso, fizeste-nos enxergar Seu sofrimento ao testemunhar a dor atroz de Jesus na Cruz, em agonia de morte. Instru\xedste-nos a olh\xe1-La como M\xe3e, ainda que n\xe3o merec\xeassemos. Revelaste a n\xf3s o Seu Amor materno, compassivo e misericordioso, defensor de todos os pecadores.\n\nPai Nosso, Ave-Maria e Gl\xf3ria.","\xd3 Deus, Pai Misericordioso que Reina no C\xe9u e na Terra e que nos apresentaste \xe0 Virgem de Guadalupe, cremos e acolhemos Nossa Senhora como Advogada dos pecadores diante de Seu Julgamento.\n\nEla que, com Suas ador\xe1veis m\xe3os, n\xe3o cessa de nos aben\xe7oar, orando e intercedendo a nosso favor.\nToda a honra e toda a gl\xf3ria sejam dadas \xe0 Rainha dos anjos e dos homens, a quem agradecemos por abastecer nosso cora\xe7\xe3o com os preciosos dons da caridade, da humildade e da obedi\xeancia aos Teus Mandamentos.\n\nPai Nosso, Ave-Maria e Gl\xf3ria.","\xd3 Deus, Pai Misericordioso que Reina no C\xe9u e na Terra, revelaste-nos Nossa Senhora de Guadalupe, envolta pelos raios do sol, em Luz de Gra\xe7a e Santidade. Arrebataste nosso cora\xe7\xe3o, enchendo-nos de felicidade.\n\nReunidos, oramos em humilde agradecimento pela M\xe3e que nos deste e que nos ensina a Te amar al\xe9m de todas as coisas, bem como am\xe1-la e amar nossos irm\xe3os e irm\xe3s, os reconhecendo como filhos Teus.\n\nPai Nosso, Ave-Maria e Gl\xf3ria.","\xd3 Deus, Pai Misericordioso que Reina no C\xe9u e na Terra, iluminaste o nosso caminho e enriqueceste o nosso esp\xedrito revelando a Verdade sobre todas as coisas. Atrav\xe9s de Guadalupe, mostraste o poder e a gl\xf3ria da Virgem Sant\xedssima, a quem os pr\xf3prios anjos prestam rever\xeancia.\n\nPois o que devo eu, ent\xe3o, fazer para glorificar Nossa M\xe3e? J\xe1 n\xe3o ofere\xe7o a minha cabe\xe7a ou os meus bra\xe7os, mas entrego o meu cora\xe7\xe3o e a minha alma \xe0 Senhora de todos os povos, a fim de ser plantado(a) e regado(a) por Ela no jardim da Eternidade.\n\nPai Nosso, Ave-Maria e Gl\xf3ria.","\xd3 Deus, Pai Misericordioso que Reina no C\xe9u e na Terra, indicaste-nos o Manto Sagrado da Virgem de Guadalupe, incompar\xe1vel sob um dossel de estrelas; Combinaste a pureza com a humildade e reproduziste a mais bela de todas as m\xe3es, que nos mant\xe9m absortos diante de Seu Amor.\n\nMeus olhos e meu cora\xe7\xe3o fixam em Ti, Rainha do C\xe9u, que revelaste a todos os Seus filhos o poder da caridade e do amor a Deus.\n\nPai Nosso, Ave-Maria e Gl\xf3ria.","\xd3 Deus, Pai Misericordioso que Reina no C\xe9u e na Terra, permitiste que, por interm\xe9dio de Nossa Senhora de Guadalupe, encontr\xe1ssemos o caminho da Verdade e da Vida.\nEm nossa M\xe3e reconhecemos os Seus prop\xf3sitos e virtudes, renegando as vaidades deste mundo e os v\xedcios e instabilidades dos nossos atos.\n\nPai Nosso, Ave-Maria e Gl\xf3ria.","\xd3 Deus, Pai Misericordioso que Reina no C\xe9u e na Terra, abriste os nossos olhos para a perfei\xe7\xe3o de Nossa Senhora de Guadalupe que, humilde, apareceu a Juan Diego e n\xe3o desdenhou de sua pobre tilma, estampando nela o Seu rosto incompar\xe1vel.\n\nPedimos, pois, \xf3 Pai, para que atrav\xe9s da Virgem Imaculada, sustente-nos com Seu amor e ensine-nos a pr\xe1tica da caridade e da humildade.\n\nPai Nosso, Ave-Maria e Gl\xf3ria.","\xd3 Deus, Pai Misericordioso que Reina no C\xe9u e na Terra, caminhaste junto da Virgem de Guadalupe e concedeste a Ela um Manto Glorioso, enriquecido pela caridade presente em Sua b\xean\xe7\xe3o maternal.\n\nConcedei-nos a gra\xe7a de experimentar a compaix\xe3o da Imperatriz da Am\xe9rica, pr\xf3ximos de Seu cora\xe7\xe3o Imaculado, e permite-nos sentir a Miseric\xf3rdia e a Compaix\xe3o de Nossa M\xe3e.\n\nPai Nosso, Ave-Maria e Gl\xf3ria.","\xd3 Deus, Pai Misericordioso que Reina no C\xe9u e na Terra, deste a Nossa Senhora de Guadalupe todos os dons maternos para a prote\xe7\xe3o de Seus filhos. Agora, o que n\xe3o poder\xe1 ser alcan\xe7ado atrav\xe9s da interse\xe7\xe3o da Virgem Sant\xedssima?\n\nNenhum obst\xe1culo p\xf4de cessar a milagrosa apari\xe7\xe3o de Guadalupe. Tamb\xe9m assim, nada pode ofuscar o brilho de Nossa Senhora, M\xe3e de toda a humanidade e advogada dos pecadores!\n\nM\xe3e Sant\xedssima, vos pedimos: abre os Seus bra\xe7os maternais sobre n\xf3s e acolhe nossas s\xfaplicas; Mostra-nos Sua Compaix\xe3o infinita e conduz-nos ao Perd\xe3o e o Amor de Deus.\n\nPai Nosso, Ave-Maria e Gl\xf3ria.","Senhor meu Jesus Cristo, Deus e homem verdadeiro, criador e Redentor meu, por ser v\xf3s quem sois, e porque vos amo sobre todas as coisas, me pesa de todo cora\xe7\xe3o vos haver ofendido. Proponho emendar-me e confessar-me a seu tempo e ofere\xe7o tudo quanto fizer em satisfa\xe7\xe3o de meus pecados, e confio em vossa bondade e miseric\xf3rdia infinita, que me perdoeis e me d\xeas gra\xe7a para nunca mais pecar. Assim o espero por intercess\xe3o de minha m\xe3e, nossa Senhora Virgem de Guadalupe. Am\xe9m.\n\nFazer aqui o pedido que se deseja.\n\nRezar quatro Salves Rainhas em mem\xf3ria das quatro apari\xe7\xf5es e logo se reza a ora\xe7\xe3o correspondente a cada dia.",null)
B.PV=new A.f2("1- Fa\xe7a o sinal da cruz;\n\n2- Fa\xe7a o Ato de Contri\xe7\xe3o e reflita sobre seus pecados: \u201cMeu Deus, eu me arrependo, de todo o cora\xe7\xe3o, de vos Ter ofendido, porque sois t\xe3o bom e am\xe1vel. Prometo, com a ajuda da vossa gra\xe7a, nunca mais pecar. Meu Jesus, miseric\xf3rdia!\u201d\n\n3- Reze o Ter\xe7o (as tr\xeas primeiras dezenas);\n\n4- Fa\xe7a a medita\xe7\xe3o de cada dia da novena;\n\n5- Termine com a ora\xe7\xe3o final a cada dia da novena.","Santa M\xe3e querida, Maria sant\xedssima, que desata os n\xf3s que sufocam os teus filhos, estende tuas m\xe3os de miseric\xf3rdia para mim. Entrego-Te hoje este n\xf3 [colocar a inten\xe7\xe3o] e todas as consequ\xeancias negativas que ele provoca em minha vida. Dou-te este n\xf3, que me atormenta e me faz infeliz e tanto me impede de unir-me mais a ti e a teu Filho Jesus, meu Salvador. Recorro a ti, Maria Desatadora de N\xf3s, pois confio e sei que nunca desprezas o filho pecador que vem pedir-te aux\xedlio. Eu creio que tu podes desatar esse n\xf3 pois tudo te \xe9 concedido por Jesus. Eu creio que tu queres desatar o n\xf3 porque \xe9s minha M\xe3e. Eu creio que tu o far\xe1s porque me amas com eterno amor. Obrigado, M\xe3e querida.","Maria, M\xe3e amada, dispensadora de todas as gra\xe7as, volto a ti meu cora\xe7\xe3o, hoje, reconhecendo-me pecador e necessitado do teu aux\xedlio. Muitas vezes, chego a perder as gra\xe7as que me concedes por causa do meu pecado de ego\xedsmo, de orgulho, rancor e falta de generosidade e humildade. Recorro a ti, hoje, Maria Desatadora dos N\xf3s, a fim de pedir para mim a teu filho Jesus um cora\xe7\xe3o puro, despojado, humilde e confiante. Viverei o dia de hoje praticando essas virtudes e ofertarei como sinal do meu amor por ti. Entrego em tuas m\xe3os este n\xf3 [colocar a inten\xe7\xe3o], que me impede de refletir a gl\xf3ria de Deus.","M\xe3e Medianeira, Rainha do C\xe9u, em cujas m\xe3os se encontram as riquezas do Rei, volta os teus olhos misericordiosos para mim hoje. Confio nas tuas m\xe3os santas este n\xf3 da minha vida, e todo o rancor, o ressentimento que ele me causa. Pe\xe7o-te perd\xe3o, e a Deus Pai, pelo meu pecado. Ajuda-me, agora, a perdoar todas as pessoas que, consciente ou inconscientemente, provocaram esse n\xf3. D\xe1-me tamb\xe9m a gra\xe7a de perdoar a mim mesmo por ter provocado esse n\xf3. S\xf3 assim poder\xe1s desat\xe1-lo. Diante de ti, M\xe3e querida, e em nome de teu Filho Jesus, meu Salvador, a quem tantas ofensas foram feitas, tendo sido concedido o perd\xe3o, eu perd\xf4o agora essas pessoas e perdoo a mim mesmo para sempre. Obrigado, Maria Desatadora dos N\xf3s, por desatar o n\xf3 do rancor em meu cora\xe7\xe3o e o n\xf3 que agora te apresento. Am\xe9m.","Santa M\xe3e querida, generosa para com todos os que te procuram, tem piedade de mim. Confio em tuas m\xe3os este n\xf3 que rouba a paz do meu cora\xe7\xe3o, que paralisa a minha alma e impede-me de caminhar at\xe9 o meu Senhor e servi-lo com a minha vida. Desata este n\xf3 da minha vida, M\xe3e, e pede a Jesus pela cura da minha f\xe9 paral\xedtica, que se deixa abater pelas pedras do caminho. Caminhando contigo, M\xe3e querida, que eu veja essas pedras como amigas, que eu n\xe3o murmure mais e aprenda a dar gra\xe7as sem cessar e sorrir confiante no teu poder.","M\xe3e Desatadora dos N\xf3s, generosa e compassiva, venho a Ti, hoje, para renovar a entrega deste n\xf3 [colocar a inten\xe7\xe3o] em minha vida e te pedir a sabedoria divina para agir sob a luz do Esp\xedrito Santo neste emaranhado de problemas. Nunca ningu\xe9m te viu irada. Ao contr\xe1rio, t\xe3o repassada de do\xe7uras eram tuas palavras, que se reconhecia o Esp\xedrito Santo em tua boca. Tira de mim a amargura, a c\xf3lera, o \xf3dio que esse n\xf3 me causou. D\xe1-me, \xf3 M\xe3e querida, da tua do\xe7ura, da tua sabedoria, refletindo tudo em sil\xeancio, no cora\xe7\xe3o. E como estiveste em Pentecostes, roga a Jesus para que eu receba um novo sopro do Esp\xedrito Santo neste momento em minha vida. Esp\xedrito Santo, vem sobre mim!","Rainha de Miseric\xf3rdia, confio a ti este n\xf3 da minha vida e rogo-te dar-me um cora\xe7\xe3o de espera enquanto o desatas. Ensina-me a perseverar na palavra viva de Jesus, na Eucaristia, no sacramento da confiss\xe3o. Enfim, fica comigo e prepara o meu cora\xe7\xe3o para festejar com os anjos esta gra\xe7a a mim j\xe1 concedida. Am\xe9m. Aleluia!","M\xe3e Pur\xedssima, venho a ti, hoje, para suplicar que desates este n\xf3 da minha vida e me livres das ciladas do Mal. Deus te concedeu grande poder sobre todos os dem\xf4nios. Renuncio a todos eles, hoje, a toda liga\xe7\xe3o que tive com eles e proclamo Jesus como meu \xfanico Senhor e Salvador. Maria Desatadora dos N\xf3s, esmaga a cabe\xe7a do maligno na minha vida e destr\xf3i as armadilhas que eles me fizeram provocando esse n\xf3. Obrigado, M\xe3e querida. Sangue Precios\xedssimo de Jesus, liberta-me!","Virgem M\xe3e de Deus, rica em miseric\xf3rdia, tem piedade de teu filho e desata este n\xf3 na minha vida. Preciso de tua visita em minha vida, como visitaste Isabel. Traz-me Jesus, traz-me o Esp\xedrito Santo. Ensina-me a praticar as virtudes da coragem, da alegria, da humildade, da f\xe9, e como Isabel, ficar cheio do Esp\xedrito Santo. Faz-me estremecer de alegria em teu seio, Maria. Consagro-te como minha M\xe3e, minha Rainha, minha amiga. Dou-te o meu cora\xe7\xe3o e tudo o que me pertence (minha casa, minha fam\xedlia, meus bens exteriores e interiores). Sou teu para sempre. Coloca em mim o teu cora\xe7\xe3o, para que eu possa fazer tudo o que Jesus me disser.","Maria Sant\xedssima, advogada nossa, Desatadora dos N\xf3s, venho hoje para agradecer-te por desatares este n\xf3 na minha vida. Tu bem conheces os sofrimentos que ele me causa. Obrigado por vires, M\xe3e, com teus longos dedos de miseric\xf3rdia, secar as l\xe1grimas dos meus olhos, acolher-me em teus bra\xe7os e me fazeres recebedor de mais uma gra\xe7a divina.\n\nMaria Desatadora dos N\xf3s, M\xe3e querida, a ti agrade\xe7o por desatares os n\xf3s da minha vida. Cobre-me com teu manto de amor, guarda-me na tua prote\xe7\xe3o, ilumina-me com tua paz! Am\xe9m.","Santa Maria M\xe3e de Deus, Tu que, como mulher e m\xe3e, respondeste a Deus: \u201cQue se fa\xe7a a Tua vontade\u201d, contagie-nos dessa for\xe7a, a for\xe7a da Tua F\xe9 e de Teu Amor.\n\nMaria, eu venho a Ti, cheia de dor, chorando meu sofrimento nos bra\xe7os de uma M\xe3e que sempre escuta, que tudo suporta, que tudo cr\xea.\n\nCreia, minha M\xe3e, creia em minha dor e em minhas ang\xfastias; o que n\xe3o faria uma m\xe3e por seu filho; o que n\xe3o farias Tu, Maria, minha M\xe3e, para mim?\n\nEu te pe\xe7o somente para me escutares, que minhas s\xfaplicas cheguem a Ti, e Tu as leve at\xe9 o Filho Bem Amado e que intercedas por mim. Que eu tamb\xe9m possa dizer: \u201cSim, Senhor, que se fa\xe7a a Tua vontade\u201d. D\xe1-me, Maria, a capacidade de aceitar os des\xedgnios que o Senhor tem para comigo.\n\nMaria, guia-me, protege-me, desata o emaranhado de meus problemas. Somente Tu liberta, somente Tu desatas, somente Tu e Teu Filho podem me libertar da opress\xe3o com que vivo, da qual estou consciente que somente n\xf3s, homens, somos os que trope\xe7amos no caminhar do dia a dia, e somos os que nos enredamos nos la\xe7os do orgulho, da soberba, da incompreens\xe3o, da falta de caridade e solidariedade.\n\nPor isso, recorro a Ti, Maria, minha M\xe3e, para que me livres e desates os n\xf3s que me impedem de ser feliz e estar mais juntos de Ti e de Teu Filho. Para que, com a ora\xe7\xe3o perseverante, dobremos os nossos duros cora\xe7\xf5es e possamos elevar-nos a um mundo mais generoso.\n\nMaria, escuta minhas preces. Am\xe9m.",null)
B.PW=new A.f2("Sinal da cruz: Em nome do Pai, e do Filho, e do Esp\xedrito Santo. Am\xe9m.\n\nAto de Contri\xe7\xe3o: Senhor meu, Jesus Cristo, Deus e homem verdadeiro, Criador e Redentor meu, por serdes V\xf3s quem sois, sumamente bom e digno de ser amado sobre todas as coisas, e porque Vos amo e estimo, pesa-me, Senhor, de todo o meu cora\xe7\xe3o, de Vos ter ofendido; pesa-me, tamb\xe9m, de ter perdido o C\xe9u e merecido o Inferno; e proponho-me firmemente, ajudado com o aux\xedlio da vossa divina gra\xe7a, emendar-me e nunca mais Vos tornar a ofender. Espero alcan\xe7ar o perd\xe3o de minhas culpas pela vossa infinita miseric\xf3rdia. Am\xe9m.\n\nJaculat\xf3ria: \xd3 Maria concebida sem pecado, rogai por n\xf3s que recorremos a v\xf3s! (3 vezes)",'Contemplemos a Virgem Imaculada, em sua primeira apari\xe7\xe3o a Santa Catarina Labour\xe9. A piedosa novi\xe7a, guiada pelo seu Anjo da Guarda, \xe9 apresentada \xe0 Imaculada Senhora. Consideremos sua inef\xe1vel alegria. Seremos tamb\xe9m felizes, como Santa Catarina se trabalharmos com ardor na nossa santifica\xe7\xe3o. Gozaremos as del\xedcias do Para\xedso se nos privarmos dos gozos terrenos.\n\nRezar 3 Ave-Marias, seguida cada uma da invoca\xe7\xe3o: "\xd3 Maria concebida sem pecado, rogai por n\xf3s que recorremos a v\xf3s!"',"Contemplemos Maria, chorando sobre as calamidades que viriam sobre o mundo, pensando que o Cora\xe7\xe3o de seu filho seria ultrajado, a cruz escarnecida e seus filhos prediletos perseguidos. Confiemos na Virgem compassiva e tamb\xe9m participaremos do fruto de suas l\xe1grimas.\n\nRezar 3 Ave-Marias etc.",'Contemplemos nossa Imaculada M\xe3e, dizendo em suas apari\xe7\xf5es a Santa Catarina: "Eu mesma estarei convosco: n\xe3o vos perco de vista e vos concederei abundantes gra\xe7as." Sede para mim, Virgem Imaculada, o escudo e a defesa em todas as necessidades.\n\nRezar 3 Ave-Marias etc.',"Estando Santa Catarina Labour\xe9 em ora\xe7\xe3o, a 27 de novembro de 1830, apareceu-lhe a Virgem Maria, formos\xedssima, esmagando a cabe\xe7a da serpente infernal. Nessa apari\xe7\xe3o vemos seu desejo imenso de nos proteger sempre contra o inimigo de nossa salva\xe7\xe3o. Invoquemos a Imaculada M\xe3e com confian\xe7a e amor!\n\nRezar 3 Ave-Marias etc.",'Contemplemos, hoje, Maria, desprendendo de suas m\xe3os raios luminosos. "Estes raios, disse ela, s\xe3o a figura das gra\xe7as que derramo sobre todos aqueles que me pedem e aos que trazem com f\xe9 minha medalha". N\xe3o desperdicemos tantas gra\xe7as! Pe\xe7amos com fervor, humildade e perseveran\xe7a, e Maria Imaculada no-las alcan\xe7ar\xe1.\n\nRezar 3 Ave-Marias etc.',"Contemplemos Maria aparecendo a Santa Catarina, radiante de luz, cheia de bondade, rodeada de estrelas e mandando cunhar uma medalha, prometendo, a todos que a trouxerem com devo\xe7\xe3o e amor, muitas gra\xe7as. Guardemos fervorosamente a Santa Medalha e, como escudo, ela nos proteger\xe1 dos perigos.\n\nRezar 3 Ave-Marias etc.","\xd3 Virgem Milagrosa, Rainha Excelsa, Imaculada Senhora, sede minha advogada, meu ref\xfagio e asilo nesta Terra, minha fortaleza e defesa na vida e na morte, meu consolo e minha gl\xf3ria no C\xe9u.\n\nRezar 3 Ave-Marias etc.","\xd3 Virgem Imaculada da Medalha Milagrosa, fazei que esses raios luminosos que irradiam de vossas m\xe3os virginais iluminem minha intelig\xeancia para melhor conhecer o bem, e abrasem meu cora\xe7\xe3o com vivos sentimentos de f\xe9, esperan\xe7a e caridade.\n\nRezar 3 Ave-Marias etc.","\xd3 M\xe3e Imaculada, fazei que a cruz de vossa medalha brilhe sempre diante de meus olhos, suavize as penas da vida presente e me conduza \xe0 vida eterna.\n\nRezar 3 Ave-Marias etc.","Sant\xedssima Virgem, eu reconhe\xe7o e confesso vossa Santa e Imaculada Concei\xe7\xe3o, pura e sem mancha. \xd3 pur\xedssima Virgem Maria, por vossa Concei\xe7\xe3o Imaculada e gloriosa prerrogativa de M\xe3e de Deus, alcan\xe7ai-me de vosso amado Filho a humildade, a caridade, a obedi\xeancia, a castidade, a santa pureza de cora\xe7\xe3o, de corpo e esp\xedrito, a perseveran\xe7a na pr\xe1tica do bem, uma santa vida e uma boa morte. Am\xe9m.",null)
B.PX=new A.f2("Glorioso S\xe3o Miguel Arcanjo, o primeiro entre os Anjos de Deus, guarda e protetor da Igreja Cat\xf3lica, lembrando de que Nosso Senhor vos confiou a miss\xe3o de velar pelo seu povo, em marcha para a vida eterna, mas rodeado de tantos perigos e ciladas do drag\xe3o infernal, eis me prostrado a vossos p\xe9s, para implorar confiantemente o vosso aux\xedlio, pois n\xe3o h\xe1 necessidade alguma em que n\xe3o possais valer.\n\nSabeis a ang\xfastia porque passa a minha alma. Ide junto a Maria, nossa M\xe3e muito amada, ide a Jesus e dizei-lhe uma palavra em meu favor, pois sei que eles nada vos podem recusar. Intercedei pela salva\xe7\xe3o da minha alma e, tamb\xe9m agora, por aquilo que tanto me preocupa.\n\n(Dizer, como quem conversa, o que desejamos)\n\nE se o que pe\xe7o n\xe3o \xe9 para gl\xf3ria de Deus e bem da minha alma, obtende-me paci\xeancia e que eu me conforme com a vontade divina, pois sabeis o que \xe9 mais do agrado de Nosso Senhor e Pai.\n\nEm nome de Jesus, Maria e Jos\xe9, atendei-me. Am\xe9m.","N\xf3s vos pedimos, oh! S\xe3o Miguel, em uni\xe3o com os santos Serafins, de acender em nossos cora\xe7\xf5es o Santo Amor de Deus, e de nos dar o desprezo e o desgosto pelos falsos prazeres do mundo.\n\nRezar: Pai-Nosso, Ave Maria e Gl\xf3ria ao Pai.","N\xf3s vos pedimos humildemente, oh! Pr\xedncipe da Jerusal\xe9m Celeste, e Chefe dos Querubins, de vos lembrar de n\xf3s, sobretudo quando formos assaltados pelas sugest\xf5es do inimigo infernal.\n\nVitoriosos de satan\xe1s, pelo nosso socorro, fazei de n\xf3s um sacrif\xedcio oferecido ao Senhor.","N\xf3s vos suplicamos devotamente, oh! glorioso Campe\xe3o do Para\xedso e Chefe dos tronos, de jamais permitir que n\xf3s, vossos fi\xe9is, sejamos oprimidos pelos esp\xedritos maus do inferno e pelas enfermidades.","Prostrados humildemente diante de v\xf3s, n\xf3s vos rogamos, oh! grande Ministro de Deus, em uni\xe3o com as Domina\xe7\xf5es, de defender a Cristandade, em todas as ocasi\xf5es, e em particular o Soberano Pont\xedfice, aumentando sua felicidade, assim como as gra\xe7as que lhe s\xe3o concedidas nesta vida e a gl\xf3ria na outra.","N\xf3s vos rogamos, oh! Santo Arcanjo, em uni\xe3o com as Virtudes, de livrar vossos servos das m\xe3os de seus inimigos, conhecidos e desconhecidos, dos falsos testemunhos, das disc\xf3rdias, de libertar a nossa P\xe1tria e, em particular, nossa cidade da fome, das epidemias, da guerra, dos tumultos, terremotos e tempestades, que o drag\xe3o infernal tem o costume de suscitar para nos prejudicar.","N\xf3s vos conjuramos, oh! Chefe das Mil\xedcias Ang\xe9licas, e vos rogamos juntamente com as Potestades, de prover \xe0s nossas necessidade, \xe0s de nossa cidade, dando fecundidade \xe0 terra, conc\xf3rdia e paz aos chefes crist\xe3os.","N\xf3s vos pedimos, oh! Primaz dos Arcanjos, em uni\xe3o com os Principados, de vos dignar nos livrar, a n\xf3s vossos servos, assim como o nosso pa\xeds e a nossa cidade das enfermidades corporais e sobretudo espirituais.","N\xf3s vos pedimos, oh! S\xe3o Miguel, em uni\xe3o com o Coro dos Anjos, de cuidar de n\xf3s nesta vida, e, no momento da morte, de nos assistir na hora da nossa agonia, sobretudo, no instante de entregar a alma, a fim de que, vencedores de satan\xe1s, possamos usufruir convosco, da bondade Divina, no santo Para\xedso.","Enfim, n\xf3s vos rogamos, oh! glorioso Chefe, defensor da Igreja militante e triunfante, de vos dignar, juntamente com os Coros dos Anjos, de nos guardar e defender vossos fi\xe9is, as nossas fam\xedlias e aqueles que se recomendaram \xe0s nossas ora\xe7\xf5es, a fim de que, levando com o vosso socorro uma vida pura, possamos eternamente usufruir da contempla\xe7\xe3o de Deus, convosco e com todos os Santos Anjos.","Oh! Deus todo poderoso e eterno, que para a salva\xe7\xe3o do g\xeanero humano enviastes, milagrosamente, a Vossa Igreja o Vosso Glorios\xedssimo Pr\xedncipe, o Arcanjo S\xe3o Miguel, concedei-nos o seu socorro salutar e a sua ajuda eficaz contra todos os nossos inimigos, a fim de que, nossa partida deste mundo, obtenhamos de comparecer \xe0 presen\xe7a de Vossa Divina e Santa Majestade.\n\nPor Jesus Cristo, nosso Senhor.Am\xe9m.\n\nS\xe3o Miguel Arcanjo, defendei-nos no combate, para que n\xe3o pere\xe7amos no dia do Ju\xedzo.\n\nEm seguida reza-se: Um Pai Nosso a S\xe3o Miguel, um Pai Nosso \xe0 S\xe3o Gabriel, um Pai Nosso \xe0 S\xe3o Rafael e um Pai Nosso ao nosso Anjo da Guarda.",null)
