B.Td=new A.aV('Akita \xe9 uma cidade situada a noroeste do Jap\xe3o.\n\nOs acontecimentos se deram num pequeno convento de Irm\xe3s chamado de: "Instituto das Servas da Eucaristia". O instrumento que a Virgem Sant\xedssima escolheu para transmitir Sua mensagem ao mundo, foi a Irm\xe3 Agnes Sasagawa Katsuko. Ela tinha um problema de ouvidos que por ocasi\xe3o destes acontecimentos estava completamente surda.\n\nNa capela das Irm\xe3s h\xe1 uma est\xe1tua de madeira, em que fora talhada uma Cruz (aproximadamente um metro de altura) e, em frente \xe0 cruz foi esculpida a imagem da Virgem Maria.\n\nNo ano 1973 nos dias 12,13 e 14 de junho, a irm\xe3 In\xeas viu raios luminosos em roda do Sacr\xe1rio. No dia 28 junho quinta-feira, uma ferida em forma de cruz apareceu na palma da m\xe3o esquerda, causando-lhe viv\xedssimas dores. A noite, a ferida estava seca, mas inchada; na sexta-feira de manh\xe3, o sangue corria; no s\xe1bado o sangue parava e a chaga ficava seca.\n\nNo dia 29 sexta-feira (Festa do S. Cora\xe7\xe3o de Jesus), apareceram dois anjos em volta do altar, cantando: "Santo, Santo, Santo \xe9 o Senhor Deus da Gl\xf3ria!" Todas as religiosas viram os anjos e ouviram o canto. No dia 5 julho, a surda irm\xe3 Agnes, na capela, ouviu uma voz dulc\xedssima e melodiosa que vinha da imagem de madeira.\n\nPrimeira Mensagem (dia 6 de julho de 1973).\n\n\u201cMinha filha, minha novi\xe7a, voc\xea tem me obedecido bem, abandonando tudo para me seguir. A doen\xe7a em seus ouvidos \xe9 dolorosa? Sua surdez ser\xe1 curada, tenha certeza. A ferida em sua m\xe3o causa-lhe sofrimento? Reze em repara\xe7\xe3o pelos pecados dos homens. Cada pessoa nesta comunidade \xe9 minha filha insubstitu\xedvel. Voc\xea reza direito a prece das Servas da Eucaristia? Ent\xe3o, vamos rez\xe1-la juntas.\u201d\n\nA ora\xe7\xe3o:\n\n\u201cSacrat\xedssimo Cora\xe7\xe3o de Jesus, verdadeiramente presente na Sagrada Eucaristia, eu consagro meu corpo e minha alma para ser inteiramente um com Vosso Cora\xe7\xe3o, sendo sacrificado a cada instante em todos os altares do mundo e dando louvor ao Pai implorando pela vinda do Seu Reino. Por favor receba este humilde oferecimento de mim mesma. Use-me como V\xf3s desejais para a gl\xf3ria do Pai e a salva\xe7\xe3o das almas. Sant\xedssima M\xe3e de Deus, nunca me deixe ficar separada de Vosso Divino Filho. Por favor defendei-me e protegei-me como Vossa Especial Filha. Am\xe9m.\u201d\n\nQuando a prece acabou, a Voz Celeste disse:\n\n\u201cReze muito pelo Papa, Bispos, e Sacerdotes. Desde o seu Batismo voc\xea tem sempre rezado fielmente por eles. Continue a rezar muito... muito. Diga ao seu superior todo que se passou hoje e obede\xe7a-o em tudo que ele lhe dir\xe1. Ele pediu que voc\xea ore com fervor.\u201d\n\nNo dia 6 de julho, uma chaga (igual \xe0 da irm\xe3) apareceu na m\xe3o direita da imagem de madeira e o sangue come\xe7ou a escorrer. No dia 26 de julho, o sangue brotou da est\xe1tua (de Maria) e as dores da Irm\xe3 aumentaram, tornando-se quase insuport\xe1veis.\n\nNo dia 27 julho, um anjo disse \xe0 irm\xe3:\n\n"As tuas dores terminar\xe3o hoje. O derramamento de sangue de MARIA (na imagem) \xe9 para obter a vossa convers\xe3o; para implorar a paz; para reparar as ingratid\xf5es e inj\xfarias feitas a DEUS. Reza em repara\xe7\xe3o por todos os homens."\n\nSegunda Mensagem (dia 3 agosto de 1973.)\n\n\u201dMinha filha, minha novi\xe7a, voc\xea ama o Senhor? Se voc\xea ama o Senhor, ou\xe7a o que eu tenho a lhe dizer. \xc9 muito importante... Voc\xea ir\xe1 comunicar isso ao seu superior. Muitos homens neste mundo afligem o Senhor. Eu desejo almas para consol\xe1-lo, para aliviar a ira do Divino Pai. Eu desejo, com meu Filho, almas que reparem atrav\xe9s de seu sofrimento e sua pobreza pelos pecadores e ingratos.\n\nDe modo a que o mundo possa conhecer Sua ira, o Pai Celeste est\xe1 preparando para infligir um grande castigo em toda a humanidade. Com meu Filho eu tenho interferido tantas vezes para aplacar a ira do Pai.\n\nEu tenho evitado a vinda de calamidades oferecendo a Ele os sofrimentos de meu Filho na Cruz, Seu Precioso Sangue, e almas amadas que O consolem formando uma corte de almas v\xedtimas. Ora\xe7\xe3o, penit\xeancia e sacrif\xedcios corajosos podem aliviar a ira do Pai. Eu desejo isto tamb\xe9m para a sua comunidade... que ela ame a pobreza, que ela se santifique e reze em repara\xe7\xe3o pelas ingratid\xf5es e ultrajes de tantos homens.\n\nRecitem a ora\xe7\xe3o das Servas da Eucaristia com consci\xeancia do seu significado; coloquem-na em pr\xe1tica; ofere\xe7am em repara\xe7\xe3o (o que quer que Deus envie) pelos pecados. Deixe cada uma esfor\xe7ar-se, de acordo com sua capacidade e posi\xe7\xe3o, para oferecer a si mesma ao Senhor. Mesmo em uma institui\xe7\xe3o secular a ora\xe7\xe3o \xe9 necess\xe1ria. Almas que desejam orar j\xe1 est\xe3o a caminho de serem reunidas. Sem prender-se demasiadamente \xe0 forma, sejam fi\xe9is e fervorosas na ora\xe7\xe3o para consolar o Mestre".\n\nAp\xf3s um sil\xeancio:\n\n\u201cO que voc\xea est\xe1 pensando em seu cora\xe7\xe3o \xe9 verdade? Voc\xea est\xe1 realmente decidida a tornar-se a pedra rejeitada? Minha novi\xe7a, voc\xea que deseja pertencer sem reserva ao Senhor, a tornar-se a esposa digna do Esposo, fa\xe7a seus votos sabendo que voc\xea deve ser pregada \xe0 Cruz com tr\xeas cravos. Estes tr\xeas cravos s\xe3o a pobreza, a castidade, e a obedi\xeancia. Dos tr\xeas, a obedi\xeancia \xe9 o fundamento. Em total abandono, deixe-se guiar pelo seu superior. Ele vai saber entend\xea-la e dirigi-la.\u201d',null)
B.Tc=new A.aV("Na Alta It\xe1lia ocorria uma guerra furiosa pelo ducado de Mil\xe3o. Os Piemonteses saquearam a cidade; ao chegarem \xe0 Igreja, for\xe7aram o Tabern\xe1culo. Tiraram o ostens\xf3rio de prata, no qual se guardava o corpo de Cristo ocultando-o dentro de uma carruagem juntamente com os outros objetos roubados, e dirigiram-se para Turim.\n\nCr\xf4nicas antigas relatam que, na altura da Igreja de S\xe3o Silvestre, o cavalo parou bruscamente a carruagem \u2013 o que ocasionou a queda, por terra, do ostens\xf3rio \u2013 o ostens\xf3rio se levantou nos ares \u201ccom grande esplendor e com raios que pareciam os do sol\u201d.\n\nOs espectadores chamaram o Bispo da cidade, Ludovico Romagnano, que foi prontamente ao local do prod\xedgio. Quando chegou, \u201cO ostens\xf3rio caiu por terra, ficando o corpo de Cristo nos ares a emitir raios refulgentes\u201d.\n\nO Bispo, diante dos fatos, pediu que lhe levassem um c\xe1lice. Dentro do c\xe1lice, desceu a h\xf3stia, que foi levada para a catedral com grande solenidade. Era o dia 9 de junho de 1453.\n\nExistem testemunhos contempor\xe2neos do acontecimento (Atti Capitolari de 1454 a 1456). A Igreja de \u201cCorpus Domini\u201d (1609), que at\xe9 hoje atesta o prod\xedgio.",null)
B.Te=new A.aV("Logo pela manh\xe3, se reuniram os sumos sacerdotes com os anci\xe3os, os escribas e com todo o conselho. E tendo amarrado Jesus, levaram-no e entregaram-no a Pilatos. Este lhe perguntou: \u201c\xc9s tu o rei dos judeus?\u201d. Ele lhe respondeu: \u201cSim\u201d. Os sumos sacerdotes acusavam-no de muitas coisas. Pilatos perguntou-lhe outra vez: \u201cNada respondes? V\xea de quantos delitos te acusam!\u201d. Mas Jesus nada mais respondeu, de modo que Pilatos ficou admirado. Ora, costumava ele soltar-lhes em cada festa qualquer dos presos que pedissem. Havia na pris\xe3o um, chamado Barrab\xe1s, que fora preso com seus c\xfamplices, o qual na sedi\xe7\xe3o perpetrara um homic\xeddio. O povo que tinha subido come\xe7ou a pedir-lhe aquilo que sempre lhes costumava conceder. Pilatos respondeu-lhes: \u201cQuereis que vos solte o rei dos judeus?\u201d. (Porque sabia que os sumos sacerdotes o haviam entregue por inveja.) Mas os pont\xedfices instigaram o povo para que pedissem de prefer\xeancia que lhes soltasse Barrab\xe1s. Pilatos falou-lhes outra vez: \u201cE que quereis que eu fa\xe7a daquele a quem chamais o rei dos judeus?\u201d. Eles tornaram a gritar: \u201cCrucifica-o!\u201d. Pilatos replicou: \u201cMas que mal fez ele?\u201d. Eles clamavam mais ainda: \u201cCrucifica-o!\u201d. Querendo Pilatos satisfazer o povo, soltou-lhes Barrab\xe1s e entregou Jesus, depois de flagelado, para que fosse crucificado.",null)
B.Tf=new A.aV("Desde a hora sexta at\xe9 a nona, cobriu-se toda a terra de trevas. Pr\xf3ximo da hora nona, Jesus exclamou em voz forte: \u201cEli, Eli, lamm\xe1 sabact\xe1ni?\u201d \u2013 o que quer dizer: \u201cMeu Deus, meu Deus, por que me abandonaste?\u201d. A essas palavras, alguns dos que l\xe1 estavam diziam: \u201cEle chama por Elias\u201d. Imedia-tamente, um deles tomou uma esponja, embebeu-a em vinagre e apresentou-lha na ponta de uma vara para que bebesse. Os outros diziam: \u201cDeixa! Vejamos se Elias vir\xe1 socorr\xea-lo\u201d. Jesus de novo lan\xe7ou um grande brado, e entregou a alma. E eis que o v\xe9u do templo se rasgou em duas partes de alto a baixo, a terra tremeu, fenderam-se as rochas. Os sepulcros se abriram e os corpos de muitos justos ressuscitaram. Saindo de suas sepulturas, entraram na cidade santa depois da ressurrei\xe7\xe3o de Jesus e apareceram a muitas pessoas. O centuri\xe3o e seus homens que montavam guarda a Jesus, diante do estremecimento da terra e de tudo o que se passava, disseram entre si, possu\xeddos de grande temor: \u201cVerdadeiramente, este homem era Filho de Deus!\u201d.",null)
B.Tg=new A.aV("No sexto m\xeas, o anjo Gabriel foi enviado por Deus a uma cidade da Galileia, chamada Nazar\xe9, a uma virgem desposada com um homem que se chamava Jos\xe9, da casa de Davi e o nome da virgem era Maria. Entrando, o anjo disse-lhe: \u201cAve, cheia de gra\xe7a, o Senhor \xe9 contigo\u201d. Perturbou-se ela com essas palavras e p\xf4s-se a pensar no que significaria semelhante sauda\xe7\xe3o. O anjo disse-lhe: \u201cN\xe3o temas, Maria, pois encontraste gra\xe7a diante de Deus. Eis que conceber\xe1s e dar\xe1s \xe0 luz um filho, e lhe por\xe1s o nome de Jesus. Ele ser\xe1 grande e ser\xe1 chamado Filho do Alt\xedssimo, e o Senhor Deus lhe dar\xe1 o trono de seu pai Davi; e reinar\xe1 eternamente na casa de Jac\xf3, e o seu reino n\xe3o ter\xe1 fim\u201d. Maria perguntou ao anjo: \u201cComo se far\xe1 isso, pois n\xe3o conhe\xe7o homem?\u201d. Respondeu-lhe o anjo: \u201cO Esp\xedrito Santo descer\xe1 sobre ti, e a for\xe7a do Alt\xedssimo te envolver\xe1 com a sua sombra. Por isso, o ente santo que nascer de ti ser\xe1 chamado Filho de Deus. Tamb\xe9m Isabel, tua parenta, at\xe9 ela concebeu um filho na sua velhice; e j\xe1 est\xe1 no sexto m\xeas aquela que \xe9 tida por est\xe9ril, porque a Deus nenhuma coisa \xe9 imposs\xedvel\u201d. Ent\xe3o disse Maria: \u201cEis aqui a escrava do Senhor. Fa\xe7a-se em mim segundo a tua palavra\u201d. E o anjo afastou-se dela.",null)
B.Th=new A.aV("Compreendemos que o t\xedtulo Nossa Senhora das Gra\xe7as est\xe1 intimamente ligado \xe0 revela\xe7\xe3o da Medalha Milagrosa. Por\xe9m, as gra\xe7as distribu\xeddas por Nossa Senhora n\xe3o dependem do uso da Medalha e sim de pedir a ela com f\xe9 e devo\xe7\xe3o. Tanto que, em outra apari\xe7\xe3o, Nossa Senhora se queixou a Santa Catarina Labour\xe9 dizendo: \u201cTenho muitas gra\xe7as para distribuir... Mas as pessoas n\xe3o me pedem...\u201d\n\nDepois de um tempo, Catarina Labour\xe9 conseguiu que a medalha fosse cunhada, tal qual a Virgem Maria tinha lhe pedido. Logo, esta medalha se tornou um fen\xf4meno inimagin\xe1vel. A promessa da Virgem Maria se cumpria admiravelmente em todos os que usavam a Medalha com devo\xe7\xe3o. Gra\xe7as a ela, uma terr\xedvel epidemia da peste negra foi debelada na Fran\xe7a. Milhares de pessoas j\xe1 tinham morrido quando a Medalha Milagrosa come\xe7ou a ser usada. Ent\xe3o, os doentes que a recebiam com f\xe9 come\xe7aram a ser curados milagrosamente, pois a peste n\xe3o tinha cura.\n\nEnt\xe3o, a Medalha Milagrosa passou de milhares para milh\xf5es de cunhagens. Espalhou-se rapidamente pela Europa livrando milh\xf5es de pessoas da peste. Depois, espalhou-se por todo o mundo. E as gra\xe7as continuam acontecendo at\xe9 hoje. A medalha Milagrosa \xe9 a mais cunhada de todos os tempos. O n\xfamero de medalhas, por\xe9m, n\xe3o se compara ao n\xfamero de gra\xe7as derramadas pelas m\xe3os cheias de amor da Virgem Maria, Nossa Senhora das Gra\xe7as.\n\nFonte: Cruz Terra Santa",null)
B.Ti=new A.aV("Aconteceu no dia 16 de fevereiro de 1247, em Santar\xe9m, 65 km ao norte de Lisboa. O milagre se deu com uma dona de casa, Euvira, casada com Pero Moniz, a qual sofrendo com a infidelidade do marido, decidiu consultar uma bruxa judia que morava perto da igreja da Gra\xe7a.\n\nEsta bruxa prometeu-lhe resolver o problema se como pagamento recebesse uma H\xf3stia Consagrada. Para obter a H\xf3stia, a mulher fingiu-se de doente e enganou o padre da igreja de S. Estev\xe3o, que lhe deu a sagrada Comunh\xe3o num dia de semana. Assim que ela recebeu a H\xf3stia, sem o padre notar, colocou-a nas dobras do seu v\xe9u. De imediato a H\xf3stia come\xe7ou a sangrar. Assustada, a mulher correu para casa na Rua das Esteiras, perto da Igreja e escondeu o v\xe9u e a H\xf3stia numa arca de cedro onde guardava os linhos lavados.\n\n\xc0 noite o casal foi acordado com uma vis\xe3o espetacular de Anjos em adora\xe7\xe3o \xe0 sagrada H\xf3stia sangrando. V\xe1rias investiga\xe7\xf5es eclesi\xe1sticas foram feitas durante 750 anos. As realizadas em 1340 e 1612 provaram a sua autenticidade. Em 5 de abril de 1997, por decreto de D. Antonio Francisco Marques, Bispo de Santar\xe9m, a Igreja de S. Estev\xe3o, onde est\xe1 a rel\xedquia, foi elevada a Santu\xe1rio Eucar\xedstico do Sant\xedssimo Sangue.",null)
B.Tj=new A.aV("Na Bas\xedlica de S\xe3o Francisco, em Sena, p\xe1tria de Santa Catarina de Sena, durante a noite de 14 para 15 de mar\xe7o de 1730, foram jogadas no ch\xe3o 223 h\xf3stias consagradas, por ladr\xf5es que roubaram o cib\xf3rio de prata onde elas estavam. Dois dias depois, as H\xf3stias foram achadas em caixa de esmolas misturas com dinheiro. Elas foram limpas e guardadas na Bas\xedlica de S\xe3o Francisco; ningu\xe9m as consumiu; e logo o milagre aconteceu visto que com o passar do tempo as H\xf3stias n\xe3o se estragaram, o que \xe9 um grande milagre.\n\nA divulga\xe7\xe3o do fato fez com que a Igreja providenciasse uma an\xe1lise mais apropriada. Cientistas da \xe9poca constataram que a conserva\xe7\xe3o das h\xf3stias n\xe3o tinha outra explica\xe7\xe3o a n\xe3o ser um milagre. Para tanto, foi providenciado um teste: colocaram o mesmo n\xfamero de part\xedculas do referido milagre numa caixa fechada e, dez anos depois, a abriram. S\xf3 encontraram restos putrefatos e pequenas part\xedculas amareladas.\n\nTantos outros testes foram realizados e o mais importante deles foi feito em 1914, tendo participado um dos mais renomados cientistas da \xe9poca, o professor Siro Grimaldi, que ap\xf3s o exame das h\xf3stias lan\xe7ou um livro com o t\xedtulo \u201cUm cientista que adora\u201d, explicando que a farinha \xe9 o gr\xe3o que atrai fungos e parasitas com mais rapidez, mas que aqueles fragmentos de trigo estavam incorrupt\xedveis.\n\nA farinha, que \xe9 um produto do trigo, ap\xf3s a consagra\xe7\xe3o, torna-se o verdadeiro Corpo de Cristo. Esse milagre Eucar\xedstico que acontece em todas as Santas Missas \xe9 fonte de inspira\xe7\xe3o para que a nossa f\xe9 n\xe3o se perca em d\xfavidas sem sentido. O que prevalece n\xe3o \xe9 o trigo, mas o mist\xe9rio que surge por tr\xe1s dele. \xc9 o Corpo de Cristo, que se d\xe1 a cada um de n\xf3s.",null)
B.Tk=new A.aV("Naqueles dias, Maria se levantou e foi \xe0s pressas \xe0s montanhas, a uma cidade de Jud\xe1. Entrou em casa de Zacarias e saudou Isabel. Ora, apenas Isabel ouviu a sauda\xe7\xe3o de Maria, a crian\xe7a estremeceu no seu seio; e Isabel ficou cheia do Esp\xedrito Santo. E exclamou em alta voz: \u201cBendita \xe9s tu entre as mulheres e bendito \xe9 o fruto do teu ventre. Donde me vem esta honra de vir a mim a m\xe3e de meu Senhor? Pois assim que a voz de tua sauda\xe7\xe3o chegou aos meus ouvidos, a crian\xe7a estremeceu de alegria no meu seio. Bem-aventurada \xe9s tu que creste, pois se h\xe3o de cumprir as coisas que da parte do Senhor te foram ditas!\u201d. E Maria disse: \u201cMinha alma glorifica ao Senhor, meu esp\xedrito exulta de alegria em Deus, meu Salvador, porque olhou para sua pobre serva. Por isso, desde agora, me proclamar\xe3o bem-aventurada todas as gera\xe7\xf5es, porque realizou em mim maravilhas aquele que \xe9 poderoso e cujo nome \xe9 Santo. Sua miseric\xf3rdia se estende, de gera\xe7\xe3o em gera\xe7\xe3o, sobre os que o temem. Manifestou o poder do seu bra\xe7o: desconcertou os cora\xe7\xf5es dos soberbos. Derrubou do trono os poderosos e exaltou os humildes. Saciou de bens os indigentes e despediu de m\xe3os vazias os ricos. Acolheu a Israel, seu servo, lembrado da sua miseric\xf3rdia, conforme prometera a nossos pais, em favor de Abra\xe3o e sua posteridade, para sempre\u201d. Maria ficou com Isabel cerca de tr\xeas meses. Depois voltou para casa.",null)
B.Tl=new A.aV("A origem do Ros\xe1rio \xe9 muito antiga, pois conta-se que os monges anacoretas (eremitas dos primeiros s\xe9culos do cristianismo) usavam pedrinhas para contar o n\xfamero das ora\xe7\xf5es vocais. Dessa forma, nos conventos medievais, os irm\xe3os leigos dispensados da recita\xe7\xe3o do Salt\xe9rio (pela pouca familiaridade com o latim), lembrando que o \xedndice de analfabetismo era muito grande, completavam suas pr\xe1ticas de piedade com a recita\xe7\xe3o de Pai-Nosso e, para a contagem, o Doutor da Igreja S\xe3o Beda, chamado de \u201co Vener\xe1vel\u201d (s\xe9c. VII-VIII), havia sugerido a ado\xe7\xe3o de v\xe1rios gr\xe3os enfiados em um barbante.\n\nO Santo Ros\xe1rio foi sendo transformado com o decorrer dos anos, por\xe9m, no ano de 1214, a Santa Igreja o estabeleceu na forma e m\xe9todo que hoje \xe9 usado. Antes, as Ave-Marias n\xe3o eram como agora, nem mesmo os mist\xe9rios contemplados entre outros ingredientes da ora\xe7\xe3o. Sua origem se deu com a revela\xe7\xe3o divina da Virgem Maria a S\xe3o Domingos de Gusm\xe3o, fundador dos dominicanos (O.P.). Por meio das cita\xe7\xf5es referidas ao Bem-aventurado Alano de La Roche em seu livro \u201cDe Dignitate Psalterri\u201d, S\xe3o Lu\xeds Maria Grignion de Montfort relata a origem do Ros\xe1rio.\n\nA tradi\xe7\xe3o espiritual conta que, no contexto da revela\xe7\xe3o, S\xe3o Domingos se preocupava em converter os albigenses, tamb\xe9m conhecidos como c\xe1taros (puros), que eram um grupo de hereges de car\xe1ter gn\xf3stico e manique\xedsta, sendo at\xe9 mesmo protegida por bispos e nobres da \xe9poca. Essa doutrina negava a exist\xeancia de um \xfanico Deus, negava a divindade de Jesus, direcionava a salva\xe7\xe3o atrav\xe9s do conhecimento etc., realidades que entravam em choque com o catolicismo. Desse modo, o santo procurava converter os her\xe9ticos e enfrentava grande resist\xeancia. Certa vez, procurou retirar-se em uma floresta para rezar e ali recebeu a orienta\xe7\xe3o da Virgem Maria: \u201cQuerido Domingos, voc\xea sabe de que arma a Sant\xedssima Trindade quer usar para mudar o mundo? [ \u2026 ] a principal pe\xe7a de combate tem sido sempre o Salt\xe9rio Ang\xe9lico que \xe9 a pedra fundamental do Novo Testamento. Quero que alcances estas almas endurecidas e as conquiste para Deus, com a ora\xe7\xe3o do meu Salt\xe9rio\u201d (MONTFORT, 2019, p. 42-43).\n\nA partir dessa situa\xe7\xe3o, S\xe3o Domingos come\xe7ou a pregar o Santo Ros\xe1rio ou como foi dito, em revela\xe7\xe3o, \u201cSalt\xe9rio Ang\xe9lico\u201d. Assim expresso, pois naquela \xe9poca poucas pessoas eram alfabetizadas e n\xe3o conheciam a Sagrada Escritura. Por outro lado, os monges costumavam recitar em ora\xe7\xe3o os 150 Salmos, rezando a \u201cliturgia das horas\u201d. Desse modo, os crist\xe3os poderiam imitar a ora\xe7\xe3o e se aproximar dos mist\xe9rios de Deus ao recitar 150 Ave-Marias, conhecida como a sauda\xe7\xe3o ang\xe9lica j\xe1 que foi dita pelos Anjos e relatava nas Escrituras. Assim, tornou-se o \u201cSalt\xe9rio Ang\xe9lico\u201d (Salmos Ang\xe9licos). Em um segundo momento, ao esfriar a devo\xe7\xe3o do Salt\xe9rio Ang\xe9lico, em nova apari\xe7\xe3o, Nossa Senhora apareceu ao Beato Alano (1428 \u2013 1475) lhe pedindo que reavivasse a pr\xe1tica. Assim ele formou os agrupamentos de 50 Ave-Marias e seus mist\xe9rios, conhecidos como: Gozosos, Dolorosos e Gloriosos. Ela lhe disse que muitas gra\xe7as e milagres seriam alcan\xe7ados por meio desse modo e reafirmou os ditos a S\xe3o Domingos.\n\nLogo ap\xf3s, houve a batalha de Lepanto (Gr\xe9cia, junto ao porto de Corinto) comandada por Jo\xe3o da \xc1ustria, em 7 de Outubro de 1571. O Papa Pio V procurava conter os avan\xe7os dos turcos na Europa e, antes disso, convocou os crist\xe3os para que rezassem o ros\xe1rio atrav\xe9s da Carta Breve Consueverunt (1569). Era uma batalha extremamente importante, pois dela dependia a preserva\xe7\xe3o do cristianismo e da cultura ocidental. Com a vit\xf3ria adquirida, ele instituiu a festa de Nossa Senhora do Ros\xe1rio no mesmo dia da batalha, e reconheceu que a vit\xf3ria veio por meio das ora\xe7\xf5es do Ros\xe1rio. Sendo este Papa da ordem dos dominicanos, por isso, seguiu a inspira\xe7\xe3o do fundador.\n\nPor fim, ap\xf3s anos de est\xedmulo e devo\xe7\xe3o por parte dos papas e dos santos, S\xe3o Jo\xe3o Paulo II, em sua carta \u201cRosarium Virginis Mariae\u201d (2002), institui o quarto mist\xe9rio, que foi reconhecido como \u201cluminoso\u201d. Formando, ent\xe3o, o Ros\xe1rio com quatro ter\xe7os meditando os mist\xe9rios de Cristo. Assim, deu-se o formato daquilo que se conhece atualmente por Santo Ros\xe1rio.\n\nFonte: Can\xe7\xe3o Nova",null)
B.Tm=new A.aV("Nascida em 3 de agosto de 1911, ao norte da It\xe1lia, a enfermeira Pierina Gilli viu pela primeira vez Nossa Senhora, com a apar\xeancia que conhecemos hoje como Rosa M\xedstica, no quarto do hospital onde trabalhava, em 1947.\n\nNesta ocasi\xe3o, Pierina contemplou uma bel\xedssima Senhora de t\xfanica p\xfarpura e com um v\xe9u branco cobrindo-lhe a cabe\xe7a. Com um semblante triste e chorando, em seu peito, estavam cravadas tr\xeas espadas, e durante a apari\xe7\xe3o, Ela disse apenas: \u201cOra\xe7\xe3o, Penit\xeancia e Expia\xe7\xe3o\u201d.\n\nNa segunda apari\xe7\xe3o, a Virgem apresentou-se de branco e, no lugar das tr\xeas espadas, trouxe no peito tr\xeas rosas: uma branca, uma cor-de-rosa e outra dourada. A Virgem disse a Pierina que o Senhor a enviara especialmente para ajudar os sacerdotes e as ordens religiosas e que seu desejo era que no dia 31 de cada m\xeas fosse consagrado como dia mariano. Tamb\xe9m disse que os 12 dias precedentes deviam ser destinados \xe0 prepara\xe7\xe3o com ora\xe7\xf5es especiais e que o dia 13 de julho fosse dedicado \xe0 Rosa M\xedstica.\n\nAl\xe9m disso, Nossa Senhora explicou o significado das espadas e das tr\xeas rosas: A primeira espada representava a escassez das voca\xe7\xf5es; A segunda, os pecados mortais dos sacerdotes, monges e monjas; A terceira espada era por causa dos sacerdotes e monges que cometem a mesma trai\xe7\xe3o de Judas.\n\nJ\xe1 a rosa branca representava o esp\xedrito de ora\xe7\xe3o, a rosa vermelha, o esp\xedrito da penit\xeancia e, por fim, a rosa dourada que simbolizava o esp\xedrito da expia\xe7\xe3o dos pecados.\n\nNossa Senhora Rosa M\xedstica manifestou-se mais vezes \xe0 enfermeira Pierina. Em Fontanelle, no dia 6 de agosto, disse: \u201cMeu divino Filho Jesus me envia novamente aqui para pedir a forma\xe7\xe3o da Liga Mundial da Comunidade Reparadora que deve ter in\xedcio no pr\xf3ximo 13 de outubro e estender-se por todo o mundo a cada ano\u201d. As apari\xe7\xf5es aconteceram em Montichiari e em Fontanelle, na It\xe1lia. A Rosa M\xedstica de Montichiari se tornou conhecida no mundo inteiro. Fora da It\xe1lia, h\xe1 quatro santu\xe1rios associados a essa devo\xe7\xe3o: no Brasil, na Venezuela, no L\xedbano e na China.\n\nFonte: Mil\xedcia da Imaculada.",null)
B.Tn=new A.aV('Nossa Senhora do Carmo tem origem no s\xe9culo XII, quando se um grupo de eremitas come\xe7ou a se formar no monte Carmelo, na Palestina, terra Santa, iniciando um estilo de vida simples e pobre, ao lado da fonte de Elias, que se estendeu ao mundo todo. A palavra Carmo, corresponde ao monte do Carmo ou monte Carmelo, em Israel, onde o profeta Elias se refugiou. A palavra carmo ou carmelo significa jardim.\n\nA ordem dos carmelitas venera com carinho o profeta Elias, que \xe9 seu patriarca, e a Virgem Maria, venerada com o t\xedtulo de Bem Aventurada Virgem do Carmo. Devido ao lugar, esse grupo foi chamado de carmelitas. L\xe1, esse grupo de eremitas construiu uma pequena capela dedicada a Senhora do Carmo, ou Nossa Senhora do Carmelo. Posteriormente os carmelitas foram obrigados a ir para a Europa fugindo da persegui\xe7\xe3o dos mu\xe7ulmanos. A\xed se espalhou ainda mais a Ordem do Carmelo.\n\nS\xe3o Sim\xe3o era um dos mais piedosos carmelitas que vivia na Inglaterra. Vendo a Ordem dos Carmelitas ser perseguida at\xe9 estar prestes a ser eliminada da face da terra, ele sofria muito e pedia socorro a Nossa Senhora do Carmo. Sua ora\xe7\xe3o, que os carmelitas usam at\xe9 hoje, foi a seguinte: "Flor do Carmelo, vida florida. Esplendor do C\xe9u. Virgem M\xe3e incompar\xe1vel. Doce M\xe3e, mas sempre virgem. Sede prop\xedcia aos carmelitas. \xd3 Estrela do mar."\n\nEnt\xe3o Maria Sant\xedssima, rodeada de anjos, apareceu para S\xe3o Sim\xe3o, entregou-lhe o Escapul\xe1rio e lhe disse:\n\n"Recebe, meu filho muito amado, este escapul\xe1rio de tua ordem, sinal do meu amor, privil\xe9gio para ti e para todos os carmelitas. Quem com ele morrer n\xe3o se perder\xe1. Eis aqui um sinal da minha alian\xe7a, salva\xe7\xe3o nos perigos, alian\xe7a de paz e amor eterno."\n\nA partir desse milagre, o escapul\xe1rio passou a fazer parte do h\xe1bito dos carmelitas e a partir da apari\xe7\xe3o de Nossa Senhora do Carmo a S\xe3o Sim\xe3o, a Ordem do Carmelo come\xe7ou a florescer na Europa e em v\xe1rios lugares do mundo, permanecendo firme at\xe9 os dias de hoje.\n\nA palavra escapul\xe1rio, vem do latim, esc\xe1pula, que significa  armadura, prote\xe7\xe3o. O escapul\xe1rio \xe9 uma forma de devo\xe7\xe3o a Maria Sant\xedssima. O uso do escapul\xe1rio \xe9 um sinal de confian\xe7a em Nossa Senhora do Carmo. A pessoa que o usa, \xe9 coberta com a prote\xe7\xe3o e as gra\xe7as da Virgem Do Carmo. O escapul\xe1rio, segundo o Concilio do Vaticano II \xe9 um Sacramental, um sinal sagrado, obtendo efeitos de prote\xe7\xe3o da Igreja Cat\xf3lica. \xc9 uma realidade vis\xedvel que nos conduz a Deus. Santa Tereza dizia que: portar o escapul\xe1rio, era estar vestida com o h\xe1bito de Nossa Senhora.\n\nFonte: Cruz terra Santa',null)
B.To=new A.aV("Nossa Senhora Aparecida, \xe9 a forma como Nossa Senhora \xe9 carinhosamente chamada no Brasil, pa\xeds do qual \xe9 padroeira. Ela \xe9 reverenciada numa est\xe1tua de Nossa Senhora da Concei\xe7\xe3o, vestida com um manto azul todo enfeitado. Ela fica exposta na Bas\xedlica de Nossa Senhora Aparecida, em Aparecida, interior do Estado de S\xe3o Paulo. A festa em sua honra \xe9 celebrada no dia 12 de outubro, tamb\xe9m dia das crian\xe7as. Este dia \xe9 feriado para os brasileiros desde 1980, quando a bas\xedlica foi consagrada por Jo\xe3o Paulo II em sua primeira visita ao Brasil. A bas\xedlica de Aparecida \xe9 a segunda maior do mundo, a quarta igreja mariana que recebe mais visitas no mundo, com a incr\xedvel capacidade de receber 45 mil romeiros no seu interior.\n\nOs fatos foram registrados primeiramente pelos padres Jos\xe9 Alves Vilela, em 1743, e Jo\xe3o de Morais e Aguiar, em 1757. Esses registros foram feitos nos livros da Par\xf3quia de Santo Ant\xf4nio de Guaratinguet\xe1, \xe0 qual pertencia a regi\xe3o onde a imagem foi encontrada. A imagem apareceu em outubro de 1717. E os fatos aconteceram assim:\n\nDom Pedro de Almeida, governante da capitania de S\xe3o Paulo e Minas de Ouro, homem que detinha tamb\xe9m o t\xedtulo de Conde de Assumar, passava por Guaratinguet\xe1, SP, quando viajava para Vila Rica, MG. A popula\xe7\xe3o organizou uma festa para receber o conde de Assumar. Para prepararem a comida, pescadores foram para o rio Para\xedba com a dif\xedcil miss\xe3o de conseguirem muitos peixes para a comitiva do governador, mesmo n\xe3o sendo tempo de pesca. Domingos Garcia, Filipe Pedroso e Jo\xe3o Alves, sentindo o peso de sua responsabilidade, fizeram uma ora\xe7\xe3o pedindo a ajuda da M\xe3e de Deus. Depois de tentar v\xe1rias vezes sem sucesso, na altura do Porto Itagua\xe7u, j\xe1 desistindo da pescaria, Jo\xe3o Alves lan\xe7ou a rede novamente. N\xe3o pegou nenhum peixe, mas apanhou a imagem de Nossa Senhora da Concei\xe7\xe3o. Por\xe9m, faltando a cabe\xe7a. Emocionado, lan\xe7ou de novo a rede e, desta vez, pegou a cabe\xe7a que se encaixou perfeitamente na pequena imagem. S\xf3 este fato, j\xe1 foi um grande milagre. Mas, ap\xf3s esse achado, eles apanharam tamanha quantidade de peixes que tiveram que retornar ao porto com medo de a canoa virar. Os pescadores chegaram a Guaratinguet\xe1 euf\xf3ricos e emocionados com o que presenciaram e toda a popula\xe7\xe3o entendeu o fato como interven\xe7\xe3o divina. Assim aconteceu o primeiro de muitos milagres pela a\xe7\xe3o de Nossa Senhora Aparecida.\n\nA imagem ficou na casa de Filipe Pedroso por 15 anos. Ali, os amigos e vizinhos se encontravam para rezar \xe0 Nossa Senhora da Concei\xe7\xe3o. Gra\xe7as e mais gra\xe7as come\xe7aram a acontecer e a hist\xf3ria se espalhava Brasil afora. Por v\xe1rias vezes, \xe0 noite, ao rezarem junto \xe0 imagem, as pessoas viam que as luzes se apagavam e depois acendiam misteriosamente. Ent\xe3o, todo o povo da vizinhan\xe7a passou a rezar aos p\xe9s da imagem. Constru\xedram um pequeno orat\xf3rio em Itagua\xe7u, que em pouco tempo j\xe1 n\xe3o comportava o grande n\xfamero de fieis que para l\xe1 acorria.O vig\xe1rio da cidade de Guaratinguet\xe1 resolveu construir uma capela no morro dos Coqueiros. As obras terminaram em julho de 1745. O filho de Filipe Pedroso ajudou a construir essa capela. No dia 20 de abril de 1822, o imperador Dom Pedro I, juntamente com uma grande comitiva, fizeram uma visita \xe0 capela para homenagear a imagem milagrosa da Senhora de Aparecida, como tamb\xe9m \xe9 conhecida. A quantidade de pessoas e romeiros que visitavam a imagem aumentava a cada dia. Por isso, em 1834, deram in\xedcio \xe0s obras da igreja que \xe9 conhecida hoje como Bas\xedlica Velha. Ela era bem maior que a capela e foi consagrada no dia 8 de dezembro do ano de 1888.\n\nEm sua segunda visita \xe0 bas\xedlica, feita no dia 6 de novembro de 1888, a Princesa Isabel ofereceu \xe0 santa uma bela coroa feita de ouro, enfeitada com rubis e diamantes. Era o cumprimento da promessa feita 20 anos antes, na primeira visita feita \xe0 imagem.\n\nO Papa Pio XI decreta Nossa Senhora da Concei\xe7\xe3o Aparecida como Rainha e Padroeira do Brasil no dia 16 de julho de 1930. A Lei Federal n\xba 6.802 (30/06/1980) decreta oficialmente o dia 12 de outubro como feriado nacional, dia de devo\xe7\xe3o \xe0 santa. Esta Lei Federal tamb\xe9m reconhece Maria como sendo a protetora do Brasil.\n\nO fen\xf4meno de Aparecida \xe9 impressionante. O n\xfamero de romeiros cresce, cresce, cresce. Milhares de gra\xe7as e milagres s\xe3o relatados ano ap\xf3s ano. Por isso, uma nova bas\xedlica, bem maior, come\xe7ou a ser constru\xedda em 1955 para acolher o numeroso fluxo de romeiros vindos de todo o pa\xeds. Benedito Calixto, o arquiteto respons\xe1vel pela obra, idealizou um edif\xedcio no formato da cruz grega. A igreja tem 168m de largura por 173m de comprimento. Suas naves chegam a 40m de altura e a c\xfapula central alcan\xe7a 70m de p\xe9 direito. \xc9 uma obra impressionante. No dia 4 de julho de 1980, numa celebra\xe7\xe3o eucar\xedstica solenemente conduzida pelo Papa Jo\xe3o Paulo II, a Bas\xedlica de Nossa Senhora Aparecida foi finalmente consagrada. O santu\xe1rio de Aparecida \xe9 a maior bas\xedlica do mundo dedicada \xe0 Maria M\xe3e de Deus.\n\n Fonte: Cruz Terra Santa",null)
B.Tp=new A.aV('Nossa Senhora de Guadalupe apareceu pela primeira vez ao \xedndio asteca Juan Diego. Na l\xedngua asteca, o nome Guadalupe significa, Perfeit\xedssima Virgem que esmaga a deusa de pedra. Os Astecas adoravam a deusa Quetzalcoltl, uma monstruosa deusa, a quem eram oferecidas vidas humanas em holocausto. Nossa Senhora de Guadalupe, por\xe9m, veio para acabar com essa idolatria e mudar a vida daquele povo sofrido. No ano de 1539, mais de 8 milh\xf5es de Astecas tinham abra\xe7ado a f\xe9 cat\xf3lica, convertendo-se e acabando com a idolatria pag\xe3. No M\xe9xico e em todo o mundo, Nossa Senhora de Guadalupe \xe9 muito venerada.\n\nEstava o \xedndio Juan Diego no campo. Ele sofria por causa da grava enfermidade de seu tio a quem muito amava. Juan rezava por seu tio quando teve a vis\xe3o de uma mulher com seu manto todo reluzente. Ela o chamou por seu nome e disse em nau\xe1tle, a l\xedngua asteca:\n\n"Juan Diego, n\xe3o deixe o seu cora\xe7\xe3o perturbado. Eu n\xe3o estou aqui? N\xe3o temas esta enfermidade ou ang\xfastia. Eu n\xe3o sou sua M\xe3e? Voc\xea n\xe3o esta sob minha prote\xe7\xe3o?"\n\nA Senhora pediu, ent\xe3o, que o \xedndio fosse revelar sua mensagem ao Bispo local. A mensagem de que Ela iria acabar com a serpente de pedra, e que o povo do M\xe9xico iria parar com os holocaustos e se converter a Jesus Cristo. Al\xe9m disso, deveria ser constru\xedda uma Igreja no local das apari\xe7\xf5es.\n\nO Bispo n\xe3o acreditou no \xedndio, mas ordenou que ele pedisse um sinal \xe0 Senhora para provar a veracidade da hist\xf3ria. Quando Juan Diego voltou para o campo, Nossa Senhora de Guadalupe apareceu novamente a ele. Este lhe contou sobre a desconfian\xe7a do Bispo, porque Maria tinha pedido que fosse constru\xedda tamb\xe9m uma grande igreja naquele local.\n\nMaria sorrindo, pediu a Juan Diego que subisse ao monte e enchesse seu poncho com flores. Era inverno. A neve recobria os campos. Naquela \xe9poca, n\xe3o nasciam flores naquela regi\xe3o do M\xe9xico. Juan Diego sabia disso. Por\xe9m, mesmo assim obedeceu. Chegando ao alto do monte em meio \xe0 neve, ele achou uma grande quantidade de flores cheias de grande beleza. Ele apanhou muitas flores, encheu seu poncho e foi lev\xe1-las ao Bispo.\n\nCom dificuldade Juan Diego foi recebido pelo Bispo. Ele tinha seu poncho ou sua Tilma, dobrado cheio de rosas. Ent\xe3o, ele abriu a tilma e as flores ca\xedram no ch\xe3o. Quando o Bispo viu, ainda n\xe3o acreditou. Ent\xe3o, para espanto de todos os que estavam na sala, no poncho do \xedndio estava estampada a bela imagem de Nossa Senhora de Guadalupe, como o \xedndio tinha revelado ao Bispo. Todos na sala acreditaram, inclusive o bispo. Desse momento em diante, tudo mudou.\n\nO fato causou grande como\xe7\xe3o em todo o povo mexicano. Logo foi constru\xedda uma grande Igreja no local indicado por Nossa Senhora e o poncho de Juan Diego com a imagem de Nossa Senhora de Guadalupe impressa foi levado para ser venerado. Guadalupe se tornou o grande Santu\xe1rio do M\xe9xico, e a devo\xe7\xe3o a Nossa Senhora de Guadalupe se estendeu por toda Am\xe9rica Latina. Em 1979, o Papa Jo\xe3o Paulo II consagrou Nossa Senhora de Guadalupe, como Padroeira da Am\xe9rica Latina.',null)
B.Tq=new A.aV("Na cidade de C\xe1ssia, perto de Sena, na Bas\xedlica dedicada a Santa Rita, se conserva a Rel\xedquia de um insigne Milagre Eucar\xedstico ocorrido em 1330. Um campon\xeas doente mandou chamar um sacerdote que lhe trouxesse a Comunh\xe3o.\n\nO sacerdote, pegou uma H\xf3stia consagrada e colocou-a entre as p\xe1ginas do seu Brevi\xe1rio e foi \xe0 casa do campon\xeas. Depois de confess\xe1-lo, abriu o livro para pegar a H\xf3stia, mas para a sua surpresa, viu que a Part\xedcula estava tingida de tanto sangue que chegou a molhar as duas p\xe1ginas entre as quais a H\xf3stia estava colocada. O sacerdote, confuso e arrependido, foi imediatamente a Sena, ao convento agostiniano para pedir um conselho ao padre Sim\xe3o Fidati oriundo de C\xe1ssia, conhecido por ser um santo var\xe3o.\n\nDepois que o padre escutou o relato do sacerdote, concedeu-lhe o perd\xe3o e pediu para ficar com as duas p\xe1ginas manchadas de sangue. Muitos Papas promoveram o culto da Rel\xedquia concedendo inclusive indulg\xeancias.\n\nEm 1687, ocorreu o ato de reconhecimento da Rel\xedquia do Milagre Eucar\xedstico de C\xe1ssia. Para essa ocasi\xe3o trouxeram do Convento de Santo Agostinho o texto de um antigo C\xf3dice que cont\xe9m v\xe1rias notas sobre o Prod\xedgio. Al\xe9m desse c\xf3dice, o epis\xf3dio \xe9 mencionado nos Estatutos Municipais de C\xe1ssia do ano de 1387, onde entre outras coisas, se ordenava que \u201ccada ano, na festa de Corpus Christi, o Prefeito, os Conselheiros e todo o povo de C\xe1ssia, se reunissem na Igreja de Santo Agostinho e segue o clero que deveria levar a vener\xe1vel Rel\xedquia do Sant\xedssimo Corpo de Cristo em prociss\xe3o pela cidade\u201d.\n\nNo ano de 1930, por ocasi\xe3o do sexto centen\xe1rio do evento, foi celebrado um Congresso Eucar\xedstico para toda a diocese de Norcia, foi ent\xe3o que inauguraram um precioso Ostens\xf3rio e publicaram toda a documenta\xe7\xe3o hist\xf3rica encontrada sobre o Milagre.",null)
B.Tr=new A.aV("Nossa Senhora em Lourdes e sua devo\xe7\xe3o come\xe7aram no dia 11 de fevereiro de 1858, na pequena vila de Lourdes, Fran\xe7a. Nesse dia, tr\xeas amigas foram buscar lenha na mata que ficava perto da vila: Bernadete Soubirus de 14 anos, sua irm\xe3 Marie Toinette de 11 anos e a amiga Jeane Abadie, de 12 anos.\n\nA caminho do rio Gave, passaram por uma gruta. Ali, Bernadete ouviu a voz de uma mulher chamando-a carinhosamente. A voz vinha de dentro da gruta. Curiosa e obediente, Bernadette entrou e viu a figura de uma jovem senhora vestida de branco, com uma faixa azul na cintura e um ros\xe1rio de contas de p\xe9rolas em sua m\xe3o.\n\nAs duas come\xe7aram a rezar juntas, e pouco depois, Maria desapareceu. Por um per\xedodo de cinco meses, Nossa Senhora de Lourdes apareceu para as tr\xeas meninas, sempre marcando o dia e a hora que iria aparecer para elas.\n\nA not\xedcia se espalhou e muitas pessoas foram \xe0 gruta no desejo de ver Nossa Senhora de Lourdes, mas s\xf3 as crian\xe7as viam, o que gerou muita desconfian\xe7a e d\xfavida na popula\xe7\xe3o. Muitas vezes Bernadete foi vitima de agress\xf5es e zombarias feitas pela popula\xe7\xe3o.\n\nO pr\xf3prio governo franc\xeas se envolveu na pol\xeamica e interditou a gruta por um determinado tempo. Nessa ocasi\xe3o. Bernadete, por\xe9m, fortalecida pela gra\xe7a de Deus, se manteve firme e insistia que Nossa Senhora pediu para que se constru\xedsse uma capela no local das apari\xe7\xf5es.\n\nTanto a popula\xe7\xe3o quanto a Igreja desconfiaram de Bernadete e das crian\xe7as que viam Nossa Senhora de Lourdes. E esta resist\xeancia come\xe7ou a ficar muito s\xe9ria. Por isso, Nossa Senhora, numa de suas \xfaltimas apari\xe7\xf5es, disse a Bernadete que fosse \xe0 gruta em determinado dia e hora e come\xe7asse a cavar o ch\xe3o com as pr\xf3prias m\xe3os. Bernadete obedeceu e no local onde ela cavou, come\xe7ou a brotar \xe1gua e nunca mais parou. E era sabido por todos que ali, era um lugar seco onde jamais tivera fonte de \xe1gua.\n\nAo saber da \xe1gua que brotou na gruta, o povo come\xe7ou a ir at\xe9 l\xe1 em busca de cura. Ent\xe3o, come\xe7aram a acontecer curas inexplic\xe1veis entre o povo que se banhava nas \xe1guas da gruta de Lourdes. Curas de pessoas deficientes f\xedsicas, parapl\xe9gicos e de enfermidades incur\xe1veis, confirmadas por m\xe9dicos e cientistas. As curas, ali\xe1s, nunca deixaram de acontecer em Lourdes at\xe9 hoje. Tanto que l\xe1 existe uma comiss\xe3o de m\xe9dicos pronta para avaliar e atestar se determinada cura foi ou n\xe3o um milagre.\n\nNo dia 18 de janeiro de 1862, Dom Laurence, bispo de Tarbes, deu a declara\xe7\xe3o oficial proclamando a posi\xe7\xe3o da Igreja diante dos acontecimentos de Lourdes: Inspirados pela Comiss\xe3o composta por s\xe1bios, doutores e experientes sacerdotes que questionaram a crian\xe7a, estudaram os fatos, examinaram tudo e pesaram todas as provas.\n\nChamamos tamb\xe9m a ci\xeancia, e estamos convencidos de que as apari\xe7\xf5es s\xe3o sobrenaturais e divinas, e que por consequ\xeancia, o que Bernadete viu foi a Sant\xedssima Virgem Maria. Nossas convic\xe7\xf5es s\xe3o baseadas no depoimento de Bernadete, mas, sobretudo, sobre os fatos que t\xeam acontecido, coisas que n\xe3o podem ser outra coisa sen\xe3o uma interven\xe7\xe3o divina.\n\nDepois que Nossa Senhora de Lourdes apareceu pela \xfaltima v\xeas, Bernadete ingressou na congrega\xe7\xe3o das Irm\xe3s de Caridade de Nevers. Ela estava com 22 anos e morreu aos 34 anos.\n\nUma das grandes revela\xe7\xf5es de Maria em Lourdes foi afirmar que Ela era a Imaculada Concei\xe7\xe3o, t\xedtulo que o Papa Pio IX havia dado a Maria 4 anos antes em Roma. Bernadete e as meninas n\xe3o tinham conhecimento disso. Esse t\xedtulo \xe9 um Dogma de F\xe9 da Igreja, uma verdade de f\xe9 que os cat\xf3licos acreditam.\n\nA grande mensagem de Nossa Senhora em Lourdes \xe9 uma mensagem de convers\xe3o e de penit\xeancia. Nossa Senhora chamou insistentemente que aqueles que est\xe3o distantes de Deus voltem para a casa do Pai, pois estamos num tempo de grandes dificuldades. Ora\xe7\xe3o do ter\xe7o, penit\xeancia e convers\xe3o, esta \xe9 a grande mensagem de Nossa Senhora Lourdes.\n\nNo ano de 1876 foi edificada a Bas\xedlica de Lourdes no local em que Maria havia aparecido. Um local que recebe anualmente milh\xf5es de peregrinos do mundo inteiro. Hoje este Santu\xe1rio est\xe1 em uma \xe1rea com v\xe1rias Igrejas e outras institui\xe7\xf5es constru\xeddas em torno da gruta.\n\nBernadete foi Canonizada pelo Papa Pio XI no dia 8 de dezembro do ano de 1933 e Lourdes tornou-se um dos maiores locais de visita\xe7\xe3o dos peregrinos do mundo todo.\n\nFonte: Cruz Terra Santa",null)
B.Ts=new A.aV('Nossa Senhora da Penha \xe9 o t\xedtulo da Virgem Maria que teve in\xedcio quando um monge franc\xeas chamado Sim\xe3o sonhou com uma imagem de Nossa Senhora que estava enterrada no alto de uma montanha de dif\xedcil acesso. A imagem estaria enterra ali por causa de uma guerra entre franceses e mu\xe7ulmanos. Os cat\xf3licos escondiam suas imagens para que elas n\xe3o fossem destru\xeddas pelos invasores isl\xe2micos. No sonho, a imagem aparecia cercada de luz e acenando para que ele fosse procur\xe1-la. Sim\xe3o procurou pela serra durante cinco anos, sem sucesso. Mas, ent\xe3o, num dia especial, teve a informa\xe7\xe3o de que a serra que ele descrevia chamava-se Penha de Fran\xe7a e ficava no norte da Espanha. Sim\xe3o Vela dirigiu-se para l\xe1 o mais r\xe1pido que pode.\n\nNo norte da Espanha havia uma serra muito alta e \xedngreme, com pontas de rochas no alto. A serra se chamava Penha de Fran\xe7a e ficava na prov\xedncia de Salamanca. Ali, acredita-se que o Rei Carlos Magno teria lutado contra a invas\xe3o dos mouros. \xc0 procura da imagem, Sim\xe3o caminhou tr\xeas dias e tr\xeas noites ininterruptamente. Ele fez isso porque, segundo sua pr\xf3pria narrativa, em seus \xeaxtases, ele ouvia sempre a advert\xeancia divina dizendo-lhe: "Sim\xe3o, vela e n\xe3o durma!" Por essa raz\xe3o ele passou a ser chamado de Sim\xe3o Vela.\n\nPassados os tr\xeas dias, j\xe1 exausto, escalando montanhas \xedngremes, Sim\xe3o parou para descansar. Nesse momento, ele viu uma formosa senhora com o filho ao colo sentada perto dele. Esta Senhora lhe indicou o lugar onde encontraria o que procurava. Assim, ajudado por alguns pastores da regi\xe3o, Sim\xe3o Vela conseguiu encontrar a imagem que tinha avistado em sonho. Foi um momento de profunda alegria e de reconhecimento da revela\xe7\xe3o divina. Emocionado e grato, Sim\xe3o Vela reconheceu tamb\xe9m que aquela Senhora que lhe revelara o lugar era, na verdade, Maria com Jesus em seu colo.\n\nSim\xe3o Vela construiu uma capelinha muito simples naquele local e come\xe7ou a viver ali, pensando que teria uma vida de monge, isolada e tranquila. O lugar, por\xe9m, logo ficou famoso pelo grande n\xfamero de milagres e gra\xe7as alcan\xe7adas por interm\xe9dio de Nossa Senhora da Penha, como passou a ser chamada a Virgem Maria por causa de sua apari\xe7\xe3o na serra Penha de Fran\xe7a. Sim\xe3o Vela n\xe3o poderia imaginar que, mais tarde, seria constru\xeddo um dos mais ricos e grandiosos templos da Cristandade em honra a Maria da Penha, o Santu\xe1rio de Nossa Senhora da Penha.\n\nPouco tempo depois da capelinha de Sim\xe3o Vela come\xe7ar a ficar famosa, a Espanha foi v\xedtima de uma grande peste que matou grande parte da popula\xe7\xe3o. O povo, apavorado, recorreu \xe0 interven\xe7\xe3o de Nossa Senhora da Penha e sem explica\xe7\xe3o a peste desapareceu. Mas, um tempo depois, a mesma praga come\xe7ou a fazer v\xedtimas em Portugal, que faz divisa com a Espanha. Assim, sabendo do acontecido na Espanha, o Senado da C\xe2mara de Lisboa prometeu \xe0 M\xe3e de Deus construir um grandioso templo, se ela livrasse o pa\xeds da mol\xe9stia. A epidemia extinguiu-se quase que imediatamente. Cumprindo a promessa, a C\xe2mara mandou construir um grandioso santu\xe1rio de louvor a Nossa Senhora da Penha na capital Lisboa.\n\nDevo\xe7\xe3o a Nossa Senhora da Penha chegou ao Brasil pelos colonizadores portugueses. A primeira capela em sua honra foi constru\xedda em Vila Velha, na antiga Capitania do Esp\xedrito Santo, entre 1558 e 1570. A constru\xe7\xe3o foi levada a frente por Frei Pedro Pal\xe1cios, um espanhol cheio de f\xe9 e devoto da santa. Depois foi erguida a Igreja da Penha do Iraj\xe1 (1635). Hoje o local \xe9 conhecido como Convento da Penha, dos franciscanos.\n\nNa cidade de S\xe3o Paulo foi erguida uma pequena capela em devo\xe7\xe3o a Nossa Senhora da Penha de Fran\xe7a em 1667 e, em volta dela e por causa dela, desenvolveu-se um dos bairros mais antigos, populosos e tradicionais da cidade: a Penha. Hoje, o local abriga a antiga igreja matriz na regi\xe3o conhecida por igreja velha e a Bas\xedlica de Nossa Senhora da Penha (conhecida por igreja nova), cuja pedra fundamental foi lan\xe7ada em 1957. As duas igrejas s\xe3o dedicadas a Nossa Senhora da Penha e sua festa \xe9 celebrada no dia 8 de setembro.\n\nCentenas de cidades do Brasil possuem igrejas dedicadas a Nossa Senhora da Penha. Normalmente, as igrejas dedicadas a ela s\xe3o edificadas no alto de colinas e morros, seguindo a origem da descoberta da imagem pelo Frei Sim\xe3o Vela: numa montanha.\n\nA Devo\xe7\xe3o \xe1 Nossa Senhora da Penha na cidade de Itapira, deu-se por conta de Jo\xe3o Gon\xe7alves de Morais, um dos fundadores da cidade, decidir derrubar a mata para constru\xe7\xe3o de uma capela para abrigar a imagem de Nossa Senhora da Penha, que recebera de heran\xe7a familiar, e proclamada padroeira da vila que haveria de se tornar em volta da capela, e posteriormente da cidade como nos dias atuais. Sua festa \xe9 celebrada em 08 de setembro, feriado municipal.\n\nFonte: Cruz Terra Santa',null)
B.Tt=new A.aV("Estudos realizados sobre o poncho do \xedndio Juan Diego, revelam que a pintura n\xe3o foi feita por materiais existentes na natureza e nem fabricados pelo homem. Nos olhos de Maria, dentro da Iris e da pupila, v\xea-se a cena em que o \xedndio abre sua tilma na sala do bispo, com todas as pessoas presentes na sala conforme foi descrito em documentos posteriores. Tem uma fam\xedlia de um lado, o \xedndio e o Bispo do outro. O olho reflete a luz como o olho humano.\n\nEm janeiro de 2001, o engenheiro peruano, Jos\xe9 Aste Tonsmman, revelou o resultado da pesquisa de 20 anos, com a ajuda da NASA. Os olhos da imagem ampliados 2,500 vezes, mostram umas 13 pessoas, crian\xe7as, mulheres, o Bispo e o pr\xf3prio \xedndio Juan Diego, no momento da entrega do poncho ao Bispo.\n\nRichard Kuhn, pr\xeamio Nobel de qu\xedmica, descobriu que a imagem n\xe3o tem corantes e que ap\xf3s 470 anos continuam com seu brilho. O pano do poncho n\xe3o dura mais do que 20 anos e come\xe7a a se desfazer, o que n\xe3o acontece com o poncho do milagre, que j\xe1 dura quase 500 anos. Conclu\xedram que o que forma a imagem de Nossa Senhora n\xe3o \xe9 pintura. A fibra do ayate, cacto, s\xe3o suportaria as tintas da \xe9poca. Al\xe9m disso, n\xe3o existe esbo\xe7o ou marca de pincel.\n\nAs muitas coisas absolutamente impressionantes da imagem de Nossa Senhora de Guadalupe, as estrelas no manto da Virgem, segundo os astr\xf4nomos, reproduzem sem tirar nem p\xf4r as constela\xe7\xf5es vis\xedveis no Vale do An\xe1huac no dia 12 de dezembro de 1531, exatamente na hora da apari\xe7\xe3o da santa \u2014 dia do solst\xedcio daquele ano, ou seja, no manto \xe9 reproduzido as posi\xe7\xf5es perfeitas das estrelas no c\xe9u daquele mesmo ano.\n\nNossa Senhora, em um ato de delicadeza, apareceu como uma \xedndia, morena, vestida como uma \xedndia gr\xe1vida. Em sua roupa est\xe1 retratado o c\xe9u com a posi\xe7\xe3o das estrelas do dia em que ela apareceu. Os astecas sabiam reconhecer estes sinais e isso foi decisivo para que a convers\xe3o daqueles povos acontecesse em massa.\n\nFonte: Cruz Terra Santa",null)
B.Tu=new A.aV("Um pequeno povoado de apenas 2.000 habitantes, situa-se na B\xe9lgica, denomina-se Beauraing. Nada o distingue de muitos outros povoados da zona. Nesse local, nossa M\xe3e celeste apareceu 33 vezes a cinco crian\xe7as, de 29-11-1932 a 3-1-1933, ou seja, quase todos os dias! Tais apari\xe7\xf5es foram reconhecidas pela Igreja em 1943. \xc9 uma das cinco apari\xe7\xf5es, ocorridas no s\xe9culo passado, reconhecidas oficialmente.\n\nAinda mais, 12 dias ap\xf3s a \xfaltima apari\xe7\xe3o em Beauraing, Nossa Senhora aparecer\xe1 oito vezes a uma menina, num outro povoado belga, a 80 quil\xf4metros de dist\xe2ncia do povoado anterior. Uma apari\xe7\xe3o tamb\xe9m reconhecida pela Igreja. Logo, n\xe3o \xe9 bom crit\xe9rio desqualificar uma apari\xe7\xe3o s\xf3 porque ocorreu v\xe1rias vezes e em locais pr\xf3ximos.\n\nUma caracter\xedstica da apari\xe7\xe3o de Beauraing \xe9 que Nossa Senhora fala pouco. V\xe1rias vezes n\xe3o diz nada, limita-se a sorrir para as crian\xe7as.\n\nAs meninas Gilberte e Andrea Degeimbre, \xf3rf\xe3s de 9 e 14 anos, acompanham Fernanda e Alberto Voisin, de 15 e 11 anos, que foram buscar, num pensionato de freiras, Gilberte Voisin, de 13 anos, irm\xe3 dos dois \xfaltimos. Os meninos brincavam, quando Alberto fica assustado e diz: \u201cOlhem, a Virgem vestida de branco est\xe1 caminhando sobre a ponte\u201d. As meninas olham e ficam tamb\xe9m muito assustadas. Batem com for\xe7a \xe0 porta do pensionato. Surgem uma freira \u2014 a irm\xe3 Valerie, que nada percebe \u2014 e Gilberte Voisin, que v\xea a apari\xe7\xe3o e fica tamb\xe9m muito assustada. Os meninos correm de volta \xe0 casa e contam a suas fam\xedlias o ocorrido. Estas n\xe3o acreditam. Ainda pior: a irm\xe3 mais velha das meninas Degeimbre, tomada de inveja, diz: \u201cVoc\xeas duas v\xeaem a Virgem? Se eu a tivesse visto, seria diferente... Mas, voc\xeas duas!?\u201d Dominada pelo despeito de nada ter visto, ela chegar\xe1 a caluniar suas irm\xe3s.\n\nChama muito a aten\xe7\xe3o nessa narra\xe7\xe3o o pouco que Nossa Senhora fala a estas crian\xe7as \u2014 fato que ser\xe1 utilizado como argumento principal pelos advers\xe1rios das apari\xe7\xf5es. Ap\xf3s os meninos indagarem \xe0 M\xe3e de Deus o que queria deles, Ela simplesmente respondeu: \u201cSejam sempre bons\u201d. No dia seguinte, Ela pergunta aos meninos: \u201cVoc\xeas ser\xe3o sempre bons, n\xe3o \xe9 verdade?\u201d. \u201cSim!\u201d \u2014 responderam enfaticamente.\n\nNo dia 30 de dezembro de 1932, ao mostrar seu Cora\xe7\xe3o, que parecia de ouro, a Virgem Sant\xedssima recomenda: \u201cRezai, rezai muito\u201d. No dia 1\xba de janeiro, apenas aconselha: \u201cRezai sempre\u201d. Na \xfaltima apari\xe7\xe3o, no dia 3 de janeiro, Ela falar\xe1 mais. E mesmo assim, ser\xe1 breve: \u201cEu converterei pecadores. Eu sou a M\xe3e de Deus, a Rainha do C\xe9u. Rezai sempre\u201d.\n\nCuriosamente, a Virgem Sant\xedssima, nesta derradeira apari\xe7\xe3o, revela tr\xeas segredos pessoais a tr\xeas dos videntes. O que revelou? Nada veio a p\xfablico.\n\nOutro aspecto digno de nota: os meninos viam Nossa Senhora com raios dourados em torno da cabe\xe7a, como se fosse uma coroa, s\xedmbolo de majestade. O que est\xe1 em conson\xe2ncia com a afirma\xe7\xe3o: \u201cSou a Rainha do C\xe9u\u201d.\n\nDesde o in\xedcio as apari\xe7\xf5es chamaram muito a aten\xe7\xe3o, e o interesse p\xfablico ia crescendo diariamente. No dia da \xfaltima apari\xe7\xe3o, havia uma multid\xe3o de 30.000 pessoas presentes. Entre elas, numerosos m\xe9dicos. Estes aproveitaram a ocasi\xe3o para fazer experi\xeancias, durante as apari\xe7\xf5es. Eles beliscaram os videntes, apertaram-lhes a pele, aproximaram fogo de suas m\xe3os, soltaram flashes incandescentes sobre os olhos, mas os videntes n\xe3o reagiram. N\xe3o ficaram marcas ou cicatrizes de tais experi\xeancias.\n\nOs videntes sofreram muita oposi\xe7\xe3o. Nem o sacerdote do local acreditava neles, e n\xe3o tinham nas adjac\xeancias a quem recorrer para os ajudar. Como at\xe9 parte da imprensa cat\xf3lica tentava negar os eventos miraculosos, sentiam-se rodeados por um desprezo geral. No in\xedcio, at\xe9 seus pais mostravam-se contr\xe1rios \xe0 veracidade das apari\xe7\xf5es. Muitos acusavam as crian\xe7as de mentirosas, pois esperavam que uma apari\xe7\xe3o da M\xe3e de Deus devesse ser necessariamente no estilo Hollywood, com milagres espetaculares e uma mensagem apocal\xedptica. A curiosidade geral encheu a loja dos Voisin. Mas logo eles perderam os fregueses, que n\xe3o podiam ou n\xe3o se atreviam a entrar na loja, que acabou tendo de ser fechada. Mas isto foi um fator para a convers\xe3o do pai, Hector Voisin, que abandonou o partido socialista e voltou a praticar a religi\xe3o.\n\nAlgumas pessoas perguntaram: por que Nossa Senhora apareceu para dizer t\xe3o pouca coisa, al\xe9m do mais, j\xe1 muito conhecida? Seria algo na linha de uma apari\xe7\xe3o \u201cordin\xe1ria\u201d, diferente de apari\xe7\xf5es \u201cfora de s\xe9rie\u201d, como as de Lourdes ou F\xe1tima?\n\nComo resposta, podemos lembrar, de in\xedcio, que a Virgem Sant\xedssima quis Ela mesma fazer apostolado, para nos ensinar que todo apostolado \xe9 santo, mesmo se dirigido a pessoas simples, e limitando-se a repetir doutrina j\xe1 conhecida.\n\nEm segundo lugar, a Religi\xe3o cat\xf3lica n\xe3o se caracteriza por sensacionalismos. \xc9 a Religi\xe3o da perseveran\xe7a em meio \xe0 vida cotidiana. Nunca uma apari\xe7\xe3o de Nossa Senhora \xe9 algo comum. Embora seja um acontecimento extraordin\xe1rio, uma apari\xe7\xe3o mariana pode ter por objeto, entretanto, reafirmar uma doutrina b\xe1sica da Igreja.\n\nEm terceiro lugar, a Sant\xedssima Virgem, com sua apari\xe7\xe3o, ressalta que Ela est\xe1 protegendo a n\xf3s, seus filhos. Nem sempre mediante palavras, mas sempre nos amparando. O que mais podemos desejar?\n\nAdemais, uma apari\xe7\xe3o de Nossa Senhora n\xe3o pode deixar de trazer consigo grandes gra\xe7as, seja para os videntes, seja para os que os rodeiam e mesmo para todo o mundo. Ela \xe9 a M\xe3e da divina gra\xe7a, que conduz sempre a seu Filho amant\xedssimo, Jesus.\n\nFonte: catolicismo.com.br",null)
B.Tv=new A.aV("Em meu livro anterior, Te\xf3filo, escrevi a respeito de tudo o que Jesus come\xe7ou a fazer e a ensinar, at\xe9 o dia em que foi elevado aos c\xe9us, depois de ter dado instru\xe7\xf5es por meio do Esp\xedrito Santo aos ap\xf3stolos que havia escolhido. Depois do seu sofrimento, Jesus apresentou-se a eles e deu-lhes muitas provas indiscut\xedveis de que estava vivo. Apareceu-lhes por um per\xedodo de quarenta dias falando-lhes acerca do Reino de Deus. Certa ocasi\xe3o, enquanto comia com eles, deu-lhes esta ordem: \u201cN\xe3o saiam de Jerusal\xe9m, mas esperem pela promessa de meu Pai, da qual lhes falei. Pois Jo\xe3o batizou com a \xe1gua, mas dentro de poucos dias voc\xeas ser\xe3o batizados com o Esp\xedrito Santo\u201d. Ent\xe3o os que estavam reunidos lhe perguntaram: \u201cSenhor, \xe9 neste tempo que vais restaurar o reino a Israel?\u201d Ele lhes respondeu: \u201cN\xe3o lhes compete saber os tempos ou as datas que o Pai estabeleceu pela sua pr\xf3pria autoridade. Mas receber\xe3o poder quando o Esp\xedrito Santo descer sobre voc\xeas, e ser\xe3o minhas testemunhas em Jerusal\xe9m, em toda a Jud\xe9ia e Samaria, e at\xe9 os confins da terra\u201d. Tendo dito isso, foi elevado \xe0s alturas enquanto eles olhavam, e uma nuvem o encobriu da vista deles. E eles ficaram com os olhos fixos no c\xe9u enquanto ele subia. De repente surgiram diante deles dois homens vestidos de branco, que lhes disseram: \u201cGalileus, por que voc\xeas est\xe3o olhando para o c\xe9u? Este mesmo Jesus, que dentre voc\xeas foi elevado aos c\xe9us, voltar\xe1 da mesma forma como o viram subir\u201d.",null)
B.Tw=new A.aV("Naqueles tempos, apareceu um decreto de C\xe9sar Augusto, ordenando o recenseamento de toda a terra. Esse recenseamento foi feito antes do governo de Quirino, na S\xedria. Todos iam alistar-se, cada um na sua cidade. Tamb\xe9m Jos\xe9 subiu da Galileia, da cidade de Nazar\xe9, \xe0 Judeia, \xe0 Cidade de Davi, chamada Bel\xe9m, porque era da casa e fam\xedlia de Davi, para se alistar com a sua esposa, Maria, que estava gr\xe1vida. Estando eles ali, completaram-se os dias dela. E deu \xe0 luz seu filho primog\xeanito, e, envolvendo-o em faixas, reclinou-o num pres\xe9pio; porque n\xe3o havia lugar para eles na hospedaria. Havia nos arredores uns pastores, que vigiavam e guardavam seu rebanho nos campos durante as vig\xedlias da noite. Um anjo do Senhor apareceu-lhes e a gl\xf3ria do Senhor refulgiu ao redor deles, e tiveram grande temor. O anjo disse-lhes: \u201cN\xe3o temais, eis que vos anuncio uma Boa-Nova que ser\xe1 alegria para todo o povo: hoje vos nasceu na Cidade de Davi um Salvador, que \xe9 o Cristo Senhor. Isto vos servir\xe1 de sinal: achareis um rec\xe9m-nascido envolto em faixas e posto numa manjedoura\u201d. E subitamente ao anjo se juntou uma multid\xe3o do ex\xe9rcito celeste, que louvava a Deus e dizia: \u201cGl\xf3ria a Deus no mais alto dos c\xe9us e na terra paz aos homens, objetos da benevol\xeancia divina.\u201d Depois que os anjos os deixaram e voltaram para o c\xe9u, falaram os pastores uns com os outros: \u201cVamos at\xe9 Bel\xe9m e vejamos o que se realizou e o que o Senhor nos manifestou\u201d. Foram com grande pressa e acharam Maria e Jos\xe9, e o menino deitado na manjedoura. Vendo-o, contaram o que se lhes havia dito a respeito deste menino. Todos os que os ouviam admiravam-se das coisas que lhes contavam os pastores. Maria conservava todas essas palavras, meditando-as no seu cora\xe7\xe3o. Voltaram os pastores, glorificando e louvando a Deus por tudo o que tinham ouvido e visto, e que estava de acordo com o que lhes fora dito. Completados que foram os oito dias para ser circuncidado o menino, foi-lhe posto o nome de Jesus, como lhe tinha chamado o anjo, antes de ser concebido no seio materno.",null)
B.Tx=new A.aV("Este milagre Eucar\xedstico aconteceu no dia de P\xe1scoa (28 mar\xe7o 1171), na Bas\xedlica de Santa Maria, em Vado, Ferrara. Propagava-se com perigo a heresia de Bereng\xe1rio de Tours (\u20201088), que negava a presen\xe7a real de Cristo na Eucaristia. O Padre Pietro da Verona, prior da Bas\xedlica, celebrava a Santa Missa da Ressurrei\xe7\xe3o. No momento de distribuir o p\xe3o consagrado, quando partiu a H\xf3stia, viu jorrar desta uma grande quantidade de sangue que foi atingir a pequena ab\xf3bada acima do altar. A ab\xf3bada manchada de sangue foi encerrada, em seguida, num templo constru\xeddo em 1595, e \xe9 ainda hoje, vis\xedvel na monumental Bas\xedlica de S. Maria inVado.\n\nForam muitos os testemunhos que afirmaram ter visto a H\xf3stia assumir uma cor sangu\xednea e de ter distinguido nela a figura de um menino. Do acontecido, foram informados imediatamente o Bispo Amato de Ferrara e o Arcebispo Gerardo de Ravenna, os quais constataram com os seus pr\xf3prios olhos o Sangue persistente do Milagre, isto \xe9, \u201co Sangue viv\xedssimo, que avermelhava a ab\xf3bada acima do altar\u201d. A igreja tornou-se imediatamente meta de peregrina\xe7\xe3o, e veio sendo sucessivamente reestruturada e ampliada por ordem do Duque Ercole I, a partir de 1495.\n\nNumerosas s\xe3o as testemunhas que lembram o Milagre, entre estas, a mais importante \xe9 a Bula de Papa Eug\xe9nio IV (30 mar\xe7o 1442), na qual o Pont\xedfice menciona o Prod\xedgio referindo-se ao testemunhado pelos fi\xe9is e a antigas fontes hist\xf3ricas.\n\nO manuscrito de Gerardo Cambrense \xe9 o documento mais antigo (1197) que menciona o Pr\xf3digo e est\xe1 conservado na Biblioteca Lamberthiana de Canterbury. Este, foi recentemente retomado pelo historiador Ant\xf3nio Samaritani, numa obra intitulada \u201cGemma Eclesiastica\u201d. Um outro documento, que remonta a 6 de mar\xe7o de 1404, \xe9 a Bula do Cardinal Migliorati, na qual se concedem as indulg\xeancias a \u201cquem visite a igreja e renda homenagem ao Sangue Prodigioso\u201d.\n\nAinda hoje, o dia 28 de cada m\xeas na Bas\xedlica, atualmente oficiada pelos Mission\xe1rios do Precios\xedssimo Sangue de S. Gaspar de B\xfafalo, se pratica a Adora\xe7\xe3o Eucar\xedstica em mem\xf3ria do milagre e, a cada ano, em prepara\xe7\xe3o da festa do \u201cCorpus Christi\u201d, se celebram as solenes Quarenta Horas. No ano de 1971, foi celebrado o oitavo centen\xe1rio do Milagre.",null)
B.Ty=new A.aV("Conclu\xeddos os dias da sua purifica\xe7\xe3o segundo a Lei de Mois\xe9s, levaram-no a Jerusal\xe9m para o apresentar ao Senhor, conforme o que est\xe1 escrito na Lei do Senhor: \u201cTodo primog\xeanito do sexo masculino ser\xe1 consagrado ao Senhor\u201d (Ex 13,2); e para oferecerem o sacrif\xedcio prescrito pela Lei do Senhor, um par de rolas ou dois pombinhos. Ora, havia em Jerusal\xe9m um homem chamado Sime\xe3o. Esse homem, justo e piedoso, esperava a consola\xe7\xe3o de Israel, e o Esp\xedrito Santo estava nele. Fora-lhe revelado pelo Esp\xedrito Santo que n\xe3o morreria sem primeiro ver o Cristo do Senhor. Impelido pelo Esp\xedrito Santo, foi ao templo. E tendo os pais apresentado o menino Jesus, para cumprirem a respeito dele os preceitos da Lei, tomou-o em seus bra\xe7os e louvou a Deus nestes termos: \u201cAgora, Senhor, deixai o vosso servo ir em paz, segundo a vossa palavra. Porque os meus olhos viram a vossa salva\xe7\xe3o que preparastes diante de todos os povos, como luz para iluminar as na\xe7\xf5es, e para a gl\xf3ria de vosso povo de Israel\u201d. Seu pai e sua m\xe3e estavam admirados das coisas que dele se diziam. Sime\xe3o aben\xe7oou-os e disse a Maria, sua m\xe3e: \u201cEis que este menino est\xe1 destinado a ser uma causa de queda e de soerguimento para muitos homens em Israel, e a ser um sinal que provocar\xe1 contradi\xe7\xf5es, a fim de serem revelados os pensamentos de muitos cora\xe7\xf5es. E uma espada transpassar\xe1 a tua alma\u201d. Havia tamb\xe9m uma profetisa chamada Ana, filha de Fanuel, da tribo de Aser; era de idade avan\xe7ada. Depois de ter vivido sete anos com seu marido desde a sua virgindade, ficara vi\xfava e agora, com oitenta e quatro anos, n\xe3o se apartava do templo, servindo a Deus noite e dia em jejuns e ora\xe7\xf5es. Chegando ela \xe0 mesma hora, louvava a Deus e falava de Jesus a todos aqueles que em Jerusal\xe9m esperavam a liberta\xe7\xe3o.",null)
B.Tz=new A.aV("Os soldados do governador conduziram Jesus para o pret\xf3rio e rodearam-no com todo o pelot\xe3o. Arrancaram-lhe as vestes e colocaram-lhe um manto escarlate. Depois, tran\xe7aram uma coroa de espinhos, meteram-lha na cabe\xe7a e puseram-lhe na m\xe3o uma vara. Dobrando os joelhos diante dele, diziam com esc\xe1rnio: \u201cSalve, rei dos judeus!\u201d. Cuspiam-lhe no rosto e, tomando da vara, davam-lhe golpes na cabe\xe7a. Depois de escarnecerem dele, tiraram-lhe o manto e entregaram-lhe as vestes. Em seguida, levaram-no para o crucificar.",null)
B.TA=new A.aV("Mas isso foi mudando e na terceira apari\xe7\xe3o prometeu um milagre para que o povo acreditasse nas crian\xe7as. E na \xfaltima apari\xe7\xe3o, em 13 de outubro, o milagre aconteceu. Haviam com eles mais de 70.000 pessoas e em meio a multid\xe3o, do meio das nuvens negras, o sol surgiu e come\xe7ou a girar sobre si mesmo como se fosse uma imensa bola de fogo.\n\nE foi tamb\xe9m nessa \xfaltima apari\xe7\xe3o que Nossa Senhora de F\xe1tima revelou ser a \u201cSenhora do Ros\xe1rio\u201d e pediu que ali fosse constru\xedda uma capela em sua homenagem.\n\nNa terceira apari\xe7\xe3o de Nossa Senhora de F\xe1tima foi revelado a L\xfacia um Segredo constitu\xeddo por tr\xeas partes que seriam reveladas posteriormente nas demais apari\xe7\xf5es. S\xe3o eles, nas pr\xf3prias palavras de L\xfacia:\n\n1\xaa parte - A vis\xe3o do Inferno\n\u201cNossa Senhora mostrou-nos um grande mar de fogo que parecia estar debaixo da terra. Mergulhados em esse fogo, os dem\xf3nios e as almas, como se fossem transparentes e negras ou bronzeadas, com forma humana, que flutuavam no inc\xeandio levadas pelas chamas que delas mesmas sa\xedam juntamente com nuvens de fumo, caindo para todos os lados, semelhante ao cair das fa\xfalhas em grandes inc\xeandios, sem peso nem equil\xedbrio, entre gemidos e gritos de dor e desespero que horrorizava e fazia estremecer de pavor.\n\nOs dem\xf3nios distinguiam-se por formas horr\xedveis e asquerosas de animais espantosos e desconhecidos, mas transparente e negros.\n\nEsta vista foi um momento, e gra\xe7as \xe0 nossa boa M\xe3e do C\xe9u, que antes nos tinha prevenido com a promessa de nos levar para o C\xe9u (na primeira apari\xe7\xe3o)! Se assim n\xe3o fosse, creio que ter\xedamos morrido de susto e pavor\u201d.\n\n2\xaa parte - Devo\xe7\xe3o ao Imaculado Cora\xe7\xe3o de Maria\n\u201cNossa Senhora me disse que nunca me deixaria e que Seu Imaculado Cora\xe7\xe3o seria o meu ref\xfagio e o caminho que me conduziria a Deus.Que foi ao dizer estas palavras que abriu as m\xe3os, fazendo-nos penetrar no peito o reflexo que delas expedia.\n\nParece-me que, em este dia, este reflexo teve por fim principal infundir em n\xf3s um conhecimento e amor especial para com o Cora\xe7\xe3o Imaculado de Maria; assim como das outras duas vezes o teve, me parece, a respeito de Deus e do mist\xe9rio da Sant\xedssima Trindade. Desde esse dia, sentimos no cora\xe7\xe3o um amor mais ardente pelo Cora\xe7\xe3o Imaculado de Maria\u201d.\n\n3\xaa parte - A \xfaltima revela\xe7\xe3o do Segredo\n\u201cDepois das duas partes que j\xe1 expus, vimos ao lado esquerdo de Nossa Senhora um pouco mais alto um Anjo com uma espada de f\xf4go em a m\xe3o esquerda; ao centilar, despia chamas que parecia iam incendiar o mundo; mas apagavam-se com o contacto do brilho que da m\xe3o direita expedia Nossa Senhora ao seu encontro:\n\nO Anjo apontando com a m\xe3o direita para a terra, com voz forte disse: Penit\xeancia, Penit\xeancia, Penit\xeancia! E vimos numa luz emensa que \xe9 Deus: \u201calgo semelhante a como se vem as pessoas num espelho quando lhe passam por diante\u201d um Bispo vestido de branco \u201ctivemos o pressentimento de que era o Santo Padre\u201d.\n\nV\xe1rios outros Bispos, Sacerdotes, religiosos e religiosas subir uma escabrosa montanha, no cimo da qual estava uma grande Cruz de troncos toscos como se f\xf4ra de sobreiro com a casca; o Santo Padre, antes de chegar a\xed, atravessou uma grande cidade meia em ru\xednas, e meio tr\xe9mulo com andar vacilante, acabrunhado de d\xf4r e pena, ia orando pelas almas dos cad\xe1veres que encontrava pelo caminho; chegado ao cimo do monte, prostrado de joelhos aos p\xe9s da grande Cruz foi morto por um grupo de soldados que lhe dispararam v\xe1rios tiros e setas, e assim mesmo foram morrendo uns tr\xe1s outros os Bispos, Sacerdotes, religiosos e religiosas e varias pessoas seculares, cavalheiros e senhoras de v\xe1rias classes e posi\xe7\xf5es. Sob os dois bra\xe7os da Cruz estavam dois Anjos cada um com um regador de cristal em a m\xe3o, neles recolhiam o sangue dos M\xe1rtires e com ele regavam as almas que se aproximavam de Deus.\u201d\n\nA mensagem que fica e continua sendo atual at\xe9 mesmo nos dias de hoje \xe9 que Nossa Senhora de F\xe1tima veio nos lembrar que Deus existe, nos ama e pode nos salvar desse mundo devastado pela guerra e pela fome. Devemos ter f\xe9 e sempre lembrar de suas palavras quando tudo parecer perdido ou sem solu\xe7\xe3o.\n\nFonte: Nossa Sagrada F\xe1milia\nCan\xe7\xe3o Nova",null)
B.TB=new A.aV("Tr\xeas dias depois, celebravam-se bodas em Can\xe1 da Galileia, e achava-se ali a m\xe3e de Jesus. Tamb\xe9m foram convidados Jesus e os seus disc\xedpulos. Como viesse a faltar vinho, a m\xe3e de Jesus disse-lhe: \u201cEles j\xe1 n\xe3o t\xeam vinho\u201d. Respondeu-lhe Jesus: \u201cMulher, isso compete a n\xf3s? Minha hora ainda n\xe3o chegou\u201d. Disse, ent\xe3o, sua m\xe3e aos serventes: \u201cFazei o que ele vos disser\u201d. Ora, achavam-se ali seis talhas de pedra para as purifica\xe7\xf5es dos judeus, que continham cada qual duas ou tr\xeas medidas. Jesus ordena-lhes: \u201cEnchei as talhas de \xe1gua\u201d. Eles encheram-nas at\xe9 em cima. \u201cTirai agora\u201d \u2013 disse-lhes Jesus \u2013 \u201ce levai ao chefe dos serventes\u201d. E levaram. Logo que o chefe dos serventes provou da \xe1gua tornada vinho, n\xe3o sabendo de onde era (se bem que o soubessem os serventes, pois tinham tirado a \xe1gua), chamou o noivo e disse-lhe: \u201c\xc9 costume servir primeiro o vinho bom e, depois, quando os convidados j\xe1 est\xe3o quase embriagados, servir o menos bom. Mas tu guardaste o vinho melhor at\xe9 agora\u201d. Esse foi o primeiro milagre de Jesus; realizou-o em Can\xe1 da Galileia. Manifestou a sua gl\xf3ria, e os seus disc\xedpulos creram nele.",null)
B.TC=new A.aV('A hist\xf3ria de Nossa Senhora das Gra\xe7as come\xe7a, na verdade, fora do tempo, quando o Pai, nos seus mais altos des\xedgnios, planejou a encarna\xe7\xe3o de seu Filho Jesus, no seio da humanidade. Nesse momento, o Pai tamb\xe9m pensou em Maria, pois, seu Filho teria que ter uma m\xe3e humana. E a m\xe3e do Salvador teria que ser \u201ccheia de gra\xe7a\u201d. E assim aconteceu. A hist\xf3ria come\xe7ou, o mundo foi criado, o homem decaiu e Deus prometeu o Salvador. Por isso, Ele preparou Maria. Tanto que, quando o Anjo Gabriel apareceu para anunciar que ela seria a M\xe3e de Jesus, afirmou que ela era \u201ccheia de gra\xe7a\u201d. (Lucas 1, 28)\n\nEm seguida, quando Maria disse o seu \u201csim\u201d a Deus, diante do mesmo Anjo Gabriel, ela passou a ser portadora da maior de todas as gra\xe7as que a humanidade poderia receber: o pr\xf3prio Filho de Deus. Gerando Jesus para o mundo, Maria proporcionou que todas a gra\xe7as chegassem at\xe9 n\xf3s.\n\nDesde o in\xedcio da Igreja, Maria sempre foi vista como \u201cportadora das gra\xe7as\u201d. Por\xe9m, o t\xedtulo \u201cNossa Senhor das Gra\xe7as\u201d surgiu num determinado tempo da hist\xf3ria e num local espec\xedfico. Estamos falando das 17 horas e 30 minutos do dia 27 de novembro de 1830, na Rua Du Bac, 140, em Paris, Fran\xe7a. Neste local e data especificados, Catarina Labour\xe9, ent\xe3o novi\xe7a da Congrega\xe7\xe3o de S\xe3o Vicente de Paulo, foi at\xe9 \xe0 capela impelida para rezar. Estando em ora\xe7\xe3o, teve uma vis\xe3o da Virgem Maria, que se revelou a ela como Nossa Senhora das Gra\xe7as.\n\nE tal revela\xe7\xe3o n\xe3o aconteceu somente por palavras. Nossa Senhora deu a Catarina Labour\xe9 uma vis\xe3o reveladora. Vejamos o relato da pr\xf3pria Catarina que, depois, se tornou santa:\n\n"...uma Senhora de mediana estatura, de rosto muito belo e formoso... Estava de p\xe9, com um vestido de seda, cor de branco-aurora. Cobria-lhe a cabe\xe7a um v\xe9u azul, que descia at\xe9 os p\xe9s... As m\xe3os estenderam-se para a terra, enchendo-se de an\xe9is cobertos de pedras preciosas. A Sant\xedssima Virgem disse-me: \u2018Eis o s\xedmbolo das Gra\xe7as que derramo sobre todas as pessoas que mas pedem ...\u2019 Formou-se ent\xe3o, em volta de Nossa Senhora, um quadro oval, em que se liam, em letras de ouro, estas palavras: \u2018\xd3 Maria concebida sem pecado, rogai por n\xf3s, que recorremos a V\xf3s\u2019.\n\n Depois disso o quadro que eu via virou-se, e eu vi no seu reverso: a letra M, tendo uma cruz na parte de cima, com um tra\xe7o na base. Por baixo: os Sagrados Cora\xe7\xf5es de Jesus e de Maria. O de Jesus, cercado por uma coroa de espinhos e a arder em chamas, e o de Maria tamb\xe9m em chamas e atravessado por uma espada, cercado de doze estrelas. Ao mesmo tempo, ouvi distintamente a voz da Senhora, a dizer-me: \u2018Manda, manda cunhar uma medalha por este modelo. As pessoas que a trouxeram, com devo\xe7\xe3o, h\xe3o de receber muitas gra\xe7as\u201d.\n\nEnquanto contemplava esta cena maravilhosa, Maria sobre o globo terrestre e raios saindo de suas m\xe3os em dire\xe7\xe3o \xe0 terra, Catarina ouviu uma voz a lhe dizer:\n\n"Este globo que v\xeas representa o mundo inteiro e especialmente a Fran\xe7a, e cada pessoa em particular. Os raios s\xe3o o s\xedmbolo das Gra\xe7as que derramo sobre as pessoas que Me as pedem. Os raios mais espessos correspondem \xe0s gra\xe7as que as pessoas se recordam de pedir. Os raios mais finos correspondem \xe0s gra\xe7as que as pessoas n\xe3o se lembram de pedir."',null)
B.TD=new A.aV('As L\xe1grimas escorrem do rosto da imagem de Nossa Senhora de Akita no Jap\xe3o.\n\nNo dia 29 de setembro, a imagem irradiou raios luminosos. A chaga da irm\xe3 Agnes desapareceu totalmente. De noite, a imagem foi inundada de luz e o sangue jorrou dos seus p\xe9s; todas as religiosas foram testemunhas.\n\nUm anjo disse:\n\n"Maria derrama sangue, ela est\xe1 muito triste."\n\nDepois, apareceu uma esp\xe9cie de suor em todo o corpo da imagem e, ao mesmo tempo, a capela ficou cheia dum agrad\xe1vel perfume. Este perfume permaneceu durante os primeiros 15 dias do m\xeas de outubro (m\xeas do santo Ros\xe1rio).\n\nTerceira Mensagem (dia 13 outubro de 1973.)\n\n\u201cMinha querida filha, ou\xe7a bem ao que eu tenho a lhe dizer. Voc\xea ir\xe1 informar seu superior.\u201d\n\nAp\xf3s um curto sil\xeancio:\n\n\u201dComo eu lhe disse, se os homens n\xe3o se arrependerem e melhorarem, o Pai ir\xe1 infligir uma terr\xedvel puni\xe7\xe3o a toda a humanidade. Ser\xe1 uma puni\xe7\xe3o maior do que o dil\xfavio, tal como nunca se viu antes. Fogo ir\xe1 cair do c\xe9u e vai eliminar uma grande parte da humanidade; os bons assim como os maus, sem poupar nem sacerdotes nem fi\xe9is. Os sobreviventes ir\xe3o ver-se t\xe3o desolados que ir\xe3o invejar os mortos.\n\nAs \xfanicas armas que ir\xe3o restar para voc\xeas ser\xe3o o Ros\xe1rio e o Sinal deixado pelo Meu Filho. Recitem todos os dias as ora\xe7\xf5es do Ros\xe1rio. Com o Ros\xe1rio, rezem pelo Papa, os bispos e os sacerdotes.\n\nA obra do maligno vai infiltrar-se at\xe9 mesmo dentro da Igreja de tal modo que se ver\xe3o cardeais opondo-se a cardeais, bispos contra bispos.\n\nOs sacerdotes que me veneram ser\xe3o desprezados e combatidos pelos seus confrades... igrejas e altares saqueados. A Igreja ficar\xe1 cheia daqueles que aceitam compromissos, e o dem\xf4nio, vai pressionar muitos sacerdotes e almas consagradas a deixarem o servi\xe7o do Senhor.\n\nO dem\xf4nio vai ser especialmente implac\xe1vel contra as almas consagradas a Deus. O pensamento da perda de tantas almas \xe9 a causa de minha tristeza. Se os pecados aumentarem em n\xfamero e gravidade, n\xe3o haver\xe1 mais perd\xe3o para eles. Com coragem, fale ao seu superior. Ele saber\xe1 como encorajar cada uma de voc\xeas a rezar e fazer obras de repara\xe7\xe3o."\n\nEla sorriu e ent\xe3o disse:\n\n"Voc\xea ainda tem algo a perguntar? Hoje \xe9 a \xfaltima vez que eu vou falar com voc\xea em viva voz. De agora em diante voc\xea ir\xe1 obedecer aquele que foi enviado para voc\xea e seu superior. Reze muito as ora\xe7\xf5es do Ros\xe1rio.\n\nEu sozinha ainda sou capaz de salvar voc\xeas das calamidades que se aproximam. Aqueles que colocarem sua confian\xe7a em mim ser\xe3o salvos."\n\nA 13 outubro 1974, durante a B\xean\xe7\xe3o do Sant\xedssimo Sacramento, a irm\xe3 Agnes foi repentinamente curada da surdez. De noite, ela telefonou ao bispo respons\xe1vel, Dom John Shojiro Ito, em Niigata (a 300 km) comunicando-lhe a not\xedcia.\n\nAt\xe9 15 setembro 1981, portanto, durante 6 anos e 9 meses, a Sant\xedssima Virgem chorou 101 vezes. O Bispo Dom John Shojiro Ito estabeleceu uma Comiss\xe3o de Estudos. Amostras do "sangue", do "suor" e das "l\xe1grimas" foram examinadas nas Universidades de Akita e Gifu.\n\nConclus\xe3o: s\xe3o l\xe1grimas humanas e o sangue pertence ao grupo sang\xfc\xedneo "O".\n\nEm 1975, a Imprensa, R\xe1dio e TV japonesas, fizeram ampla divulga\xe7\xe3o. Na vila japonesa de Akita, uma est\xe1tua da M\xe3e, de acordo com o testemunho de mais de 500 crist\xe3os e n\xe3o-crist\xe3os, incluindo o prefeito da cidade, budista, exalou sangue, suor e l\xe1grimas. Uma religiosa, Agnes Katsuko Sasagawa recebeu os estigmas e tamb\xe9m recebeu mensagens de Nossa Senhora.\n\nA Igreja aprovou as mensagens e as lacrima\xe7\xf5es da est\xe1tua como sobrenaturais e em abril de 1984: O Reverend\xedssimo John Shojiro Ito, Bispo de Niigata, Jap\xe3o, ap\xf3s anos de investiga\xe7\xf5es, ap\xf3s consulta com a Santa S\xe9 de extensas investiga\xe7\xf5es, declarou que os eventos de Akita, Jap\xe3o s\xe3o de origem sobrenatural, e autorizou para toda a diocese a venera\xe7\xe3o da Sant\xedssima M\xe3e de Akita.\n\nEsta mensagem: pede muita ora\xe7\xe3o; convida a uma urgente convers\xe3o; ensina que o pecado \xe9 uma realidade, \xe9 o grande mal; pede a Reza di\xe1ria do Ros\xe1rio; aumenta nossa f\xe9, confian\xe7a e amor \xe0 querida M\xe3e do C\xe9u, nossa grande protetora e intercessora.\n\nEm junho de 1988, Cidade do Vaticano: Joseph Cardeal Ratzinger, Prefeito da Congrega\xe7\xe3o para a Doutrina da F\xe9, proferiu julgamento definitivo sobre os eventos e mensagens de Akita como confi\xe1veis e dignos de f\xe9. A mensagem de Nossa Senhora revelada em Akita no Jap\xe3o em 1973 a toda humanidade \xe9 forte, por\xe9m, vem mais uma vez recordar e atualizar o que Nosso Senhor nos diz no Evangelho: "Se n\xe3o vos converterdes, perecereis todos do mesmo modo." (Lc 13,5)\n\nN\xe3o nos esque\xe7amos, por\xe9m, de que a Virgem Sant\xedssima promete especial prote\xe7\xe3o para os que confiarem na Sua poderosa intercess\xe3o, como nos garantiu em F\xe1tima (Portugal, 1917):\n\n"Por fim, o Meu Imaculado Cora\xe7\xe3o Triunfar\xe1!"\n\nFonte: derradeirasgracas.com',null)
B.TE=new A.aV('Em Lanciano, no ano de 1273, uma mulher chamada Ricciarela querendo reconquistar o amor do seu esposo Giacomo Stasio, procurou uma bruxa da cidade quem lhe aconselhou roubar uma H\xf3stia Consagrada, coloc\xe1-la no fogo e depois que a H\xf3stia tivesse sido reduzida a p\xf3, a espalhasse na comida do marido. Mas, quando a H\xf3stia foi ao fogo, converteu-se em carne. Ricciarella, amedrontada, pegou uma toalha de linho e envolveu a telha que continha a H\xf3stia e enterrou-a no est\xe1bulo do marido.\n\nCome\xe7aram, ent\xe3o, a passar coisas estranhas: a mula de Giacomo todas as vezes que entrava no est\xe1bulo se prostrava na dire\xe7\xe3o do lugar onde a H\xf3stia estava enterrada, parecia at\xe9 que queria ador\xe1-la. Giacomo come\xe7ou a pensar que a esposa tivesse enfeiti\xe7ado a besta. Sete anos depois, Ricciarella, cheia de remorsos, confessou o seu sacril\xe9gio ao frade Giacomo Diotallevi, nativo de Offida, Prior do convento de Santo Agostinho em Lanciano. \u201cMatei Deus! Matei Deus!", gritava a mulher aos prantos. Depois de escutar toda a hist\xf3ria, o frade foi ao est\xe1bulo e viu que as Rel\xedquias envolvidas no len\xe7o estavam intactas.\n\nDe acordo com uma antiga cr\xf4nica, para conservar a Sacra H\xf3stia, os membros da cidade de Offida, decidiram construir um relic\xe1rio em forma de Cruz. Frei Michele Mallicani e um irm\xe3o foram a Veneza e quando chegaram na cidade, fizeram que um menino jurasse que n\xe3o contaria a ningu\xe9m o que iria ver e colocar na cruz. Quando o menino segurou a copa com a H\xf3stia milagrosa, de repente sentiu-se febril e exclamou: \u201cQue coisa me trouxestes, meu bom frade!\u201d\n\nO religioso, ent\xe3o perguntou se ele estava em pecado mortal, o menino respondeu que sim e se confessou naquele mesmo momento. A febre ent\xe3o desapareceu e sem problemas segurou a copa, pegou a H\xf3stia e a guardou junto ao Sagrado Madeiro na cruz, como se v\xea claramente ainda hoje. Os relic\xe1rios da telha e do len\xe7o manchado de sangue com a Cruz que cont\xe9m a H\xf3stia milagrosa est\xe3o expostos na Igreja de Santo Agostinho em Offida. A casa de Ricciarella em Lanciano foi transformada numa pequena capela.',null)
B.TF=new A.aV("O milagre eucar\xedstico de Buenos Aires \xe9 bastante recente e chama a aten\xe7\xe3o por ter sido registrado em fotos e relatos profissionais para que n\xe3o se perdesse no tempo. Aconteceu em 1996. Uma h\xf3stia teria sido encontrada por uma fiel ao final da distribui\xe7\xe3o da Sagrada Comunh\xe3o em uma igreja no centro comercial de Buenos Aires. Estava descartada em um candelabro. O descarte foi comunicado ao padre respons\xe1vel pela missa, que encontrou a comunh\xe3o e a armazenou em uma tigela com \xe1gua, esperando sua dissolu\xe7\xe3o. Passado um dia, ao verificar a h\xf3stia, o sacerdote percebeu que, em seu lugar, havia uma subst\xe2ncia com sangue.\n\nA subst\xe2ncia ficou, durante anos, guardada em segredo. Afinal, era suposto que ela iria se decompor. Mas nada aconteceu. Por isso, o ent\xe3o Cardeal Jorge Bergoglio, hoje Papa Francisco, decidiu enviar o tecido para an\xe1lises cient\xedficas. Ele n\xe3o mencionou aos pesquisadores que a subst\xe2ncia poderia ser parte de um milagre eucar\xedstico, revelando a surpresa somente depois da an\xe1lise. O que mostraram os estudos da carne encontrada na igreja de Buenos Aires? Que o tecido pertencia ao ventr\xedculo esquerdo do cora\xe7\xe3o de algu\xe9m com cerca de 30 anos, cujo sangue era tipo AB e que teria sofrido muito antes de morrer.",null)
B.TG=new A.aV("Mas buscai primeiro o Reino de Deus, e a sua justi\xe7a, e todas essas coisas vos ser\xe3o acrescentadas. (Mt 6:33)\n\nJesus, por\xe9m, disse: Deixai os pequeninos e n\xe3o os estorveis de vir a mim, porque dos tais \xe9 o Reino dos c\xe9us. (Mt 19:14)\n\nDesde ent\xe3o, come\xe7ou Jesus a pregar e a dizer: Arrependei-vos, porque \xe9 chegado o Reino dos c\xe9us. (Mt 4:17)\n\nJesus respondeu e disse-lhe: Na verdade, na verdade te digo que aquele que n\xe3o nascer de novo n\xe3o pode ver o Reino de Deus. (Jo 3:3)\n\nE dizendo: O tempo est\xe1 cumprido, e o Reino de Deus est\xe1 pr\xf3ximo. Arrependei-vos e crede no evangelho. (Mc 1:15)\n\nE eu te darei as chaves do Reino dos c\xe9us, e tudo o que ligares na terra ser\xe1 ligado nos c\xe9us, e tudo o que desligares na terra ser\xe1 desligado nos c\xe9us. (Mt 16:19)\n\nBem-aventurados os que sofrem persegui\xe7\xe3o por causa da justi\xe7a, porque deles \xe9 o Reino dos c\xe9us. (Mt 5:10)",null)
B.TH=new A.aV("Seis dias depois, Jesus tomou consigo Pedro, Tiago e Jo\xe3o, seu irm\xe3o, e conduziu-os \xe0 parte a uma alta montanha. L\xe1 se transfigurou na presen\xe7a deles: seu rosto brilhou como o sol, suas vestes tornaram-se resplandecentes de brancura. E eis que apareceram Mois\xe9s e Elias conversando com ele. Pedro tomou, ent\xe3o, a palavra e disse-lhe: \u201cSenhor, \xe9 bom estarmos aqui. Se queres, farei aqui tr\xeas tendas: uma para ti, uma para Mois\xe9s e outra para Elias\u201d. Falava ele ainda, quando veio uma nuvem luminosa e os envolveu. E daquela nuvem fez-se ouvir uma voz que dizia: \u201cEis o meu Filho muito amado, em quem pus toda a minha afei\xe7\xe3o; ouvi-o\u201d. Ouvindo esta voz, os disc\xedpulos ca\xedram com a face por terra e tiveram medo. Mas Jesus aproximou-se deles e tocou-os, dizendo: \u201cLevantai-vos e n\xe3o temais\u201d. Eles levantaram os olhos e n\xe3o viram mais ningu\xe9m, sen\xe3o unicamente Jesus. E, quando desciam, Jesus lhes fez esta proibi\xe7\xe3o: \u201cN\xe3o conteis a ningu\xe9m o que vistes, at\xe9 que o Filho do Homem ressuscite dos mortos\u201d. Em seguida, os disc\xedpulos o interrogaram: \u201cPor que dizem os escribas que Elias deve voltar primeiro?\u201d. Jesus respondeu-lhes: \u201cElias, de fato, deve voltar e restabelecer todas as coisas. Mas eu vos digo que Elias j\xe1 veio, mas n\xe3o o conheceram; antes, fizeram com ele quanto quiseram. Do mesmo modo far\xe3o sofrer o Filho do Homem\u201d. Os disc\xedpulos compreenderam, ent\xe3o, que ele lhes falava de Jo\xe3o Batista. ",null)
B.TI=new A.aV("Pelo sinal da Santa Cruz, livrai-nos Deus, Nosso Senhor, dos nossos inimigos. Em nome do Pai, do filho e do Esp\xedrito Santo. Am\xe9m.\n\nDivino Jesus, n\xf3s vos oferecemos este ros\xe1rio (ter\xe7o) que vamos rezar, meditando os mist\xe9rios da nossa reden\xe7\xe3o. Concedei-nos, por intercess\xe3o da Virgem Maria, M\xe3e de Deus e nossa M\xe3e, as virtudes que nos s\xe3o necess\xe1rias para bem rez\xe1-lo e a gra\xe7a de ganharmos as indulg\xeancias desta santa devo\xe7\xe3o. Ofere\xe7o este ter\xe7o tamb\xe9m...\n\nCreio...\nPai Nosso...\nAve Maria... (3x)\nGl\xf3ria...",null)
B.TJ=new A.aV("Da Galileia foi Jesus ao Jord\xe3o ter com Jo\xe3o, a fim de ser batizado por ele. Jo\xe3o recusava-se: \u201cEu devo ser batizado por ti e tu vens a mim!\u201d. Mas Jesus lhe respondeu: \u201cDeixa por agora, pois conv\xe9m cumpramos a justi\xe7a completa\u201d. Ent\xe3o, Jo\xe3o cedeu. Depois que Jesus foi batizado, saiu logo da \xe1gua. Eis que os c\xe9us se abriram e viu descer sobre ele, em forma de pomba, o Esp\xedrito de Deus. E do c\xe9u baixou uma voz: \u201cEis meu Filho muito amado em quem ponho minha afei\xe7\xe3o\u201d.",null)
B.TK=new A.aV("O Milagre Eucar\xedstico que aconteceu em Faverney, na Fran\xe7a consistiu numa not\xe1vel demonstra\xe7\xe3o sobrenatural de supera\xe7\xe3o da lei da gravidade. Faverney est\xe1 localizado a 20 quil\xf4metros de Vesoul, distante 68,7 quil\xf4metros de Besan\xe7on. Um dos novi\xe7os chamado Hudelot, notou que o Ostens\xf3rio que se encontrava junto Sant\xedssimo Sacramento sobre o Altar, elevou-se e ficou suspenso no ar e que as chamas se inclinavam e n\xe3o tocavam nele.\n\nOs Frades Capuchinhos de Vesoul tamb\xe9m se apressaram para observar e testemunhar o fen\xf4meno. Embora os monges com a ajuda do povo, conseguiram apagar o inc\xeandio que queria consumir toda a Igreja, o Milagre n\xe3o cessou, o Ostens\xf3rio com JESUS Sacramentado continuou flutuando no espa\xe7o. As pessoas que chegavam, ajoelhavam em demonstra\xe7\xe3o de respeito, de temor e em sinal de adora\xe7\xe3o, diante do Ostens\xf3rio suspenso no ar. Tamb\xe9m diversos c\xe9ticos que souberam da not\xedcia chegaram mudos, sem palavras e sem argumentos e se aproximaram para constatar aquele not\xe1vel milagre que acontecia.\n\nAo longo do dia e durante a noite os Monges n\xe3o estabeleceram nenhuma restri\xe7\xe3o, e os curiosos puderam livremente visitar a Igreja e presenciar o fen\xf4meno, que continuava do mesmo modo.\n\nNa manh\xe3 de ter\xe7a-feira, dia 27 de maio, o Milagre permanecia. Vieram padres dos bairros circunvizinhos e de outras cidades e se organizaram para celebrar a Santa Missa em hor\xe1rios seguidos, enquanto o Ostens\xf3rio se mantinha suspenso no ar. Na Santa Missa das 10 horas da manh\xe3 que foi celebrada pelo Padre Nicolas Aubry, P\xe1roco de Menoux, no momento da Consagra\xe7\xe3o as pessoas presenciaram que o Ostens\xf3rio mudou a sua posi\xe7\xe3o e desceu suavemente sobre aquele Altar improvisado, onde estava sendo celebrada a Santa Missa. NOSSO SENHOR determinava naquele momento o final do admir\xe1vel Milagre Eucar\xedstico, no qual a Sagrada H\xf3stia permaneceu dentro do Ostens\xf3rio suspenso no ar durante 33 horas.\n\nNo dia 31 de maio, uma investiga\xe7\xe3o foi ordenada por Sua Excel\xeancia o senhor Arcebispo Ferdinand de Rye. Foram recolhidos cinquenta e quatro testemunhos de monges, padres, autoridades, homens e mulheres do povo. Em 30 de Julho de 1608, depois de estudar os testemunhos e o material colecionado durante a investiga\xe7\xe3o, o senhor Arcebispo decidiu afirmar que havia acontecido de fato, um not\xe1vel Milagre Eucar\xedstico.\n\nExaminando alguns detalhes da ocorr\xeancia, observamos:\n\nO Altar era de madeira e foi quase que completamente reduzido a cinzas, com exce\xe7\xe3o dos p\xe9s. Tamb\xe9m queimou totalmente a toalha de linho e o Corporal que estavam sobre a Mesa de Celebra\xe7\xf5es, assim como um dos lustres que decorava o Altar. Ele foi encontrado derretido pelo calor do fogo. Todavia o Ostens\xf3rio que abrigava JESUS Sacramentado estava perfeito, misteriosamente preservado de qualquer dano. As duas H\xf3stias Consagradas que se encontravam dentro dele, permaneceram intactas.\n\nDurante a Revolu\xe7\xe3o Francesa infelizmente o Ostens\xf3rio do Milagre foi destru\xeddo, mas a H\xf3stia Consagrada foi preservada de qualquer dano por membros do conselho municipal de Faverney que a manteve escondida at\xe9 passar o perigo. Depois, mandaram confeccionar outro magn\xedfico Ostens\xf3rio onde colocaram a mesma Sagrada H\xf3stia do Milagre. A Santa Part\xedcula encontra-se em perfeito estado de conserva\xe7\xe3o e dispon\xedvel \xe0 venera\xe7\xe3o dos fi\xe9is na Igreja de Nossa Senhora de La Blanche.",null)
B.TL=new A.aV("Enquanto comiam, Jesus tomou o p\xe3o, e, aben\xe7oando-o, o partiu, e o deu aos disc\xedpulos, e disse: Tomai, comei, isto \xe9 o meu corpo. E, tomando o c\xe1lice e dando gra\xe7as, deu-lho, dizendo: Bebei dele todos. Porque isto \xe9 o meu sangue, o sangue do Novo Testamento, que \xe9 derramado por muitos, para remiss\xe3o dos pecados. E digo-vos que, desde agora, n\xe3o beberei deste fruto da videira at\xe9 \xe0quele Dia em que o beba de novo convosco no Reino de meu Pai.",null)
B.TM=new A.aV("No primeiro dia que se seguia ao s\xe1bado, Maria Madalena foi ao sepulcro, de manh\xe3 cedo, quando ainda estava escuro. Viu a pedra removida do sepulcro. Correu e foi dizer a Sim\xe3o Pedro e ao outro disc\xedpulo a quem Jesus amava: \u201cTiraram o Senhor do sepulcro, e n\xe3o sabemos onde o puseram!\u201d. Saiu ent\xe3o Pedro com aquele outro disc\xedpulo, e foram ao sepulcro. Corriam juntos, mas aquele outro disc\xedpulo correu mais depressa do que Pedro e chegou primeiro ao sepulcro. Inclinou-se e viu ali os panos no ch\xe3o, mas n\xe3o entrou. Chegou Sim\xe3o Pedro que o seguia, entrou no sepulcro e viu os panos postos no ch\xe3o. Viu tamb\xe9m o sud\xe1rio que estivera sobre a cabe\xe7a de Jesus. N\xe3o estava, por\xe9m, com os panos, mas enrolado num lugar \xe0 parte. Ent\xe3o, entrou tamb\xe9m o disc\xedpulo que havia chegado primeiro ao sepulcro. Viu e creu. Em verdade, ainda n\xe3o haviam entendido a Escritura, segundo a qual Jesus devia ressuscitar dentre os mortos. Os disc\xedpulos, ent\xe3o, voltaram para as suas casas. Entretanto, Maria se conservava do lado de fora perto do sepulcro e chorava. Chorando, inclinou-se para olhar dentro do sepulcro. Viu dois anjos vestidos de branco, sentados onde estivera o corpo de Jesus, um \xe0 cabeceira e outro aos p\xe9s. Eles lhe perguntaram: \u201cMulher, por que choras?\u201d. Ela respondeu: \u201cPorque levaram o meu Senhor, e n\xe3o sei onde o puseram\u201d. Ditas essas palavras, voltou-se para tr\xe1s e viu Jesus em p\xe9, mas n\xe3o o reconheceu. Perguntou-lhe Jesus: \u201cMulher, por que choras? Quem procuras?\u201d. Supondo ela que fosse o jardineiro, respondeu: \u201cSenhor, se tu o tiraste, dize-me onde o puseste e eu o irei buscar\u201d. Disse-lhe Jesus: \u201cMaria!\u201d Voltando-se ela, exclamou em hebraico: \u201cRab\xf4ni!\u201d (que quer dizer Mestre). Disse-lhe Jesus: \u201cN\xe3o me retenhas, porque ainda n\xe3o subi a meu Pai, mas vai a meus irm\xe3os e dize-lhes: Subo para meu Pai e vosso Pai, meu Deus e vosso Deus\u201d, Maria Madalena correu para anunciar aos disc\xedpulos que ela tinha visto o Senhor e contou o que ele lhe tinha falado.",null)
B.TN=new A.aV("Roma, 12 de Abril de 1947, S\xe1bado In Albis, um dia de primavera, onde a vida parecia despertar ap\xf3s os horrores da guerra.\n\nNa Esta\xe7\xe3o Ostiense, Bruno Cornacchiola (1913-2001), que era maquinista de bonde em Roma, aos 34 anos, junto a seus tr\xeas filhos, Isola de 10 anos, Carlo de 7 anos e Gianfranco de 4 anos, perde o trem que o levaria a Lido, Ostia, e decide dirigir-se a Via Laurentina em Tre Fontane, lugar famoso pelo mart\xedrio de S\xe3o Paulo e pelo chocolate dos monges Trapistas.\n\nBruno est\xe1 em busca de um lugar tranquilo para preparar um discurso que dever\xe1 apresentar no dia seguinte com o tema: \u201cMaria n\xe3o \xe9 sempre Virgem e Imaculada\u201d. \xc9 a ocasi\xe3o para tornar-se pastor adventista e resgatar-se de um passado transcorrido na mis\xe9ria e na ignor\xe2ncia tamb\xe9m religiosa. Ele tornou-se um obstinado inimigo da Igreja Cat\xf3lica durante a Guerra Civil na Espanha (1936-1939), onde \xe9 convencido por um militar alem\xe3o luterano a aceitar o protestantismo.\n\nCego pelo \xf3dio, em Toledo, compra um punhal para matar o Papa. Retornando \xe0 casa, ele imp\xf5e a mulher, Iolanda de segui-lo no protestantismo. Ela aceita depois de tentar convenc\xea-lo do contr\xe1rio e pede-lhe, como \xfaltima esperan\xe7a, a pr\xe1tica da devo\xe7\xe3o dedicada ao Sagrado Cora\xe7\xe3o de Jesus, a cada primeira sexta-feira do m\xeas durante nove meses.\n\nBruno, sentado debaixo de um eucalipto, folheia a B\xedblia e come\xe7a a fazer anota\xe7\xf5es, enquanto isso seus filhos jogam bola nesse terreno com muitas \xe1rvores onde se encontra dentro de uma rocha, uma gruta escura e mal cheirosa.\n\nBruno est\xe1 escrevendo quando a voz dos filhos o interropem: \u201cPapai, perdemos a bola!\u201d Come\xe7a a busca e seus filhos caem de joelhos, um ap\xf3s o outro diante da gruta escura, com as m\xe3os juntas repetindo: \u201cBela Senhora, Bela Senhora\u2026\u201d. Bruno n\xe3o consegue mover-los e assustado esclama: \u201c Deus, salvai-nos!\u201d. Cai um v\xe9u dos seus olhos e ele tamb\xe9m v\xea a \u201cBela Senhora\u201d, com os p\xe9s descal\xe7os apoiados sobre um bloco de terra.\n\nEla tem um olhar pesaroso e benigno, os cabelos negros cobertos por um manto cor de grama do prado na primavera, a veste c\xe2ndida \xe9 cingida na cintura por uma faixa rosa. Fala a Bruno com voz suave e se apresenta:\n\n\u201cSou a Virgem da Revela\xe7\xe3o. Voc\xea me persegue, agora basta. Retorna ao Redil Santo (Igreja Cat\xf3lica)\u2026\u201d.\n\nO celeste di\xe1logo dura cerca de uma hora e encerra uma mensagem para ser entregue pessoalmente ao Papa. A m\xe3e de Deus, na m\xe3o direita aperta um livro cinza: \xe9 a Sagrada Escritura, e com a m\xe3o esquerda indica uma veste preta sacerdotal no ch\xe3o, perto de uma cruz despeda\xe7ada.\n\nA vis\xe3o desaparece lentamente, Maria sorri, insinua dois passos e vai embora voltando-se para S\xe3o Pedro, enquanto um doce perfume invade a gruta.\n\nA Virgem, para dar certeza a Bruno de que a Apari\xe7\xe3o \xe9 verdadeira, lhe d\xe1 um sinal, ele deve procurar um sacerdote que ao pedido: \u201c Padre, eu tenho que falar-lhe\u201d, responda: \u201cAve Maria filhinho, o que voc\xea quer?\u201d. Maria indica ao vidente e, atrav\xe9s dele a todos n\xf3s, que o retorno a Deus se inicia atrav\xe9s do sacerdote, que \xe9 o primeiro anel entre a terra e o c\xe9u. O sacerdote quando celebra a Santa Missa nos une a liturgia do c\xe9u, antecipando a vida eterna quando Deus ser\xe1 tudo em todos (cfr. Catecismo da Igreja Cat\xf3lica 1326).\n\nBruno, de 12 a 28 de Abril procura desesperadamente o sacerdote designado, rezando de noite e suplicando a \u201cBela Senhora\u201d de ajud\xe1-lo. Seguindo o conselho da mulher Iolanda, como \xfaltima tentativa, vai a sua par\xf3quia de Todos os Santos: na sacristia, se escondendo para n\xe3o ser reconhecido, puxa a bainha da sobrepeliz de um sacerdote dizendo: \u201cPadre, gostaria de falar-lhe\u2026\u201d, o padre Frosi responde: \u201cAve Maria filhinho\u201d: essa \xe9 a confirma\xe7\xe3o! Padre Frosi lhe indica um outro sacerdorte, Padre Gilberto Carniel, che se ocupar\xe1 da forma\xe7\xe3o religiosa de Bruno e da mulher at\xe9 a retrata\xe7\xe3o, que acontece em 7 de Maio de 1947, dia em que a fam\xedlia Cornacchiola reentra na Igreja Cat\xf3lica.\n\nEm 9 de Dezembro de 1949, no final do Santo Ter\xe7o rezado pelos maquinistas romanos na sua capela privada, Pio XII pergunta: \u201cAlgum de voc\xeas quer falar comigo?\u201d. Se aproxima Bruno, ajoelhando-se lhe pede perd\xe3o por ter tido a inten\xe7\xe3o de mat\xe1-lo, lhe entrega a B\xedblia protestante e o punhal, no qual tinha escrito no cabo: \u201cA morte ao Papa\u201d, O Papa responde sorrindo: \u201cCaro filho, com isso voc\xea n\xe3o teria feito outra coisa sen\xe3o dar um novo m\xe1rtir a Igreja e um novo Papa\u201d.\n\nFonte: divinarevelacao.org",null)
B.TO=new A.aV("O t\xedtulo de Nossa Senhora do Pilar \xe9 o mais antigo de Nossa Senhora, mesmo n\xe3o sendo muito conhecido no Brasil. A bas\xedlica do Pilar, que fica em Sarago\xe7a, uma cidade da Espanha, \xe9 um santu\xe1rio privilegiado. Segundo a tradi\xe7\xe3o crist\xe3, o t\xedtulo de Nossa Senhora do Pilar tem origem h\xe1 mais de 1900 anos. Ela diz que dia ap\xf3s dia aumentava a quantidade de crist\xe3os que eram atra\xeddos pelos milagres e pela prega\xe7\xe3o dos ap\xf3stolos. Por\xe9m, em persegui\xe7\xe3o contra a Santa Igreja, muitos crist\xe3os eram presos, torturados e mortos pelos judeus. Com isso, os ap\xf3stolos, indignados, iniciaram a anunciar o evangelho para todos, conforme ordenou Nosso Senhor Jesus Cristo.\n\nS\xe3o Tiago o respons\xe1vel pela prega\xe7\xe3o do Santo Evangelho na Espanha. Por\xe9m, antes de sua partida, ele implorou a b\xean\xe7\xe3o de Maria Sant\xedssima, como era de costume entre os ap\xf3stolos. Enquanto aben\xe7oava S\xe3o Tiago, Maria disse:\n\n\u201dVai, meu filho, cumpre a ordem de teu Mestre, e por Ele te rogo que, naquela cidade da Espanha em que maior n\xfamero de almas converteres a f\xe9, edifiques uma igreja em minha mem\xf3ria, conforme o que eu te manifestar\u201d.\n\nS\xe3o Tiago ent\xe3o pregou em in\xfameras prov\xedncias espanholas at\xe9 chegar em Sarago\xe7a, que margeava o rio Ebro. Na cidade, conseguiu converter oito var\xf5es a Jesus Cristo, com quem se retirava para as margens do rio durante o per\xedodo noturno, para descansar e orar. Em uma dessas noites, descansando com seus disc\xedpulos, S\xe3o Tiago escutou vozes de anjos cantando: \u201dAve Maria, cheia de gra\xe7a!\u201d Ajoelhando-se, S\xe3o Tiago pode ver a Sant\xedssima Virgem sentada num pilar de m\xe1rmore no meio de um coro de anjos. Nesse momento, Maria disse carinhosamente a ele:\n\n\u201dEis aqui, meu filho, o lugar assinalado e destinado \xe0 minha honra, no qual, por teu cuidado e em minha mem\xf3ria, quero que seja edificada uma igreja; conserva este pilar onde estou sentada, porque meu Filho e teu Mestre enviou-o do c\xe9u pelas m\xe3os dos anjos; junto a ele assentar\xe1s o altar da capela, e nele obrar\xe1 a virtude do Alt\xedssimo os portentos e maravilhas de minha intercess\xe3o, para com aqueles que, em suas necessidades, implorarem o meu patroc\xednio; e este pilar permanecer\xe1 aqui at\xe9 o fim do mundo, e nunca faltar\xe3o nesta cidade verdadeiros crist\xe3os que honrem o nome de Jesus Cristo, o meu Filho\u201d.\n\n\xadDe repente, o coro de anjos levou Maria para sua casa em Jerusal\xe9m. Depois da apari\xe7\xe3o, a Virgem Maria ainda viveu por mais onze anos. Tocado com a apari\xe7\xe3o, S\xe3o Tiago logo construiu uma capelinha naquele lugar, com o aux\xedlio dos oito disc\xedpulos, e colocou o pilar na parte de cima do altar, de modo que o pilar ficasse voltado para o rio Ebro.\n\nA capela sofreu diversas reformas e expans\xf5es ao longo dos s\xe9culos. Hoje \xe9 uma bas\xedlica grandiosa que acolhe incont\xe1veis fi\xe9is que v\xeam de todos os cantos do mundo para venerar a Virgem e seu Pilar. Muito al\xe9m dos seus incr\xedveis milagres, Nossa Senhora do Pilar \xe9 conhecida como consoladora dos aflitos, ref\xfagio dos pecadores e M\xe3e da Espanha. Sua a\xe7\xe3o \xe9 principalmente espiritual. A devo\xe7\xe3o ao Pilar tem grande influ\xeancia na Am\xe9rica Ib\xe9rica, onde os pa\xedses festejam o dia do descobrimento no dia 12 de outubro, que tamb\xe9m \xe9 o dia do Pilar. A Bas\xedlica de Nossa Senhora do Pilar fica aberta durante todo o dia e est\xe1 sempre cheia de fi\xe9is que v\xe3o ao Pilar buscando gra\xe7as, reconcilia\xe7\xe3o e di\xe1logo com Deus.\n\nJ\xe1 se passaram vinte s\xe9culos desde a apari\xe7\xe3o de Nossa Senhora do Pilar a S\xe3o Tiago, e, apesar das invas\xf5es mu\xe7ulmanas, guerras e intemp\xe9ries, o pilar sagrado continua intacto na bas\xedlica de Sarago\xe7a, sob a prote\xe7\xe3o da Virgem Maria.\n\nFonte: Cruz Terra Santa",null)
B.TP=new A.aV('Um alerta mais grave e um convite \xe0 convers\xe3o:\n\n\u201cSe tiverdes trigo, n\xe3o o semeeis, pois os animais comer\xe3o tudo. O que semeardes e o que vingar, reduzir-se-\xe1 a p\xf3 quando for malhado. Sobrevir\xe1 uma grande fome. Os outros far\xe3o penit\xeancias pela fome. As nozes estragar-se-\xe3o; as uvas h\xe3o de apodrecer. Por\xe9m, se voc\xeas se converterem, at\xe9 as pedras e as rochas se transformar\xe3o em mont\xf5es de trigo e as batatas aparecer\xe3o semeadas por sobre a terra\u201d.\n\nMaria falava de um modo que eles pudessem compreender em franc\xeas e depois no dialeto regional. Ela disse mensagens espec\xedficas para cada vidente em particular de modo que um n\xe3o sabia a mensagem do outro.\n\nMaria ainda andou com eles (sem tocar o ch\xe3o) at\xe9 um lugar mais alto e ali se foi como que se dissipando junto com a redoma de luz que a cercava.\n\nNossa Senhora pediu que no local da apari\xe7\xe3o fosse constru\xedda uma Igreja e que se fundasse uma Congrega\xe7\xe3o, para a qual, ela mesma ditou os fundamentos e as regras. Ap\xf3s alguns momentos, Nossa Senhora foi desaparecendo, a luz diminuindo e ela foi embora. Maximim quis pegar uma das rosas que estavam embaixo dos p\xe9s da Virgem, mas elas desapareceram. Os pastores, ent\xe3o, correram para falar com seus pais e seus patr\xf5es.\n\nMelanie Galvat, que se tornou freira das Irm\xe3s da Provid\xeancia de Corenc, e morreu no ano de 1904, disse que Nossa Senhora chorava o tempo todo em que falou com eles. Por\xe9m, as l\xe1grimas n\xe3o diminu\xedram seu ar de Rainha e Senhora, tornando-a a mais bela e amorosa de todas as m\xe3es.\n\nMelanie Galvat disse que Nossa Senhora trazia uma cruz em seu peito, de um lado um martelo e de outro um alicate. O martelo representando o pecado de todos que pregavam mais ainda Jesus na cruz, e o alicate, as ora\xe7\xf5es do povo, para que, tirando os pregos, Jesus fosse aliviado um pouco de suas dores.\n\nA seguir, foram selecionadas algumas das frases que Nossa Senhora disse as crian\xe7as, as mais fortes, s\xe3o dirigidas aos sacerdotes, confira:\n\n\u201cOs sacerdotes, ministros de meu Filho, pela sua m\xe1 vida, sua irrever\xeancia e impiedade na celebra\xe7\xe3o dos santos mist\xe9rios, pelo amor do dinheiro, das honrarias e dos prazeres, tornaram-se cloacas de impureza." - Cloacas: fossa, canal ou cano destinado a receber deje\xe7\xf5es.\n\n\u201cSim, os sacerdotes atraem a vingan\xe7a e a vingan\xe7a paira sobre suas cabe\xe7as. Ai dos sacerdotes e das pessoas consagradas a Deus, que pela sua infidelidade e m\xe1 vida crucificam de novo meu Filho!"\n\n"Os pecados das pessoas consagradas a Deus bradam ao C\xe9u e clamam por vingan\xe7a. E eis que a vingan\xe7a est\xe1 \xe0s suas portas, pois n\xe3o se encontra mais uma pessoa a implorar miseric\xf3rdia e perd\xe3o para o povo."\n\n"N\xe3o h\xe1 mais almas generosas, n\xe3o h\xe1 mais ningu\xe9m digno de oferecer a v\xedtima imaculada ao [Pai] Eterno em favor do mundo\u201d.\n\n"Deus vai golpear de modo inaudito. Ai dos habitantes da Terra. Deus vai esgotar sua c\xf3lera, e ningu\xe9m poder\xe1 fugir a tantos males acumulados."\n\n"Os chefes, os condutores do povo de Deus negligenciaram a ora\xe7\xe3o e a penit\xeancia. E o dem\xf4nio obscureceu suas intelig\xeancias.Transformaram-se nessas estrelas errantes, que o velho diabo arrastar\xe1 com sua cauda para faz\xea-las perecer."\n\n\u201cDeus permitir\xe1 \xe0 velha serpente introduzir divis\xf5es entre os que reinam, em todas as sociedades e em todas as fam\xedlias. Sofrer-se-\xe3o tormentos f\xedsicos e morais. Deus abandonar\xe1 os homens a si mesmos e enviar\xe1 castigos que se suceder\xe3o durante mais de trinta e cinco anos."\n\n\u201cA sociedade est\xe1 na imin\xeancia dos flagelos mais terr\xedveis e dos maiores acontecimentos. Deve-se esperar ser governado por uma chibata de ferro e beber o c\xe1lice da c\xf3lera de Deus.\u201d\n\n\u201cA It\xe1lia ser\xe1 punida, pela ambi\xe7\xe3o de querer sacudir o jugo do Senhor dos Senhores. Ser\xe1 tamb\xe9m entregue \xe0 guerra, o sangue correr\xe1 por todo lado. As igrejas ser\xe3o fechadas ou profanadas. Os sacerdotes e os religiosos ser\xe3o expulsos. Ser\xe3o entregues \xe0 morte, e morte cruel. V\xe1rios abandonar\xe3o a f\xe9, e o n\xfamero dos sacerdotes e religiosos que se afastar\xe3o da verdadeira Religi\xe3o ser\xe1 grande, entre estes haver\xe1 at\xe9 mesmo Bispos."\n\n\u201cNo ano de 1864, L\xfacifer e um grande n\xfamero de dem\xf4nios ser\xe3o soltos do inferno. Eles abolir\xe3o a f\xe9 pouco a pouco, at\xe9 nas pessoas consagradas a Deus. Eles as cegar\xe3o de tal maneira que, salvo uma gra\xe7a particular, adquirir\xe3o o esp\xedrito desses maus anjos."\n\n\u201cO Vig\xe1rio de meu Filho (Papa) ter\xe1 muito que sofrer, porque durante algum tempo a Igreja ser\xe1 entregue a grandes persegui\xe7\xf5es. Ser\xe1 o tempo das trevas, e a Igreja passar\xe1 por uma crise pavorosa."\n\n\u201cN\xe3o se ver\xe1 outra coisa sen\xe3o homic\xeddios, \xf3dio, inveja, mentira e disc\xf3rdia, sem amor pela p\xe1tria e sem amor pela fam\xedlia. O Santo Padre sofrer\xe1 muito. Eu estarei com ele at\xe9 o fim, para receber o seu sacrif\xedcio."\n\n\u201cA Fran\xe7a, a It\xe1lia, a Espanha e a Inglaterra estar\xe3o em guerra. O sangue correr\xe1 nas ruas, o franc\xeas combater\xe1 contra o franc\xeas, o italiano contra o italiano. A seguir haver\xe1 uma guerra geral, que ser\xe1 horrorosa. Durante certo tempo Deus n\xe3o se lembrar\xe1 mais da Fran\xe7a nem da It\xe1lia, porque o Evangelho de Jesus Cristo n\xe3o ser\xe1 mais conhecido."\n\n\u201cJesus Cristo, por um ato de sua justi\xe7a e de sua grande miseric\xf3rdia em rela\xe7\xe3o aos justos, ordenar\xe1 a seus anjos que deem morte a todos os seus inimigos. De repente os perseguidores da Igreja de Jesus Cristo e todos os homens entregues ao pecado perecer\xe3o, e a Terra tornar-se-\xe1 como um deserto."\n\n\u201cEsta paz entre os homens n\xe3o ser\xe1 longa. Vinte e cinco anos de safras abundantes lhes far\xe3o esquecer que os pecados dos homens s\xe3o a causa de todas as desgra\xe7as que sucedem na terra."\n\n\u201cAi dos habitantes da Terra! Haver\xe1 guerras sangrentas e fome, peste e doen\xe7as contagiosas. Haver\xe1 chuvas feitas de saraivadas espantosas de animais, trovoadas que abalar\xe3o as cidades, terremotos que engolir\xe3o pa\xedses."\n\nAs crian\xe7as contaram aos camponeses, mas ningu\xe9m queria lhes dar cr\xe9dito apesar de a mensagem ser muito complexa para ter sido criada pela imagina\xe7\xe3o de duas crian\xe7as. O p\xe1roco interrogou os videntes e contou na Missa o ocorrido. O bispo substituiu-o por outro sacerdote para que a investiga\xe7\xe3o sobre a autenticidade das apari\xe7\xf5es acontecesse com o rigor necess\xe1rio. Pessoas curiosas tamb\xe9m pediam para eles contarem da apari\xe7\xe3o repetidas vezes; foram tamb\xe9m amea\xe7ados de pris\xe3o se continuassem a espalhar \u201cboatos\u201d. Mas eles com a coragem prof\xe9tica nunca negaram e nem mudaram o relato dos fatos.\n\nO tema das apari\xe7\xf5es da Senhora de La Salette \xe9 muito forte e atual. Vale a pena ler a mensagem completa de Nossa Senhora de La salette. Ela falou muito sobre a import\xe2ncia da convers\xe3o dos pecadores, de fazer penit\xeancia, e que todos devem se livrar dos pecados mortais.\n\nFonte: Cruz Terra Santa',null)
B.TQ=new A.aV("Na regi\xe3o B\xe1vara da Alemanha, junto \xe0 fronteira su\xed\xe7a, em 9 de junho de 1970, enquanto um padre visitante da Su\xed\xe7a estava celebrando uma Missa Tridentina (Missa em latim) numa capela, uma s\xe9rie incomum de eventos aconteceu. Depois da Consagra\xe7\xe3o, o celebrante notou que uma pequena mancha avermelhada come\xe7ou a aparecer no corporal, no lugar onde o c\xe1lice tinha estado descansando. Desejando saber se o c\xe1lice tinha come\xe7ado a vazar, o padre correu a m\xe3o dele debaixo do c\xe1lice, mas achou-o completamente seco. A esta altura, a mancha crescera, atingindo o tamanho de uma moeda de dez centavos.\n\nDepois de completar a Missa, o padre inspecionou todo o altar, mas n\xe3o conseguiu encontrar qualquer coisa que pudesse ser remotamente a fonte da mancha avermelhada. Ele trancou o corporal que apresentava a mancha num local seguro, at\xe9 que pudesse discutir o assunto com o p\xe1roco.\n\nEm 11 de junho, depois de examinar o corporal com o p\xe1roco, o pano foi fotografado e enviado ao Instituto Cl\xednico de Terapia Radial e Medicina Nuclear e para o instituto Policl\xednico da Universidade de Zurique, para an\xe1lise qu\xedmica. Os resultados de quatro an\xe1lises separadas administradas nas amostras de pano indicaram que a mancha \xe9 causada por sangue humano contendo indicadores bioqu\xedmicos de um homem em agonia.\n\nEm 14 de Julho, o fen\xf4meno repetiu-se na capela de Stich, aparecendo quatro manchas no corporal depois da Consagra\xe7\xe3o. V\xe1rios dias depois, o pastor enviou o corporal com as manchas para o Hospital Distrital de Cercee para an\xe1lise \u2013 o resultado: as manchas eram sangue humano! Uma das testemunhas deste evento, Joseph Talscher, o sacrist\xe3o da capela, relatou o seguinte:\n\n\u201cNa noite de 14 de julho, o padre estava celebrando a Santa Missa na capela de Stich. Em vista do que havia acontecido em 9 de junho, nos certificamos de que os panos que cobrem o altar estavam absolutamente imaculados\u2026 ap\xf3s haver tomado a Santa Comunh\xe3o, o padre fez um sinal para mim e apontou para o altar. Ent\xe3o eu vi as manchas. Depois da Missa, todos n\xf3s examinamos mais de perto as manchas, e mais especialmente a maior, que era do tamanho da H\xf3stia que o Padre consagra. Ali distinguimos muito distintamente uma cruz.\u201d\n\nMuitos e muitos relatos de milagres eucar\xedsticos s\xe3o contados ao longo da Hist\xf3ria da Igreja at\xe9 hoje; muitos casos de \u201ch\xf3stias que sangram\u201d, h\xf3stias que parecem levitar no ar por si mesmas e outros fen\xf4menos inexplic\xe1veis; h\xf3stias que se transformam em carne e sangue na boca de fi\xe9is, etc. S\xe3o tantos os casos que a Igreja tem at\xe9 dificuldade de analis\xe1-los todos e emitir o seu parecer. Cabe dizer aqui que o respons\xe1vel por emitir a primeira palavra sobre a veracidade do milagre, \xe9 o Bispo da Diocese, onde acontece o milagre.\n\n\u201cHaver\xe1 caos na Igreja. A tranquilidade n\xe3o retornar\xe1 at\xe9 o Papa haver ancorado com sucesso o barco de Pedro entre os pilares g\xeameos da devo\xe7\xe3o Eucar\xedstica e a devo\xe7\xe3o \xe0 Nossa Senhora. Isto acontecer\xe1 aproximadamente um ano antes do fim do s\xe9culo XX.\u201d (S\xe3o Jo\xe3o Bosco, 1862)",null)
B.TR=new A.aV("Conforme o seu costume, Jesus saiu dali e dirigiu-se para o monte das Oliveiras, seguido dos seus disc\xedpulos. Ao chegar \xe0quele lugar, disse-lhes: \u201cOrai para que n\xe3o caiais em tenta\xe7\xe3o\u201d. Depois se afastou deles \xe0 dist\xe2ncia de um tiro de pedra e, ajoelhando-se, orava: \u201cPai, se \xe9 de teu agrado, afasta de mim este c\xe1lice! N\xe3o se fa\xe7a, todavia, a minha vontade, mas sim a tua\u201d. Apareceu-lhe ent\xe3o um anjo do c\xe9u para confort\xe1-lo. Ele entrou em agonia e orava ainda com mais inst\xe2ncia, e seu suor tornou-se como gotas de sangue a escorrer pela terra. Depois de ter rezado, levantou-se, foi ter com os disc\xedpulos e achou-os adormecidos de tristeza. Disse-lhes: \u201cPor que dormis? Levantai-vos, orai, para n\xe3o cairdes em tenta\xe7\xe3o. Ele ainda falava, quando apareceu uma multid\xe3o de gente; e junto deles vinha um dos Doze, que se chamava Judas Iscariotes. Achegou-se de Jesus para o beijar. Jesus perguntou-lhe: \u201cJudas, com um beijo trais o Filho do Homem!\u201d. Os que estavam ao redor dele, vendo o que ia acontecer, perguntaram: \u201cSenhor, devemos atac\xe1-los \xe0 espada?\u201d. E um deles feriu o servo do pr\xedncipe dos sacerdotes, decepando-lhe a orelha direita. Mas Jesus interveio: \u201cDeixai, basta\u201d. E, tocando na orelha daquele homem, curou-o. Voltando-se para os pr\xedncipes dos sacerdotes, para os oficiais do templo e para os anci\xe3os que tinham vindo contra ele, disse-lhes: \u201cSa\xedstes armados de espadas e cacetes, como se vi\xe9sseis contra um ladr\xe3o. Entretanto, eu estava todos os dias convosco no templo, e n\xe3o estendestes as m\xe3os contra mim, mas esta \xe9 a vossa hora e do poder das trevas\u201d. Prenderam-no ent\xe3o e conduziram-no \xe0 casa do pr\xedncipe dos sacerdotes. Pedro seguia-o de longe.",null)
B.TS=new A.aV('Transcorria um rigoroso inverno na vila de Ban\xadneux, em 1933, seis anos antes da TI Guerra Mundial. Domingo, 15 de janeiro, era mais um dia penoso na \xe1rdua vida de fam\xedlia de Juli\xe3o Beco. Este estava subempregado, sua esposa padecia problemas de sa\xfade, a moradia familiar era prec\xe1ria e pobre, al\xe9m de ser numerosa a prole: oito filhos pequenos. Mas o pior \xe9 que a pobreza n\xe3o era apenas material, mas tamb\xe9m espiritual. O pai n\xe3o praticava a Religi\xe3o desde a \xe9poca de sua Primeira Comunh\xe3o. A m\xe3e, como frouxa formadora dos filhos, tinha-lhes ensinado sem fervor apenas algumas ora\xe7\xf5es. O casal n\xe3o se preocupava com o bom aproveitamento das crian\xe7as nas aulas de catecismo da par\xf3quia.\n\nApesar dessas circunst\xe2ncias adversas, a filha primog\xeanita, Mariette, com doze anos ent\xe3o, era muito dedicada. J\xe1 sabia cuidar dos afazeres dom\xe9sticos quan\xaddo a m\xe3e adoecia Tinha o senso de uma zelosa dona-de-casa: apreciava ordem, limpeza, economia. Na escola, apesar das numerosas mas involunt\xe1rias faltas, era aluna diligente. Seus cadernos atestavam bem sua aplica\xe7\xe3o. De boa \xedndole, esfor\xe7ava-se em animar a todos. Sabia degustar as alegrias simples e puras da vida que Deus concede. E dando este bom exemplo, edificava os outros.\n\nNaquele domingo, aproximadamente \xe0s 19 horas, Mariette olhava pela janela para ver se j\xe1 estava de volta Juli\xe3o, o irm\xe3o que lhe seguia em idade. Inesperadamente, no pobre jardinzinho, j\xe1 bem escuro, come\xe7ou ela a notar a presen\xe7a de uma bela Dama luminosa.\n\nDe in\xedcio, Mariette duvidou. N\xe3o seria alguma ilus\xe3o causada pelos reflexos titubeantes de uma l\xe2mpada de \xf3leo que estava ali perto, dentro da casa? Afastou-a e certificou-se de que se tratava, na realidade, de uma Senhora que, sorridente, e de modo bondoso, dirigia-se a ela, aparentando desejar dizer-lhe algo com gestos af\xe1veis.\n\nA menina exclamou ent\xe3o: "Mam\xe3e! Mam\xe3e! Venha! Parece que Nossa Senhora est\xe1 no jardim!" A m\xe3e, de outro c\xf4modo da casa, mandou que a filha deixasse de bobagens e fosse dormir.\n\nA apari\xe7\xe3o, entretanto, continuava. A Senhora era de m\xe9dia estatura, com vestido e v\xe9u brancos, sendo que a alvura da veste era mais intensa. Esta fechava-se sob o queixo da Senhora, era lisa at\xe9 a cintura e depois alargava-se at\xe9 os p\xe9s, formando pregas harmoniosas. As pontas do largo cinto azul ca\xedam-lhe diante do vestido. O v\xe9u cobria-lhe ombros e bra\xe7os. As m\xe3os estavam juntas, mas abaixadas. A Dama sorria com o olhar e os l\xe1bios, estando ligeiramente inclinada para seu lado esquerdo. Essa postura, caracter\xedstica da Virgem de Banneux, permitia que se visse o p\xe9 direito de Nossa Senhora, ornado com uma rosa de ouro. Apoia\xadva-se ele sobre uma nuvem prateada, a uns tr\xeas palmos do ch\xe3o. Uma luz brilhante, opalescente, circundava a Virgem. E em tomo de sua cabe\xe7a notava-se uma aur\xe9ola de raios de luz divergentes.\n\nMariette, que de inicio tivera medo, tranq\xfcilizou-se, tomou o ter\xe7o e rezou seis dezenas. A Dama, com um gesto, chamou-a ao jardim. Mas a m\xe3e da menina trancou a porta da casa \xe0 chave e desceu as persianas da janela. Antes de se retirar do recinto, Mariette rezou ainda uns dez minutos, espiando pela janela, levantando um pouco a persiana. Nessa ocasi\xe3o, a Senhora j\xe1 havia desaparecido.\n\nAl\xe9m dessa, tiveram lugar mais sete apari\xe7\xf5es, todas um tanto misteriosas. Ao longo delas, Nossa Senhora pronunciou apenas poucas frases, al\xe9m de comunicar um segredo particular a Mariette.\n\nNa terceira apari\xe7\xe3o, ao Lhe ser perguntado quem era, respondeu: "Eu sou a Virgem dos Pobres". E afirmou que uma fonte natural de \xe1gua, que havia ali junto, serviria para o bem de todas as na\xe7\xf5es, como tamb\xe9m aos doentes.\n\nNossa Senhora pediu que se constru\xedsse uma capela no local. Pelos frutos - isto \xe9, pelos favores espargidos pela M\xe3e de Deus - pode-se conhecer a \xe1rvore: foram tantas as gra\xe7as concedidas, que em pouco tempo foi necess\xe1rio transformar a capela em santu\xe1rio, devido ao afluxo de peregrinos e \xe0 falta de espa\xe7o para afixar ex-votos de agradecimento.\n\nV\xe1rias casas de congrega\xe7\xf5es religiosas instalaram-se nas imedia\xe7\xf5es do local das apari\xe7\xf5es para atender doentes.\n\nPor que colocar limites ao exerc\xedcio da miseric\xf3rdia de Nossa Senhora? N\xe3o satisfeita com a \xe1gua milagrosa de Lourdes, certamente a Virgem Sant\xedssima quis oferecer a seus fi\xe9is devotos tamb\xe9m a de Banneux.\n\nFonte: catolicismo.com.br',null)
B.TT=new A.aV("Apareceu em seguida um grande sinal no c\xe9u: uma Mulher revestida do sol, a lua debaixo dos seus p\xe9s e na cabe\xe7a uma coroa de doze estrelas.",null)
B.TU=new A.aV("Enquanto o conduziam, detiveram um certo Sim\xe3o de Cirene, que voltava do campo, e impuseram-lhe a cruz para que a carregasse atr\xe1s de Jesus. Seguia-o uma grande multid\xe3o de povo e de mulheres, que batiam no peito e o lamentavam. Voltando-se para elas, Jesus disse: \u201cFilhas de Jerusal\xe9m, n\xe3o choreis sobre mim, mas chorai sobre v\xf3s mesmas e sobre vossos filhos. Porque vir\xe3o dias em que se dir\xe1: Felizes as est\xe9reis, os ventres que n\xe3o geraram e os peitos que n\xe3o amamentaram! Ent\xe3o, dir\xe3o aos montes: Ca\xed sobre n\xf3s! E aos outeiros: Cobri-nos! Porque, se eles fazem isso ao lenho verde, que acontecer\xe1 ao seco?\u201d. Eram conduzidos ao mesmo tempo dois malfeitores para serem mortos com Jesus.",null)
B.TV=new A.aV("Heresia, impiedade, impureza, crises que assolam o homem e a Igreja nos tempos atuais e previstas com clareza pela Santa M\xe3e de Deus, em sua apari\xe7\xe3o no Equador, em 1594.\n\nNossa Senhora do Bom Sucesso fez sua primeira apari\xe7\xe3o no dia 02 de fevereiro de 1594, aparecendo a uma religiosa, a serva de Deus Mariana de Jesus Torres, em Quito, no Equador. Em sua apari\xe7\xe3o, Nossa Senhora profetizou para a irm\xe3 muitos fatos que a Igreja viveria no s\xe9culo XX. Nossa Senhora previu que o papa Pio IX iria proclamar o dogma da Assun\xe7\xe3o. Ela tamb\xe9m previu que o Equador teria um presidente que morreria como m\xe1rtir, o que de fato aconteceu.\n\nA Irm\xe3 Mariana foi a grande respons\xe1vel por consagrar o Equador ao Sagrado Cora\xe7\xe3o de Jesus. At\xe9 hoje, milagrosamente, seu cora\xe7\xe3o continua intacto, ficando exposto na cidade de Quito. Nossa Senhora do Bom Sucesso tamb\xe9m previu o nascimento do Santo Cura d\u2019Ars, tamb\xe9m conhecido como S\xe3o Jo\xe3o Maria Vianney. Todas as previs\xf5es de Nossa Senhora do Bom Sucesso reveladas a Irm\xe3 Mariana sobre os males que infligiriam a Igreja e a sociedade se relacionam ao s\xe9culo XX e tamb\xe9m ao nosso tempo.\n\nAtrav\xe9s das profecias de Nossa Senhora do Bom Sucesso a Irm\xe3 Mariana soube das necessidades e sofrimentos pelos quais passar\xedamos. Ela ficou assustada com as grandes desgra\xe7as que iriam afligir a Igreja no s\xe9culo XX: a impiedade, a heresia, e a impureza, que continuam presentes at\xe9 os dias atuais. Devido a essas tr\xeas realidades que at\xe9 hoje assolam a Igreja e a sociedade, a Irm\xe3 Mariana, cujo corpo continua milagrosamente intacto at\xe9 o tempo presente, livremente se prop\xf4s a sofrer por n\xf3s.\n\nQuase todas as previs\xf5es de Nossa Senhora do Bom Sucesso j\xe1 se realizaram. A Virgem Maria  prometeu proteger quem propagar a devo\xe7\xe3o a Ela. Nossa Senhora tamb\xe9m previu que a devo\xe7\xe3o a ela com o t\xedtulo de Nossa Senhora do Bom Sucesso s\xf3 seria difundida no s\xe9culo XX. Ela previu tamb\xe9m, no final do s\xe9culo XVI, que no s\xe9culo XX haveria um esp\xedrito de impureza, que iria saturar a atmosfera desse tempo. \xc9 poss\xedvel ver que essa previs\xe3o se tornou real ao observarmos o celular, a televis\xe3o, a internet, e outras coisas que nos levam \xe0 impureza. Nossa Senhora do Bom Sucesso diz que \u201cquase n\xe3o haver\xe1 mais nenhuma alma virgem no mundo\u201d. Mesmo assim, a Nossa Senhora do Bom Sucesso promete que ainda existir\xe3o pessoas boas, que a ela se dedicam, principalmente na vida religiosa.\n\nNossa Senhora do Bom Sucesso tamb\xe9m previu que as almas das crian\xe7as ficariam mais pervertidas, principalmente nas escolas, pois \xe9 l\xe1 que inoc\xeancia infantil das crian\xe7as \xe9 perdida e, como consequ\xeancia disso, haveriam bem menos voca\xe7\xf5es sacerdotais. A Virgem do Bom Sucesso diz tamb\xe9m que o clero secular estaria ainda muito distante de seu ideal, j\xe1 que os padres descuidariam de seus deveres sagrados, perdendo orienta\xe7\xe3o divina. Eles se afastariam do caminho de Deus rumo ao minist\xe9rio sacerdotal. Os Padres buscariam seu pr\xf3prio bem-estar e sua pr\xf3pria riqueza. Ainda assim Nossa Senhora do Bom Sucesso promete que, se n\xf3s rezarmos esta noite escura acabar\xe1, e Deus enviar\xe1 um pastor que ir\xe1 renovar o esp\xedrito dos seus sacerdotes.",null)
B.TW=new A.aV("A Festa de \u201cCorpus Christi\u201d \xe9 a celebra\xe7\xe3o em que solenemente a Igreja comemora o Sant\xedssimo Sacramento da Eucaristia; sendo o \xfanico dia do ano que o Sant\xedssimo Sacramento sai em prociss\xe3o \xe0s nossas ruas. Nesta festa os fi\xe9is agradecem e louvam a Deus pelo inestim\xe1vel dom da Eucaristia, na qual o pr\xf3prio Senhor se faz presente como alimento e rem\xe9dio de nossa alma. A Eucaristia \xe9 fonte e centro de toda a vida crist\xe3. Nela est\xe1 contido todo o tesouro espiritual da Igreja, o pr\xf3prio Cristo.\n\nA Festa de Corpus Christi surgiu no s\xe9c. XIII, na diocese de Li\xe8ge, na B\xe9lgica, por iniciativa da freira Juliana de Mont Cornillon, (\u20201258) que recebia vis\xf5es nas quais o pr\xf3prio Jesus lhe pedia uma festa lit\xfargica anual em honra da Sagrada Eucaristia.\n\nAconteceu que quando o padre Pedro de Praga, da Bo\xeamia, celebrou uma Missa na cripta de Santa Cristina, em Bolsena, It\xe1lia, ocorreu um milagre eucar\xedstico: da h\xf3stia consagrada come\xe7aram a cair gotas de sangue sobre o corporal ap\xf3s a consagra\xe7\xe3o. Dizem que isto ocorreu porque o padre teria duvidado da presen\xe7a real de Cristo na Eucaristia.\n\nO Papa Urbano IV (1262-1264), que residia em Orvieto, cidade pr\xf3xima de Bolsena, onde vivia S. Tom\xe1s de Aquino, ordenou ao Bispo Giacomo que levasse as rel\xedquias de Bolsena a Orvieto. Isso foi feito em prociss\xe3o. Quando o Papa encontrou a Prociss\xe3o na entrada de Orvieto, pronunciou diante da rel\xedquia eucar\xedstica as palavras: \u201cCorpus Christi\u201d.\n\nEm 11/08/1264 o Papa aprovou a Bula \u201cTransiturus de mundo\u201d, onde prescreveu que na 5\xaa feira ap\xf3s a oitava de Pentecostes, fosse oficialmente celebrada a festa em honra do Corpo do Senhor. S\xe3o Tom\xe1s de Aquino foi encarregado pelo Papa para compor o Of\xedcio da celebra\xe7\xe3o. O Papa era um arcediago de Li\xe8ge e havia conhecido a Beata Cornilon e havia percebido a luz sobrenatural que a iluminava e a sinceridade de seus apelos.\n\nEm 1290 foi constru\xedda a bel\xedssima Catedral de Orvieto, em pedras pretas e brancas, chamada de \u201cL\xedrio das Catedrais\u201d. Antes disso, em 1247, realizou-se a primeira prociss\xe3o eucar\xedstica pelas ruas de Li\xe8ge, como festa diocesana, tornando-se depois uma festa lit\xfargica celebrada em toda a B\xe9lgica, e depois, ent\xe3o, em todo o mundo no s\xe9c. XIV, quando o Papa Clemente V confirmou a Bula de Urbano IV, tornando a Festa da Eucaristia um dever can\xf4nico mundial.\n\nEm 1317, o Papa Jo\xe3o XXII publicou na Constitui\xe7\xe3o Clementina o dever de se levar a Eucaristia em prociss\xe3o pelas vias p\xfablicas. A partir da oficializa\xe7\xe3o, a Festa de Corpus Christi passou a ser celebrada todos os anos na primeira quinta-feira ap\xf3s o domingo da Sant\xedssima Trindade.\n\nTodo cat\xf3lico deve participar dessa Prociss\xe3o por ser a mais importante de todas que acontecem durante o ano, pois \xe9 a \xfanica onde o pr\xf3prio Senhor sai \xe0s ruas para aben\xe7oar as pessoas, as fam\xedlias e a cidade. Em muitos lugares criou-se o belo costume de enfeitar as casas com orat\xf3rios e flores e as ruas com tapetes ornamentados, tudo em honra do Senhor que vem visitar o seu povo.\n\nCome\xe7aram assim as grandes prociss\xf5es eucar\xedsticas, as adora\xe7\xf5es solenes, a B\xean\xe7\xe3o com o Sant\xedssimo no ostens\xf3rio por entre c\xe2nticos. Surgiram tamb\xe9m os Congressos Eucar\xedsticos, as Quarenta Horas de Adora\xe7\xe3o e in\xfameras outras homenagens a Jesus na Eucaristia. Muitos se converteram e todo o mundo cat\xf3lico.",null)
B.TX=new A.aV("Na primavera de 1916, as 3 crian\xe7as (Francisco, L\xfacia e Jacinta) estavam na Loca do Cabe\xe7o (F\xe1tima) a pastorear, quando apareceu-lhes um jovem de mais ou menos 14 ou 15 anos, mais branco que a neve, dizendo:\n\n\u201cN\xe3o temais, sou o Anjo da Paz, orai comigo: Meu Deus eu creio, adoro, espero e amo-vos. Pe\xe7o-vos perd\xe3o para os que n\xe3o creem, n\xe3o adoram, n\xe3o esperam e n\xe3o vos amam\u201d. As crian\xe7as rezaram por tr\xeas vezes, com o rosto ao ch\xe3o. Depois ouviram do anjo: \u201cOrai assim. Os cora\xe7\xf5es de Jesus e de Maria, est\xe3o atentos \xe0 voz de vossas s\xfaplicas\u201d. Essa ora\xe7\xe3o acompanhou os pastorinhos sempre.\n\nA segunda apari\xe7\xe3o deu-se num dia de ver\xe3o, no quintal da casa de L\xfacia, no Po\xe7o do Arneiro. As crian\xe7as estavam brincando sobre o po\xe7o, quando o anjo apareceu-lhes dizendo: \u201cQue fazeis? Orai, orai muito. Os cora\xe7\xf5es sant\xedssimos de Jesus e de Maria, tem sobre v\xf3s des\xedgnios de miseric\xf3rdia\u2026 eu sou o Anjo da sua guarda, o anjo de Portugal\u201d.\n\nNa terceira apari\xe7\xe3o, outono do mesmo ano, novamente na Loca do Cabe\xe7o, as crian\xe7as rezavam a ora\xe7\xe3o que aprenderam na primeira apari\xe7\xe3o, e o Anjo lhes apareceu com o c\xe1lice e uma h\xf3stia. A h\xf3stia a pingar gotas de sangue no c\xe1lice. Elas ajoelharam, e o anjo ensinou-lhes esta ora\xe7\xe3o profund\xedssima que diz da ess\xeancia da mensagem de F\xe1tima:\n\n\u201cSant\xedssima Trindade, Pai, Filho e Espirito Santo, adoro-vos profundamente. E ofere\xe7o-vos o Precios\xedssimo Corpo, Sangue, Alma e Divindade de Jesus Cristo presente em todos os sacr\xe1rios da Terra. Em repara\xe7\xe3o aos ultrajes, sacril\xe9gios e indiferen\xe7as com que Ele mesmo \xe9 ofendido, e pelos m\xe9ritos infinitos do Seu Sant\xedssimo Cora\xe7\xe3o e do Cora\xe7\xe3o Imaculado de Maria, pe\xe7o-vos a convers\xe3o dos pobres pecadores\u201d.\n\nDepois disso, o Anjo da Eucaristia, entregou a h\xf3stia para L\xfacia e o c\xe1lice entre Francisco e Jacinta e disse-lhes: \u201cTomai e bebei o Corpo e o Sangue de Jesus Cristo, horrivelmente ultrajado pelos homens ingratos. Reparai os seus crimes e consolai o vosso Deus.\u201d\n\nEm maio de 1917 o Papa Bento XV, em meio a Primeira Guerra Mundial, convocou todos os cat\xf3licos para se unirem em ora\xe7\xe3o e pedirem a Nossa Senhora que intercedesse na guerra e trouxesse paz para aquele momento. E foi a partir da\xed que come\xe7a a hist\xf3ria de Nossa Senhora de F\xe1tima.\n\nOito dias ap\xf3s a convoca\xe7\xe3o do Papa, em resposta as ora\xe7\xf5es, Nossa Senhora de F\xe1tima fez sua primeira apari\xe7\xe3o em 13 de maio de 1917 na pequena aldeia de F\xe1tima em Portugal. Em um local chamado \u201cCova de Iria\u201d, ela apareceu para tr\xeas pequenos pastorinhos.\n\nPor volta de meio-dia eles brincavam pelo campo enquanto cuidavam de um pequeno rebanho quando pararam para rezar o ter\xe7o, como j\xe1 era de costume. Queriam voltar logo para a brincadeira e por isso rezaram \xe0 moda deles e rapidamente voltaram para o campo e foi quando viram um clar\xe3o bem similar ao de rel\xe2mpagos.\n\nAcharam que ia chover e por isso se recolheram para ir embora e foi quando viram um segundo clar\xe3o em cima da copa de uma \xe1rvore (chamada azinheira) e em seguida viram Nossa Senhora de F\xe1tima. Assustados, quiseram correr, mas Nossa Senhora logo os tranquilizou e pedindo que n\xe3o tivessem medo, pois ela vinha do C\xe9u.\n\nSegundo relato dos pr\xf3prios pastorinhos, a vis\xe3o era de uma \u201cSenhora mais brilhante que o Sol\u201d, e em suas m\xe3os pendia um Ros\xe1rio. Serena e tranquila disse \xe0s crian\xe7as:\n\n\u201cVim para pedir que venhais aqui seis meses seguidos, sempre no dia 13, a esta mesma hora. Depois vos direi quem sou e o que quero. Em seguida, voltarei aqui ainda uma s\xe9tima vez.\u201d\n\nE as apari\xe7\xf5es aconteceram sete meses seguintes conforme o prometido. Antes de ir embora, Nossa Senhora de F\xe1tima ainda ressaltou: \u201cRezem o Ter\xe7o todos os dias, para alcan\xe7arem a paz para o mundo, e o fim da guerra.\u201d\n\nAs apari\xe7\xf5es continuaram nos meses seguintes e mesmo em meio a persegui\xe7\xf5es, maus tratos e acusa\xe7\xf5es de serem mentirosos, L\xfacia, Francisco e Jacinta estavam na Cova de Iria para esperar por Nossa Senhora de F\xe1tima. Tanto que na segunda apari\xe7\xe3o, haviam apenas 50 pessoas os acompanhando.",null)
B.TY=new A.aV('Em 1789 a Fran\xe7a viveu um momento de grande turbul\xeancia social conhecido como Revolu\xe7\xe3o Francesa. Este epis\xf3dio desencadeou, dentre outras coisas, uma persegui\xe7\xe3o feroz \xe0 Igreja e religiosos.\n\nNossa Senhora ent\xe3o, come\xe7a a aparecer de maneira sistem\xe1tica em diversas datas para alertar os fi\xe9is dos perigos vindos desta Revolu\xe7\xe3o. Primeiro em 1830 na Rue de Bac indicando a devo\xe7\xe3o da medalha milagrosa, depois 1846 em La Salette e em 1858 em Lourdes.\n\nNos belos Alpes da Fran\xe7a existe uma montanha chamada La Salette. Ela fica na Diocese de Grenoble. Em setembro do ano de 1846, duas crian\xe7as pastoreavam ovelhas no alto da montanha: um menino chamado Maximim Giraud, de 11 anos, e a adolescente Melanie Calvat, de 15 anos. As duas crian\xe7as tinham pouco estudo por causa do dif\xedcil e exigente trabalho que faziam.\n\nEm uma tarde enquanto esperavam a hora de voltarem para casa, viram uma forte luz e uma bela Senhora sentada numa pedra, com belos trajes de camponesa. Era uma \u201cBelle Dame\u201d, como eles definiram. Ela tinha na cabe\xe7a um diadema dourado e pisava sobre lindas flores, que desapareceram quando ela foi embora. A Senhora estava chorando e disse:\n\n\u201cVinde meus filhos, n\xe3o tenhais medo! Estou aqui para contar uma grande novidade. Se meu povo n\xe3o quiser aceitar, vejo-me for\xe7ada a deixar cair o bra\xe7o de meu Filho. \xc9 t\xe3o forte e t\xe3o pesado que n\xe3o posso mais segurar. A tanto tempo que sofro por v\xf3s! Dei-vos seis dias para trabalhar, reservei-me o s\xe9timo, e n\xe3o mo querem conceder! \xc9 isso que torna t\xe3o pesado o bra\xe7o de Meu Filho.\u201d.\n\nE a Virgem continuou num bonito di\xe1logo com os pequenos pastores:\n\n\u201cE voc\xeas, fazem bem as ora\xe7\xf5es?\u201d\n\nEles responderam: \u201cN\xe3o muito bem.\u201d E Maria continuou:\n\n\u201cMeus filhos, \xe9 preciso faz\xea-las bem, \xe0 noite e de manh\xe3. Quando n\xe3o puderem rezar, recitem ao menos um Pai-Nosso e uma Ave-Maria; mas quando tiverem tempo, \xe9 preciso rezar mais\u201d.\n\nAs crian\xe7as estavam maravilhadas com aquela vis\xe3o. E Nossa Senhora continuou:\n\n"Durante o ver\xe3o, s\xf3 algumas mulheres mais idosas v\xe3o \xe0 Missa. Os outros trabalham no domingo, durante todo o ver\xe3o. Durante o inverno, quanto n\xe3o sabem o que fazer, v\xe3o \xe0 Missa zombar da religi\xe3o. Durante a Quaresma v\xe3o ao a\xe7ougue como c\xe3es."\n\n\u201cOs que conduzem os carros (de boi), n\xe3o o fazem sem abusar do nome de meu Filho. Se a colheita se estraga, n\xe3o \xe9 sen\xe3o por vossa causa. Bem vo-lo mostrei no ano passado com a colheita das batatas e n\xe3o fizestes caso. Ao contr\xe1rio, quando encontr\xe1veis estragadas, era ent\xe3o que em tom de revolta, pronunci\xe1veis o nome de meu Filho.\u201d As crian\xe7as reconheciam que essas coisas realmente tinham acontecido com o povo daquela regi\xe3o.',null)
B.TZ=new A.aV('Em Lanciano \u2013 s\xe9c. VIII. Um monge da ordem de S\xe3o Bas\xedlio estava celebrando uma missa na Igreja dos santos Degonciano e Domiciano. Ele, que se sentia atormentado pela d\xfavida na cren\xe7a cat\xf3lica da transubstancia\xe7\xe3o (mudan\xe7a da subst\xe2ncia do p\xe3o e do vinho na subst\xe2ncia f\xedsica do Corpo e Sangue de Jesus Cristo no ato da consagra\xe7\xe3o), segundo a tradi\xe7\xe3o, durante uma missa, viu a h\xf3stia, no momento do ato da consagra\xe7\xe3o, converter-se em carne viva e o vinho em sangue vivo.\n\nO exame das rel\xedquias, segundo crit\xe9rios rigorosamente cient\xedficos, foi efetuado em 1970-71 e outra vez em 1981 pelo Professor Odoardo Linoli, catedr\xe1tico de Anatomia e Histologia Patol\xf3gica e Qu\xedmica e Microscopia Cl\xednica, coadjuvado pelo Professor Ruggero Bertelli, da Universidade de Siena. Resultados:\n\n1) A h\xf3stia \xe9 realmente constitu\xedda por fibras musculares estriadas, pertencentes ao mioc\xe1rdio.\n\n2) Quanto ao sangue, trata-se de genu\xedno sangue humano. Mais: o grupo sang\xfc\xedneo "A" que pertencem os vest\xedgios de sangue, o sangue contido na carne e o sangue do c\xe1lice revela tratar-se sempre do mesmo sangue grupo "AB" (sangue comum aos Judeus). Este \xe9 tamb\xe9m o grupo que o professor Pierluigi Baima Bollone, da universidade de Turim, identificou no Santo Sud\xe1rio.\n\n3) Apesar da sua antiguidade, a carne e o sangue se apresentam com uma estrutura de base intacta e sem sinais de altera\xe7\xf5es substanciais; este fen\xf4meno se d\xe1 sem que tenham sido utilizadas subst\xe2ncias ou outros fatores aptos a conservar a mat\xe9ria humana, mas, ao contr\xe1rio, apesar da a\xe7\xe3o dos mais variados agentes f\xedsicos, atmosf\xe9ricos, ambientais e biol\xf3gicos.',null)
B.U_=new A.aV("O menino ia crescendo e se fortificava: estava cheio de sabedoria, e a gra\xe7a de Deus repousava nele. Seus pais iam todos os anos a Jerusal\xe9m para a festa da P\xe1scoa. Tendo ele atingido doze anos, subiram a Jerusal\xe9m, segundo o costume da festa. Acabados os dias da festa, quando voltavam, ficou o menino Jesus em Jerusal\xe9m, sem que os seus pais o percebessem. Pensando que ele estivesse com os seus companheiros de comitiva, andaram caminho de um dia e o buscaram entre os parentes e conhecidos. Mas n\xe3o o encontrando, voltaram a Jerusal\xe9m, \xe0 procura dele. Tr\xeas dias depois o acharam no templo, sentado no meio dos doutores, ouvindo-os e interrogando-os. Todos os que o ouviam estavam maravilhados da sabedoria de suas respostas. Quando eles o viram, ficaram admirados. E sua m\xe3e disse-lhe: \u201cMeu filho, que nos fizeste?! Eis que teu pai e eu and\xe1vamos \xe0 tua procura, cheios de afli\xe7\xe3o\u201d. Respondeu-lhes ele: \u201cPor que me procur\xe1-veis? N\xe3o sab\xedeis que devo ocupar-me das coisas de meu Pai?\u201d. Eles, por\xe9m, n\xe3o compreenderam o que ele lhes dissera. Em seguida, desceu com eles a Nazar\xe9 e lhes era submisso. Sua m\xe3e guardava todas essas coisas no seu cora\xe7\xe3o. E Jesus crescia em estatura, em sabedoria e gra\xe7a, diante de Deus e dos homens.",null)
B.U0=new A.aV("Chegando o dia de Pentecostes, estavam todos reunidos no mesmo lugar. De repente, veio do c\xe9u um ru\xeddo, como se soprasse um vento impetuoso, e encheu toda a casa onde estavam sentados. Apareceu-lhes ent\xe3o uma esp\xe9cie de l\xednguas de fogo, que se repartiram e pousaram sobre cada um deles. Ficaram todos cheios do Esp\xedrito Santo e come\xe7aram a falar em outras l\xednguas, conforme o Esp\xedrito Santo lhes concedia que falassem. Achavam-se ent\xe3o em Jerusal\xe9m judeus piedosos de todas as na\xe7\xf5es que h\xe1 debaixo do c\xe9u. Ouvindo aquele ru\xeddo, reuniu-se muita gente e maravilhava-se de que cada um os ouvia falar na sua pr\xf3pria l\xedngua. Profundamente impressionados, manifestavam a sua admira\xe7\xe3o: \u201cN\xe3o s\xe3o, porventura, galileus todos estes que falam? Como ent\xe3o todos n\xf3s os ouvimos falar, cada um em nossa pr\xf3pria l\xedngua materna? Partos, medos, elamitas; os que habitam a Mesopot\xe2mia, a Judeia, a Capad\xf3cia, o Ponto, a \xc1sia, a Fr\xedgia, a Panf\xedlia, o Egito e as prov\xedncias da L\xedbia pr\xf3ximas a Cirene; peregrinos romanos, judeus ou pros\xe9litos, cretenses e \xe1rabes; ouvimo-los publicarem em nossas l\xednguas as maravilhas de Deus!\u201d. Estavam, pois, todos at\xf4nitos e, sem saber o que pensar, perguntavam uns aos outros: \u201cQue significam estas coisas?\u201d. Outros, por\xe9m, escarnecendo, diziam: \u201cEst\xe3o todos embriagados de vinho doce\u201d.",null)
B.U1=new A.aV('A Sant\xedssima Virgem apareceu 15 vezes, em 1876, na pequena cidade de Pellevoisin, diocese de Bourges, no Berry, centro da Fran\xe7a. A vidente, Estelle Faguette, foi miraculada durante as apari\xe7\xf5es. Gravemente doente, desenganada pelos m\xe9dicos, sua cura causou espanto e admira\xe7\xe3o em todo o pa\xeds.\n\nEstelle nasceu em 1843, de pais muito pobres. Sempre adoentada, levava uma vida simples, de empregada dom\xe9stica. Aconselhada por seu confessor, que era p\xe1roco da Madeleine, em Paris, passou algum tempo entre as freiras agostinianas, servindo como enfermeira no H\xf4tel-Dieu, grande hospital da capital. Podia assim, simultaneamente, cuidar dos doentes e ser cuidada. Entretanto sua sa\xfade, cada vez mais fraca, levou-a a interromper o noviciado em 1863.\n\nEnferma havia mais de 10 anos, a doen\xe7a se agravou em junho de 1875. De acordo com declara\xe7\xf5es de seus m\xe9dicos \u2014 Dr. Benard e Dr. Hubert, ambos de Buzan\xe7ais \u2013\u2013 Estelle sofria de tuberculose, peritonite aguda e de um tumor abdominal. Em 10 de fevereiro de 1876, a morte estava pr\xf3xima: ela n\xe3o teria vida por mais do que algumas horas, afirmou o Dr. Benard.\n\nOcorreu ent\xe3o a primeira das 15 apari\xe7\xf5es de Nossa Senhora, na noite fria de 14 a 15 de fevereiro. J\xe1 desenganada pelo m\xe9dico, Estelle esperava resignadamente a morte. Entre ora\xe7\xf5es e lembran\xe7as da vida passada, renovava a cada instante o oferecimento a Deus de seu \xfaltimo sacrif\xedcio.\n\nDe repente, do lado direito de sua cama ela viu uma forma humana horr\xedvel, amea\xe7adora, que agarrou seu leito e o sacudiu violentamente. Estelle n\xe3o duvidou tratar-se do pr\xf3prio dem\xf4nio. Mas o dem\xf4nio ali presente, no momento da morte? A vis\xe3o aterrorizante parecia-lhe uma promessa do inferno. Foi tomada de p\xe2nico, enquanto a besta humana rugia.\n\nPor\xe9m, nesse instante de confus\xe3o e terror, Maria Sant\xedssima apareceu, com beleza indescrit\xedvel, toda de branco, com um longo v\xe9u caindo at\xe9 os p\xe9s. Seu olhar se dirigiu \xe0 enferma com bondade indiz\xedvel. Em seguida, fixou o dem\xf4nio e disse:\n\n"O que fazes aqui? N\xe3o v\xeas que ela est\xe1 vestida com o h\xe1bito que Eu e meu Filho divino lhe demos?"\n\nMencionando o h\xe1bito, Nossa Senhora se referia \xe0 sua medalha, que Estelle sempre usava. O dem\xf4nio fugiu, n\xe3o suportando o olhar de Maria. Nossa Senhora disse ent\xe3o \xe0 sua filha:\n\n"N\xe3o tenhas medo! Sabes que \xe9s minha filha. \xc2nimo e paci\xeancia. Meu Filho vai se deixar tocar. Sofrer\xe1s ainda cinco dias em honra das cinco chagas de meu Filho. S\xe1bado pr\xf3ximo morrer\xe1s ou ser\xe1s curada." Para a cura, Nossa Senhora estabeleceu uma condi\xe7\xe3o: "Se meu Filho te conceder a vida, anunciar\xe1s minha gl\xf3ria."\n\nPerguntando-se o que poderia significar o an\xfancio da gl\xf3ria de Maria, Estelle viu junto a Nossa Senhora uma placa de m\xe1rmore branco, na qual estava gravado o Imaculado Cora\xe7\xe3o de Maria. Vindo-lhe ao esp\xedrito a pergunta se deveria colocar essa placa na igreja de Notre Dame des Victoires ou em Pellevoisin, a Virgem lhe disse: "Em Notre Dame des Victoires j\xe1 existem muitas marcas de meu poder. Em Pellevoisin, n\xe3o. Os fi\xe9is daqui t\xeam necessidade de mais \xe2nimo." Estelle prometeu ent\xe3o fazer tudo pela gl\xf3ria de Nossa Senhora. Nesse instante cessou a vis\xe3o. Evidentemente, ela narrou tudo a seu p\xe1roco no dia seguinte. Este ouviu pacientemente, mas dado o estado ag\xf4nico de sua penitente, julgou tratar-se de alucina\xe7\xe3o.\n\nNa noite seguinte, 15 a 16 de fevereiro, o dem\xf4nio voltou a aparecer. Desta vez ele guardou certa dist\xe2ncia, temeroso de aproximar-se da cama, como se um impedimento o retivesse. Mesmo assim, a vis\xe3o era terrificante. Nossa Senhora logo apareceu, e estabeleceu-se um di\xe1logo com a vidente:\n\n"N\xe3o temas, estou aqui. Meu Filho teve piedade de ti. Ser\xe1s curada s\xe1bado e anunciar\xe1s minha gl\xf3ria."\n\nEnt\xe3o Estelle disse: "Mas, minha M\xe3e bondosa, j\xe1 que estou bem preparada, n\xe3o \xe9 melhor que eu morra?"\n\nA Virgem Maria a repreende: "Ingrata, se meu Filho te salva, \xe9 porque tens necessidade da vida. O que de mais precioso deu Ele aos homens nesta Terra? Ele te conservar\xe1 a vida, mas n\xe3o creio que te poupar\xe1 de sofrimentos. Sofrer\xe1s e muitas ser\xe3o tuas penas. O sofrimento d\xe1 m\xe9ritos \xe0 vida. Foi tua grande resigna\xe7\xe3o e paci\xeancia que tocaram o cora\xe7\xe3o de meu Filho. N\xe3o percas o fruto que escolheste."\n\nNesse instante Estelle viu, uma a uma, suas faltas passadas. Faltas que, no entanto, ela considerava sem import\xe2ncia. Nossa Senhora desapareceu deixando-a imersa em profunda contri\xe7\xe3o, pois compreendeu que mesmo os pecados veniais s\xe3o severamente detestados por Nossa Senhora.\n\nNa terceira apari\xe7\xe3o o dem\xf4nio ainda precedeu Nossa Senhora, mas estava ainda mais distante de Estelle, que o viu vagamente, discernindo sobretudo seus gestos de \xf3dio.\n\nCom a recorda\xe7\xe3o muito viva dos pecados vistos na noite anterior, Estelle foi tomada de temor em presen\xe7a da Imaculada, que no entanto a tranq\xfcilizou: \xc2nimo, minha filha, tudo isso passou, tua resigna\xe7\xe3o resgatou tuas faltas passadas. Maria lhe fez ver seus atos de virtude e falou-lhe dos grandes desejos que lhe v\xe3o no cora\xe7\xe3o: a santifica\xe7\xe3o dos bons; a convers\xe3o dos pecadores; a pr\xe1tica da bondade e da amenidade de uns com os outros. E acrescentou: Sou toda misericordiosa, obtendo tudo de meu Filho. Tuas boas a\xe7\xf5es e fervorosas ora\xe7\xf5es tocaram meu Cora\xe7\xe3o materno. Na pequena carta que me escreveste em setembro, sobretudo esta frase tocou-me particularmente: \u2018Vede a situa\xe7\xe3o de meus pais, caso eu venha a morrer. Eles teriam que pedir esmolas. Lembrai-vos de vossos sofrimentos quando vistes Jesus, vosso Filho, cravado na cruz\u2019. Mostrei essa carta a meu Filho. Teus pais necessitam de ti. De agora em diante, trata de ser fiel. N\xe3o percas as gra\xe7as que te s\xe3o dadas, e anuncia minha gl\xf3ria.\n\nUma quarta vez apareceu-lhe Maria, entre 17 e 18 de fevereiro, repetindo o que anteriormente lhe dissera. Nossa Senhora parecia querer deixar bem claro a recomenda\xe7\xe3o de anunciar sua gl\xf3ria, e para isso torna a dizer-lhe: Faze todo esfor\xe7o.\n\nNa sexta-feira, 18 de fevereiro, o estado de sa\xfade de Estelle tinha se agravado muito. Pe. Salmon, seu confessor, julgando-a no extremo da vida, disp\xf5e-se a ouvir sua confiss\xe3o. A enferma se recusou, dizendo que s\xf3 se confessar\xe1 depois de sua cura, que ela espera para o dia seguinte. O Padre se retirou, certo de que seria chamado durante a madrugada para assistir a moribunda. Tal n\xe3o aconteceu.\n\n\xc0s seis horas da manh\xe3 o Pe. Salmon foi ver Estelle. Encontrou-a ainda no leito, e, para sua surpresa, viva. Celebrou a Missa em seu quarto, na presen\xe7a de outras pessoas. Terminada a Missa, perguntou a Estelle como se sentia. Ela fez o sinal da Cruz, com o bra\xe7o direito inteiramente cicatrizado, levantou-se e vestiu-se sozinha, radiante de sa\xfade. Toda a cidade de Pellevoisin foi v\xea-la. Os m\xe9dicos que a julgaram condenada atestaram sua cura total e completa. O atestado do Dr. Bucquoy, da Academia de Medicina de Paris, foi decisivo para a comiss\xe3o que em 1877 examinou o caso. E a cura n\xe3o foi passageira, Estelle viveu em boa sa\xfade at\xe9 a idade de 86 anos.\n\nMas o que se dera durante a noite? Nossa Senhora aparecera mais uma vez, postando-se bem mais pr\xf3ximo do leito de Estelle. A placa de m\xe1rmore tamb\xe9m fez parte desta vis\xe3o, mas agora com uma inscri\xe7\xe3o: Invoquei Maria no auge de minha mis\xe9ria, e Ela obteve de seu Filho minha cura total. Seguia-se a assinatura: Estelle F. Um cora\xe7\xe3o traspassado por um gl\xe1dio e cercado de rosas aparecia na parte superior. Estelle prometeu a Maria lutar sempre por sua gl\xf3ria. Nossa Senhora lhe recomendou: "Se queres servir-me, s\xea simples; e que teus atos correspondam \xe0s tuas palavras\u201d.\n\nEstelle perguntou-lhe se deveria tornar-se religiosa, e a Virgem respondeu:\n\n"Pode-se salvar em todas as condi\xe7\xf5es. Podes fazer muito bem e anunciar minha gl\xf3ria tal como \xe9s. O que me aflige \xe9 a falta de respeito por meu Filho na Santa Eucaristia e a atitude de distra\xe7\xe3o com outras coisas, que se toma na ora\xe7\xe3o. Digo isto para as pessoas que pretendem ser piedosas."\n\nEstelle perguntou se deveria transmitir aos outros o que acabava de ouvir, e Maria respondeu: "Sim, sim, anuncia minha gl\xf3ria, mas antes de falar, espera conselho de teu confessor e diretor espiritual. Sofrer\xe1s ciladas, tratar-te-\xe3o de vision\xe1ria, de exaltada, de louca. Eu te ajudarei."\n\nUma vez curada, Estelle lan\xe7ou-se ao trabalho pela gl\xf3ria de Maria, tal como Ela lhe havia pedido. Afligindo-se com suas imperfei\xe7\xf5es na execu\xe7\xe3o desse santo trabalho, Nossa Senhora apareceu-lhe uma sexta vez, durante a ora\xe7\xe3o do Ros\xe1rio: Calma, minha filha. Paci\xeancia. Ter\xe1s sofrimentos, mas estarei sempre aqui.\n\nNa festa da Visita\xe7\xe3o da Sant\xedssima Virgem, 2 de julho, Nossa Senhora lhe apareceu pela s\xe9tima vez, \xe0s 23:30h. A M\xe3e de Deus estava cercada de rosas de todas as cores, particularmente brancas, vermelhas e amarelas. Foram tr\xeas curtas apari\xe7\xf5es, parecendo simbolizar os tr\xeas ter\xe7os do Ros\xe1rio. Tens anunciado minha gl\xf3ria. Continua. Meu Filho tem almas prediletas. Seu Cora\xe7\xe3o tem tanto amor pelo meu, que nada lhe recusa. Por meu interm\xe9dio Ele tocar\xe1 os cora\xe7\xf5es mais empedernidos.\n\nEstelle queria ainda pedir um sinal do poder da Sant\xedssima Virgem, mas n\xe3o conseguia exprimir-se adequadamente. Nossa Senhora, lendo-lhe o pensamento, disse: Tua cura n\xe3o \xe9 uma das maiores provas de meu poder? E acrescentou: Vim para a convers\xe3o dos pecadores.\n\nNo dia seguinte Nossa Senhora apareceu mais uma vez, cercada de rosas. Estelle a esperava com certa agita\xe7\xe3o, e Nossa Senhora a repreendeu docemente: Gostaria que fosses mais calma. Eu n\xe3o tinha marcado dia nem hora em que voltaria. Necessitas de repouso. Ficarei apenas alguns minutos.\n\nA nona apari\xe7\xe3o deu-se em 9 de setembro. Nossa Senhora insistiu ainda sobre a calma e a tranq\xfcilidade de alma. \u201cFoste privada de minha presen\xe7a em 15 de agosto, porque n\xe3o tinhas suficiente calma. Tens bem o car\xe1ter franc\xeas, que deseja saber tudo em lugar de aprender, e compreender tudo antes de saber. Ainda ontem eu quis vir, mas tiveste que ficar sem minha presen\xe7a. Esperava de ti este ato de submiss\xe3o e de obedi\xeancia. H\xe1 muito tempo os tesouros de meu Filho est\xe3o abertos\u201d.\n\nNesse instante Nossa Senhora lhe deu o escapul\xe1rio do Sagrado Cora\xe7\xe3o de Jesus, tirando-o de seu peito: Tenho predile\xe7\xe3o por esta devo\xe7\xe3o, e nela serei honrada. Nossa Senhora, ap\xf3stola da devo\xe7\xe3o ao Sagrado Cora\xe7\xe3o de Jesus, trazia consigo esse escapul\xe1rio, e nos recomendou o cora\xe7\xe3o que tanto amou os homens. A Virgem Sant\xedssima portava tamb\xe9m esse escapul\xe1rio quando apareceu pela d\xe9cima vez, e n\xe3o o deixar\xe1 mais. Eram tr\xeas horas da tarde, soaram as V\xe9speras, e Ela disse antes de desaparecer: "Que todos rezem".\n\nA d\xe9cima primeira apari\xe7\xe3o se deu em presen\xe7a de 15 pessoas. Era uma sexta-feira, 15 de setembro. Nossa Senhora apareceu com as m\xe3os juntas, em ora\xe7\xe3o."Sei que fizeste grande esfor\xe7o para conservar-te calma. N\xe3o \xe9 apenas para ti que pe\xe7o a calma, mas para toda a Igreja e a Fran\xe7a. A Igreja n\xe3o goza dessa paz que eu desejo. Ap\xf3s profundo suspiro, acrescentou: Que todos rezem e tenham confian\xe7a em mim. Fran\xe7a \u2014 o que n\xe3o fiz por ela? Quantas advert\xeancias! E assim mesmo ela recusa ouvir. N\xe3o posso mais conter meu Filho. E terminou acentuando especialmente estas palavras: A Fran\xe7a sofrer\xe1."\n\nPassaram ent\xe3o diante dos olhos de Estelle v\xe1rios quadros nunca antes vistos: soldados em uniforme azul, desconhecidos dela, usando capacetes \u201cem forma de caldeir\xe3o\u201d, segundo sua express\xe3o. Estavam entrincheirados. Mais tarde, em 1914, durante a Grande Guerra, ela reconheceu aqueles soldados.\n\nNum segundo quadro, ela via combates de rua entre civis e soldados. Maria lhe disse ent\xe3o: Coragem e confian\xe7a. Tanto pior para os que n\xe3o acreditarem. Eles reconhecer\xe3o mais tarde a veracidade de minhas palavras.\n\nNa apari\xe7\xe3o de 1\xba de novembro de 1876 (d\xe9cima segunda), n\xe3o houve palavras. Maria manifestou apenas terna bondade em rela\xe7\xe3o \xe0 vidente. A seguinte apari\xe7\xe3o (d\xe9cima terceira) se deu em presen\xe7a de uma religiosa, enquanto Estelle rezava o ter\xe7o: Eu te escolhi. Escolho os pequenos e fracos para minha gl\xf3ria. Coragem: o tempo das provas vai come\xe7ar. Dito isto, a Virgem cruzou os bra\xe7os sobre o peito e desapareceu.\n\nNa d\xe9cima quarta apari\xe7\xe3o, Nossa Senhora lhe falou no s\xe1bado, 11 de novembro de 1876, por volta das 4 horas da tarde, em presen\xe7a de cinco pessoas, quanto ela rezava seu Ros\xe1rio. Nossa Senhora lhe disse: N\xe3o perdeste teu tempo hoje; trabalhaste por mim. De fato, Estelle tinha bordado um escapul\xe1rio, e a Virgem acrescentou: \xc9 preciso fazer muitos outros.\n\nPassaram ent\xe3o diante dos olhos de Estelle v\xe1rios quadros nunca antes vistos: soldados em uniforme azul, desconhecidos dela, usando capacetes \u201cem forma de caldeir\xe3o\u201d, segundo sua express\xe3o. Estavam entrincheirados. Mais tarde, em 1914, durante a Grande Guerra, ela reconheceu aqueles soldados.\n\nNum segundo quadro, ela via combates de rua entre civis e soldados. Maria lhe disse ent\xe3o: Coragem e confian\xe7a. Tanto pior para os que n\xe3o acreditarem. Eles reconhecer\xe3o mais tarde a veracidade de minhas palavras.\n\nNa apari\xe7\xe3o de 1\xba de novembro de 1876 (d\xe9cima segunda), n\xe3o houve palavras. Maria manifestou apenas terna bondade em rela\xe7\xe3o \xe0 vidente. A seguinte apari\xe7\xe3o (d\xe9cima terceira) se deu em presen\xe7a de uma religiosa, enquanto Estelle rezava o ter\xe7o: Eu te escolhi. Escolho os pequenos e fracos para minha gl\xf3ria. Coragem: o tempo das provas vai come\xe7ar. Dito isto, a Virgem cruzou os bra\xe7os sobre o peito e desapareceu.\n\nNa d\xe9cima quarta apari\xe7\xe3o, Nossa Senhora lhe falou no s\xe1bado, 11 de novembro de 1876, por volta das 4 horas da tarde, em presen\xe7a de cinco pessoas, quanto ela rezava seu Ros\xe1rio. Nossa Senhora lhe disse: N\xe3o perdeste teu tempo hoje; trabalhaste por mim. De fato, Estelle tinha bordado um escapul\xe1rio, e a Virgem acrescentou: \xc9 preciso fazer muitos outros.\n\nImagem e c\xedrio vocativoA festa da Imaculada Concei\xe7\xe3o foi escolhida por Nossa Senhora para sua 15\xaa e \xfaltima apari\xe7\xe3o. Foi a mais importante de todas, tendo-se dado perante 15 pessoas. Pouco depois de meio-dia Estelle foi a seu quarto, agora transformado em orat\xf3rio, com permiss\xe3o do bispo. Nossa Senhora lhe apareceu mais bela do que anteriormente, cercada de rosas: Minha filha, lembra-te de minhas palavras. De todas as palavras de Nossa Senhora, as que mais marcaram Estelle naquele momento eram: Sabes que \xe9s minha filha. Eu sou toda miseric\xf3rdia e senhora de meu Filho. O que mais me aflige \xe9 a falta de respeito por meu Filho na Santa Comunh\xe3o e a atitude de distra\xe7\xe3o com outras coisas, que se tem na ora\xe7\xe3o. Seu Cora\xe7\xe3o tem tanto amor pelo meu, que nada lhe recusa. Por meu interm\xe9dio Ele tocar\xe1 os cora\xe7\xf5es mais empedernidos. Vim especialmente para a convers\xe3o dos pecadores. H\xe1 muito tempo os tesouros de meu Filho est\xe3o abertos. Que rezem. Tenho predile\xe7\xe3o por esta devo\xe7\xe3o. Aqui serei honrada. N\xe3o \xe9 apenas para ti que pe\xe7o a calma, mas para toda a Igreja e a Fran\xe7a. Eu te escolhi. Escolho os pequenos e fracos para minha gl\xf3ria. E recomendou: Repete-as sempre. Que elas [as palavras] te fortifiquem e te reconfortem na hora da prova\xe7\xe3o. N\xe3o me rever\xe1s mais.\n\nA vidente mostrou-se perturbada por estas \xfaltimas palavras. Nossa Senhora acrescentou ent\xe3o de modo profundamente materno: Estarei invisivelmente a teu lado. Estelle viu ent\xe3o ao longe, \xe0 esquerda da vis\xe3o, pessoas com gestos amea\xe7adores. Mas tamb\xe9m, em outro plano, pessoas que pareciam boas. Maria, referindo-se ao grupo da esquerda, disse: N\xe3o os temas. Eu te escolhi para dar-me gl\xf3ria e propagar esta devo\xe7\xe3o. Estelle, vendo que Nossa Senhora segurava o escapul\xe1rio, pediu-o como presente, e a Virgem ordenou: Levanta-te e oscula-o. Tendo feito o que a Virgem lhe disse, exclamou: Osculei verdadeiramente um cora\xe7\xe3o de carne, senti o calor e as pulsa\xe7\xf5es.\n\nNossa Senhora lhe disse ent\xe3o para apresentar ao bispo aquele modelo de escapul\xe1rio, e exprimiu o desejo de que todos o portem, a fim de reparar os ultrajes sofridos pelo Sant\xedssimo Sacramento. Em sinal das gra\xe7as dadas aos que o portam, Nossa Senhora fez cair de suas m\xe3os uma chuva abundante: Essas gra\xe7as s\xe3o de meu Filho. Colho-as em seu Cora\xe7\xe3o. Ele n\xe3o pode me recusar.\n\nEstelle perguntou o que conviria representar do outro lado do escapul\xe1rio, e ouviu esta resposta singular: "Quero que tu decidas. Submeter\xe1s tua id\xe9ia, e a Igreja decidir\xe1. E afastando-se, acrescentou: Coragem. Se ele n\xe3o conceder o que pedes (Nossa Senhora se referia ao bispo) e puser dificuldades, ir\xe1s al\xe9m. Nada temas, eu te ajudarei". Com estas palavras, Nossa Senhora encerrou as apari\xe7\xf5es.\n\nAinda em 1876, com licen\xe7a eclesi\xe1stica, o quarto das apari\xe7\xf5es foi transformado em orat\xf3rio, e pouco depois em capela. No ano seguinte foi erigida a Confraria da M\xe3e de Todas as Miseric\xf3rdias, elevada \xe0 dignidade de Arquiconfraria em 1894, por Le\xe3o XIII. O mesmo Papa ofereceu um c\xedrio a essa capela, concedendo indulg\xeancias aos peregrinos. Em 1904, o Cardeal Merry del Val ofereceu a S\xe3o Pio X um livro recentemente publicado sobre as apari\xe7\xf5es. O Pont\xedfice enviou sua b\xean\xe7\xe3o em testemunho de sua acolhida favor\xe1vel, e tamb\xe9m recebeu Estelle em mar\xe7o de 1912. Em 1922, Pio XI concedeu aos p\xe1rocos de Pellevoisin o poder de impor o escapul\xe1rio do Sagrado Cora\xe7\xe3o de Jesus (nona apari\xe7\xe3o), bem como o de conceder indulg\xeancias. Em 1979, o Cardeal Ciappi OP, mestre do Pal\xe1cio Apost\xf3lico, entregou a Jo\xe3o Paulo II o livro sobre o centen\xe1rio das apari\xe7\xf5es. Em 1983, a comiss\xe3o teol\xf3gica que analisou os relat\xf3rios m\xe9dicos a respeito da cura de Estelle concluiu seus trabalhos. O arcebispo de Bourges, Dom Paul Vignancour, com base nessas conclus\xf5es, reconheceu oficialmente o milagre, um grande milagre.\n\nFonte: catolicismo.com.br',null)
